	(12, 'media_report', '', '요양병원도 의료시설, 꼼꼼히 따져보고 신중하게 선택해야', '<p><img alt="한국경제" src="http://mimgnews1.naver.net/image/upload/office_logo/015/2017/01/05/logo_015_11_20170105110805.gif" style="border-style:initial; border-width:0px; box-sizing:border-box; height:40px; max-width:100%; vertical-align:middle; width:85px" title="한국경제" /> | 기사입력&nbsp;2017-10-18 15:15</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:12pt"><strong>요양병원도 의료시설, 꼼꼼히 따져보고 신중하게 선택해야</strong></span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p><strong>전문의 상주 여부와 의사 1명 당 환자 수, 시설 상태 등 종합적으로 따져야</strong><br />\r\n<br />\r\n<img alt="7a4590c3a4a9999af660163fd458fdff_1508385998_9952.jpg" src="http://geumsa.com/data/editor/1710/7a4590c3a4a9999af660163fd458fdff_1508385998_9952.jpg" style="border:0px; box-sizing:border-box; max-width:100%; vertical-align:middle" title="7a4590c3a4a9999af660163fd458fdff_1508385998_9952.jpg" /><br />\r\n<br />\r\n우리나라 국민의 기대수명은 83.1세지만 행복수명은 74.6세인 것으로 나타났다. 행복수명이란 건강과 경제, 사회, 인간관계 등을 기반으로 행복하게 살 수 있는 기간을 뜻하며, 당뇨나 고혈압, 치매, 암 등 질병으로 노년을 건강하게 보내지 못하면 아무리 오래 살아도 행복하지 않다는 생각이 반영된 것이다.<br />\r\n<br />\r\n실제로 2014년 49만 6034명이던 요양병원 입원환자 수는 지난해 54만 3753명으로 증가하였다. 그만큼 많은 이들이 다양한 질병으로 고생을 하고 있다는 뜻이며, 노인인구의 비중이 20%를 초과하는 초고령 사회가 되면 요양병원을 찾는 사람은 폭발적으로 증가할 것으로 보인다.<br />\r\n<br />\r\n하지만 요양병원도 의료시설이기 때문에 단순히 집과 가깝다는 이유에서, 주변 사람의 소개를 받아 덜컥 선택하는 것은 옳지 않다. 더욱이 일반병원처럼 통원치료를 받거나 이곳 저곳을 돌아다니는 의료쇼핑이 불가능하므로 꼼꼼히 따져보고 신중하게 선택해야 한다.<br />\r\n<br />\r\n해림의료재단 부산금사요양병원 주영민 이사장은 &quot;요양병원은 짧게는 몇 달, 길게는 몇 년까지 머무는 곳이므로 첫 선택이 매우 중요하다&quot;라며 요양병원 선택 시 참고할 수 있는 몇 가지 기준을 소개했다.<br />\r\n<br />\r\n우선 환자의 질병에 대한 전문성을 갖춘 것은 물론 여러 과의 원활한 협진이 가능한 곳이어야 한다. 요양병원을 찾는 이들은 대부분 복합적인 질병을 가진 고령자이므로, 내과와 외과, 신경과, 한의과 등 각 진료과에 전문적인 인력이 확보되어 있어야 한다는 이야기이다.<br />\r\n<br />\r\n또 의사와 간호사 등의 인력 한명이 몇 명의 환자를 담당하는지도 중요한데, 의료 서비스의 질에 영향을 줄 수 있는 문제이기 때문이다. 나아가 간호사나 요양보호사의 친절도와 환자 및 보호자의 만족도도 체크해야 할 리스트이다. 환자들이 가족과 떨어진 환경에서 불안감이나 외로움을 느끼지 않고 안정된 마음을 가지고 지낼 수 있는 환경이 조성되어야 함을 뜻한다.<br />\r\n<br />\r\n마지막으로 각 입원실마다 냉난방과 온습도 조절이 잘 되는지, 채광이나 환기, 배기가 우수한지 등 시설적인 부분도 확인해야 한다.<br />\r\n<br />\r\n주 이사장은 &quot;되도록이면 많은 요양병원을 방문하여 직접 시설 상태와 분위기, 식사의 품질 등을 확인해보아야 질 높은 요양병원을 선택할 수 있다&quot;라고 조언했다.<br />\r\n<br />\r\n한편 부산금사요양병원은 최근 부산 금정구 금사동에 지상 7층, 199병상 규모로 신축 이전을 하여 내과와 외과, 가정의학과, 한방과 등의 전문의 및 한의사를 두고 양/한방 협진 서비스를 제공하고 있다.<br />\r\n<br />\r\n야간에도 전문의가 응급 상황에 철저하게 대비하며, 전문 물리치료사가 상주하는 40평 규모의 물리치료실과 중증환자 케어를 위한 집중치료실을 마련해놓고 있다. 또 의료법 시행규칙과 소방안전시설 규정에 따라 병상 간 거리를 넓히고 각 병실마다 스프링쿨러를 설치하여 안전하고 쾌적한 시설을 완성했다.<br />\r\n<br />\r\n한경닷컴 뉴스팀 newsinfo@hankyung.com</p>\r\n', 'admin', '', 0, 'Y', 'N', 1, '2018-11-20 16:34:59', '0000-00-00 00:00:00'),
	(13, 'notice', '', '부산금사요양병원 홈페이지가 새롭게 단장되었습니다!', '<p>기존의 홈페이지에서 느끼셨던 불편함을 상당부분 개선하여,</p>\r\n\r\n<p>PC뿐만 아니라, 모바일에서도 간편하고 쉽게 이용할 수 있는</p>\r\n\r\n<p>반응형 홈페이지로 새롭게 단장하였습니다.</p>\r\n\r\n<p>앞으로도 많은 성원과 관심 부탁드립니다.</p>\r\n\r\n<p>감사합니다.</p>\r\n', 'admin', 'Y', 0, 'N', 'N', 4, '2018-12-02 14:27:34', '0000-00-00 00:00:00'),
	(14, 'media_report', '', '해림의료재단, 부산금사요양병원 지상 7층·199병상 규모 신축 이전 본격 진료(수원일보)', '<p><span style="color:rgb(0, 0, 0); font-family:나눔고딕,nanumgothic; font-size:12pt">최근 국민건강보험공단이 내놓은 &lsquo;2016년 65세 이상 사망자 중 시도별 요양병원&middot;요양원 평균 재원기간 현황조사&rsquo;에 따르면, 요양병원 입원 기간이 노인 1인 평균 347일로 나타났다. 짧지 않은 기간이다. </span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 0); font-family:나눔고딕,nanumgothic; font-size:12pt">이제까지는 요양병원을 선택할 때, 집과 가까워 병문안이 용이하고, 병원비가 비교적 저렴하고, 지인 소개라서 믿을 수 있는 곳 등 보호자 중심에서 선택하던 것이 일반적이었다. </span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 0); font-family:나눔고딕,nanumgothic; font-size:12pt">하지만 최근엔 선택기준도 변하고 있다. 평균수명이 길어지고, 그에 비례하여 입원 기간도 늘어나고 있기 때문이다. 짧지 않은 입원기간 동안 내 부모님 혹은 가족이 편안하게 의미 있는 여생을 보낼 수 있는 곳인지가 중요한 선택 기준이 되고 있다. </span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 0); font-family:나눔고딕,nanumgothic; font-size:12pt">해림의료재단 부산금사요양병원은 보다 체계적이고 전문화된 &lsquo;환자중심케어&rsquo; 서비스를 제공하기 위해 지상 7층, 199병상의 규모로 신축 이전하여 본격적인 진료에 들어갔다. 외형 확장뿐 아니라 의료법 시행규칙과 소방안전시설 규정에 따라 병상 간 거리를 넓히고, 각 병실마다 스프링쿨러를 설치해 입원환자가 좀 더 쾌적하고 안전한 환경에서 지낼 수 있도록 했다. </span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 0); font-family:나눔고딕,nanumgothic; font-size:12pt">요양병원은 치료를 목적으로 입원하는 의료시설이기 때문에 환자의 질병에 대한 전문성이 갖추어져 있는지가 무엇보다 중요하다.&nbsp; </span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 0); font-family:나눔고딕,nanumgothic; font-size:12pt">요양병원에 입원하는 환자는 대부분 고령이어서 복합적인 질병을 가지고 있는 경우가 많다. 따라서 내과, 외과, 신경과, 한의과 등 진료과목이 많고 전문 인력이 배치되어 있으며, 각 과마다 원활한 협진이 가능하고 주치의 한명 당 적정 수의 환자를 진료하는 지도 간과해서 안되는 부분이다. </span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 0); font-family:나눔고딕,nanumgothic; font-size:12pt">해림의료재단 부산금사요양병원은 전문의가 상주해 환자 개개인 상태에 따른 1:1 맞춤 진료가 가능하다. 또한 내과&middot;외과-한방내과 등 전문의와 한의사가 환자 상태에 맞춰 양&middot;한방 협진 서비스를 제공하고 있다.&nbsp; </span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 0); font-family:나눔고딕,nanumgothic; font-size:12pt">또한 집중치료실을 별도로 운영하여 거동이 불편한 중증환자를 밀착해 세심하게 살핀다. 야간에도 전문의가 상주하여 혹시 모를 응급상황을 대비하고 있다. </span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 0); font-family:나눔고딕,nanumgothic; font-size:12pt">이 병원은 요양병원에서는 보기 드물게 40평 규모의 물리치료실을 구비했다. 전문 물리치료사가 상주해 의료적인 지원 등 체계적인 관리를 돕는다. 노인성 질환인 뇌졸중(뇌경색, 뇌출혈), 파킨슨은 꾸준한 재활치료가 필요하기 때문이다. </span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 0); font-family:나눔고딕,nanumgothic; font-size:12pt">해림의료재단 주영민 이사장은 &quot;기대수명이 늘어남에 따라 치매 등 질환을 앓는 기간도 함께 길어지고 있다. 이에 요양병원의 역할과 소명도 커지고 있는 것이 사실&quot;이라며 &quot;앞으로 요양병원들은 환자중심의 질 좋은 장기요양 서비스를 제공하고, 전문분야로 거듭나기 위한 노력을 아끼지 않아야 한다&quot;고 전했다. </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:rgb(0, 0, 0); font-family:나눔고딕,nanumgothic; font-size:12pt">이영은 기자 </span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 0); font-family:나눔고딕,nanumgothic; font-size:12pt">기사승인 2017.09.06&nbsp; 16:32:23 </span>&nbsp;</p>\r\n\r\n<p><a href="http://m.suwon.com/news/articleView.html?idxno=116593#_adtep">http://m.suwon.com/news/articleView.html?idxno=116593#_adtep</a></p>\r\n\r\n<p>&nbsp;</p>\r\n', 'admin', '', 0, 'N', 'N', 5, '2018-12-02 14:43:39', '2018-12-02 23:50:39'),
	(15, 'media_report', '', '요양병원도 의료시설, 꼼꼼히 따져보고 신중하게 선택해야 (한국경제)', '<p>&nbsp;<img alt="한국경제" src="http://mimgnews1.naver.net/image/upload/office_logo/015/2017/01/05/logo_015_11_20170105110805.gif" style="height:40px; width:85px" title="" /> | 기사입력 2017-10-18 15:15</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:12pt"><strong>요양병원도 의료시설, 꼼꼼히 따져보고 신중하게 선택해야</strong></span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p><strong>전문의 상주 여부와 의사 1명 당 환자 수, 시설 상태 등 종합적으로 따져야</strong><br />\r\n<br />\r\n<img alt="7a4590c3a4a9999af660163fd458fdff_1508385998_9952.jpg" src="http://geumsa.com/data/editor/1710/7a4590c3a4a9999af660163fd458fdff_1508385998_9952.jpg" title="7a4590c3a4a9999af660163fd458fdff_1508385998_9952.jpg" /></p>\r\n\r\n<p>우리나라 국민의 기대수명은 83.1세지만 행복수명은 74.6세인 것으로 나타났다. 행복수명이란 건강과 경제, 사회, 인간관계 등을 기반으로 행복하게 살 수 있는 기간을 뜻하며, 당뇨나 고혈압, 치매, 암 등 질병으로 노년을 건강하게 보내지 못하면 아무리 오래 살아도 행복하지 않다는 생각이 반영된 것이다.<br />\r\n<br />\r\n실제로 2014년 49만 6034명이던 요양병원 입원환자 수는 지난해 54만 3753명으로 증가하였다. 그만큼 많은 이들이 다양한 질병으로 고생을 하고 있다는 뜻이며, 노인인구의 비중이 20%를 초과하는 초고령 사회가 되면 요양병원을 찾는 사람은 폭발적으로 증가할 것으로 보인다.<br />\r\n<br />\r\n하지만 요양병원도 의료시설이기 때문에 단순히 집과 가깝다는 이유에서, 주변 사람의 소개를 받아 덜컥 선택하는 것은 옳지 않다. 더욱이 일반병원처럼 통원치료를 받거나 이곳 저곳을 돌아다니는 의료쇼핑이 불가능하므로 꼼꼼히 따져보고 신중하게 선택해야 한다.<br />\r\n<br />\r\n해림의료재단 부산금사요양병원 주영민 이사장은 &quot;요양병원은 짧게는 몇 달, 길게는 몇 년까지 머무는 곳이므로 첫 선택이 매우 중요하다&quot;라며 요양병원 선택 시 참고할 수 있는 몇 가지 기준을 소개했다.<br />\r\n<br />\r\n우선 환자의 질병에 대한 전문성을 갖춘 것은 물론 여러 과의 원활한 협진이 가능한 곳이어야 한다. 요양병원을 찾는 이들은 대부분 복합적인 질병을 가진 고령자이므로, 내과와 외과, 신경과, 한의과 등 각 진료과에 전문적인 인력이 확보되어 있어야 한다는 이야기이다.<br />\r\n<br />\r\n또 의사와 간호사 등의 인력 한명이 몇 명의 환자를 담당하는지도 중요한데, 의료 서비스의 질에 영향을 줄 수 있는 문제이기 때문이다. 나아가 간호사나 요양보호사의 친절도와 환자 및 보호자의 만족도도 체크해야 할 리스트이다. 환자들이 가족과 떨어진 환경에서 불안감이나 외로움을 느끼지 않고 안정된 마음을 가지고 지낼 수 있는 환경이 조성되어야 함을 뜻한다.<br />\r\n<br />\r\n마지막으로 각 입원실마다 냉난방과 온습도 조절이 잘 되는지, 채광이나 환기, 배기가 우수한지 등 시설적인 부분도 확인해야 한다.<br />\r\n<br />\r\n주 이사장은 &quot;되도록이면 많은 요양병원을 방문하여 직접 시설 상태와 분위기, 식사의 품질 등을 확인해보아야 질 높은 요양병원을 선택할 수 있다&quot;라고 조언했다.<br />\r\n<br />\r\n한편 부산금사요양병원은 최근 부산 금정구 금사동에 지상 7층, 199병상 규모로 신축 이전을 하여 내과와 외과, 가정의학과, 한방과 등의 전문의 및 한의사를 두고 양/한방 협진 서비스를 제공하고 있다.<br />\r\n<br />\r\n야간에도 전문의가 응급 상황에 철저하게 대비하며, 전문 물리치료사가 상주하는 40평 규모의 물리치료실과 중증환자 케어를 위한 집중치료실을 마련해놓고 있다. 또 의료법 시행규칙과 소방안전시설 규정에 따라 병상 간 거리를 넓히고 각 병실마다 스프링쿨러를 설치하여 안전하고 쾌적한 시설을 완성했다.<br />\r\n<br />\r\n한경닷컴 뉴스팀 newsinfo@hankyung.com</p>\r\n\r\n<p><a href="http://news.hankyung.com/article/201710186127a">http://news.hankyung.com/article/201710186127a</a></p>\r\n', 'admin', '', 0, 'N', 'N', 3, '2018-12-02 14:49:24', '0000-00-00 00:00:00'),
	(16, 'notice', '', '12월 25일 (성탄절)은 외래진료 휴진입니다.', '<p>25일 (성탄절)은 외래진료 휴진입니다.</p>\r\n\r\n<p>진료일정에 착오없으시길 바랍니다.</p>\r\n\r\n<p>(단, 병동은 당직의, 간호인력 근무)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>가족들과 따뜻한 성탄절 보내세요~</p>\r\n', 'admin', 'N', 0, 'N', 'N', 3, '2018-12-24 03:21:33', '0000-00-00 00:00:00'),
	(17, 'notice', '', '인공신장실에서는 외래 투석도 가능합니다.', '<p>저희 인공신장실에서는</p>\r\n\r\n<p>거동의 불편함을 줄이고자, 입원하여 투석치료를&nbsp;받으시는 환자분들도 계시지만</p>\r\n\r\n<p>일상생활을 유지하면서 투석치료를&nbsp;병행하길 원하는 환자분들의 문의가 많아서</p>\r\n\r\n<p>외래 투석치료도 함께 진행하고 있습니다.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>자세한 문의는 051. 521. 7581&nbsp;대표번호로 전화주시면</p>\r\n\r\n<p>친절하게 안내해드리겠습니다.</p>\r\n', 'admin', 'Y', 0, 'N', 'N', 3, '2019-03-19 04:30:27', '0000-00-00 00:00:00'),
	(18, 'notice', '', '외래진료일정', '<table border="1" cellpadding="1" cellspacing="1" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td style="text-align:center"><span style="font-size:14px">&nbsp;진료시간 일정표</span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;진료시간 : 09:30 ~ 17:00</p>\r\n\r\n<p>&nbsp;점심시간 : 12:00 ~ 13:00</p>\r\n\r\n<p>&nbsp;진료실2 소아과전문의 김경태&nbsp;</p>\r\n\r\n<table border="1" cellpadding="1" cellspacing="1" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td style="text-align:center"><span style="color:#000000">요일</span></td>\r\n			<td style="text-align:center"><span style="color:#000000">월</span></td>\r\n			<td style="text-align:center"><span style="color:#000000">화</span></td>\r\n			<td style="text-align:center"><span style="color:#000000">수</span></td>\r\n			<td style="text-align:center"><span style="color:#000000">목</span></td>\r\n			<td style="text-align:center"><span style="color:#000000">금</span></td>\r\n			<td style="text-align:center"><span style="color:#000000">토</span></td>\r\n			<td style="text-align:center"><span style="color:#000000">일</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align:center">오전</td>\r\n			<td style="text-align:center">O</td>\r\n			<td style="text-align:center">O</td>\r\n			<td style="text-align:center">O</td>\r\n			<td style="text-align:center">O</td>\r\n			<td style="text-align:center">O</td>\r\n			<td style="text-align:center">X</td>\r\n			<td style="text-align:center">X</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align:center">오후</td>\r\n			<td style="text-align:center">O</td>\r\n			<td style="text-align:center">O</td>\r\n			<td style="text-align:center">O</td>\r\n			<td style="text-align:center">O</td>\r\n			<td style="text-align:center">O</td>\r\n			<td style="text-align:center">X</td>\r\n			<td style="text-align:center">X</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>*추후&nbsp;진료시간 및 일정에 변동이 있을시 사전 공지예정*&nbsp;</p>\r\n', 'admin', 'Y', 0, 'N', 'N', 2, '2023-03-13 07:16:39', '2023-03-27 14: