, 'N', 'N', 0, '2023-03-27 05:35:45', '0000-00-00 00:00:00'),
	(20, 'notice', '', '요양병원 입원급여 적정성평가 2회연속1등급 획득', '<p>부산금사요양병원은 건강보험 심사평가원에서 요양병원 질향상 활동 및 의료서비스 적정성을 유지하고</p>\r\n\r\n<p>국민에게 합리적인 병원선택을 하기 위하여,&nbsp;매년 전국의 모든 요양병원을 대상으로 실시하는 입원급여 적정성 평가</p>\r\n\r\n<p>즉,구조적인 지표평가와 진료적인 지표 평가에서&nbsp; 평가시기 (2020-10-01~2020-12-31) 1등급 획득에 이어 (2021-07-01~2021-12/31) 실시한 평가에도</p>\r\n\r\n<p>2회 연속으로 1등급평가를 받은 병원이 되었습니다. 저희병원 모든 임직원들은 여기에 자만하지 않고 더욱 더 의료서비스및 질향상에 최선을 다하는 병원으로</p>\r\n\r\n<p>거듭나겠습니다..</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'admin', 'N', 0, 'N', 'N', 1, '2023-06-13 05:50:24', '0000-00-00 00:00:00');
