	(4, '소아청소년과전문의', '진료원장', '김경태', '· 부산대학교 의과대학 졸업\r\n· 부산성분도병원 전문의 과정수련\r\n· 전)부산성분도병원 소아청소년과장\r\n· 전)연산동 김경태 소아청소년과 의원개원\r\n', 'admin', 0, '2020-07-05 10:10:07', '2024-02-07 08:37:00', 'N'),
	(5, '한의학과', '진료원장', '박명아', '· 대구대학교 한의과 대학 졸업\r\n· 대구 문성한방병원 수련의\r\n· 전)대구 문성한방병원 진료부장\r\n· 전)청십자요양병원 진료원장', 'admin', 0, '2020-07-05 10:10:52', '2020-07-06 14:14:09', 'N'),
	(6, '일반외과 전문의', '진료원장', '홍윤범', '인제대학교 의과대학 졸업\r\n봉생병원, 창원삼성병원  수련\r\n전) 의료법인 정화의료재단 봉생병원 외과과장\r\n전) 김해중앙병원 외과과장\r\n전) 오케이 항문외과의원  원장', 'admin', 0, '2020-07-06 05:09:55', '2024-03-25 10:40:28', 'N'),
	(7, '산부인과 전문의', '진료원장', '최욱환', '부산대학교 의과대학 졸업\r\n부산대학교 대학원 의학과 박사수료\r\n전) 부산대학교 의과대학 교수\r\n전) 부산대학교 산부인과 과장\r\n대한산부인과과학회 학술위원회 이사\r\n', 'admin', 0, '2020-07-06 05:12:16', '2023-03-16 16:42:44', 'N'),
	(8, '정형외과  전문의', '진료원장', '유만규', '고려대학교  의과대학 졸업 \r\n고려대학교 인턴및 정형외과 레지던트 수료\r\n부산 침례병원 정형외과 진료과장 역임\r\n유만규 정형외과 개원\r\n', 'admin', 0, '2020-07-06 05:13:39', '2024-03-12 15:49:33', 'N'),
	(9, '한의학과 ', '진료원장', '이민승', '경희대학교 한의학과 졸업\r\n전) 낙동한의원 개원\r\n전) 정관요양병원 진료원장\r\n전) 효경요양병원 진료원장', 'admin', 0, '2020-07-06 05:16:46', '0000-00-00 00:00:00', 'N');
