	(12, '', '11월 인지치료-수 세어보기', ' 그림의 수를 세어보고 이에 맞는 숫자를 찾아 선을 긋는 프로그램입니다. 수를 세어보고 숫자를 인지시켜 드리며 인지기능 및 신체기능을 유지시킬 수 있도록 도움을 드립니다.', 'img_20181205150514ug264pNe7Q.JPEG', 'N', 'Y', 0, 'admin', '2018-12-05 06:10:07', '2018-12-05 15:30:41'),
