	(14, '', '11월 여가활동-네일아트', '어르신들께서 원하시는 색깔로 손톱을 칠해 드리며 어르신들도 예쁘게 꾸미며 즐겁게 생활하시도록 즐거움 및 만족감을 제공 해드리고 가치있는 존재임을 인식시켜 드릴 수 있도록 도움을 드립니다.', 'img_201812051524057S4RvjkGl0.JPEG', 'N', 'Y', 1, 'admin', '2018-12-05 06:27:07', '0000-00-00 00:00:00'),
	(15, '', '11월 미술치료-가을풍경 색칠하기', '가을풍경 그림을 보며 어르신들께서 과거 회상하시며 즐겁게 대화도 많이 나누었으며 신체의 소근육 기능을 유지시키고 여러색을 직접 고르고 색칠하며 인지기능도 유지시킬 수 있도록 도움을 드립니다.', 'img_201812051534168iUumwl1J3.JPEG', 'N', 'Y', 0, 'admin', '2018-12-05 06:38:09', '0000-00-00 00:00:00'),
	(16, '', '11월 미술치료-잠자리 종이접기', '색종이 종이접기를 통하여 손의 잔존 기능을 유지시키고 종이접기를 반복하며 기억력 및 인지기능을 유지시키도록 도움을 드렸습니다.', 'img_20181205153911p7laYf9n0O.JPEG', 'N', 'Y', 0, 'admin', '2018-12-05 06:40:47', '0000-00-00 00:00:00'),
	(17, '', '11월 놀이치료-풍선배구', '풍선으로 배구놀이를 하며 어르신들의 건강 증진 및 신체기능을 유지시켜 드리고 타 어르신들과의 교류 형성을 도와 보다 더 활력있고 즐거운 병동생활이 되도록 도움을 드립니다.', 'img_20181205154204FK7NZS6XzA.JPEG', 'N', 'Y', 1, 'admin', '2018-12-05 06:44:36', '0000-00-00 00:00:00'),
	(18, '', '11월 놀이치료-종이 자석낚시', '자석이 붙여진 물고기 그림을 자석 낚시대로 낚시를 하는 프로그램으로 어르신들께 조금이나마 낚시를 하는 것 같은 즐거움을 드리고 집중력을 향상시키고 신체기능을 유지시킬 수 있도로 도움을 드립니다.', 'img_20181205155003s4xE5hTArm.JPEG', 'N', 'Y', 0, 'admin', '2018-12-05 06:55:25', '0000-00-00 00:00:00'),
	(19, '', '11월 생신잔치-4층', '매월 월말 생신을 맞으신 어르신들과 직원들이 한자리에 모여 다같이 어르신들의 생신을 축하 해드리고 맛있는 음식을 나눠 드시며 한가족과 같은 편안함과 정서적 행복감을 제공하여 보다 즐거운 병동생활이 되도록 하였습니다.   ', 'img_20181205161059aGJAg1Qo0N.JPEG', 'N', 'Y', 0, 'admin', '2018-12-05 07:11:36', '0000-00-00 00:00:00'),
