	(22, '', '12월 여가활동-노래방', '어르신들께서 평소 부르시던 애창곡을 듣고 부르셨고 흥에 겨워 어깨춤도 추셨으며 타 어르신께서 노래를 부르실때 박수도 같이 치며 아주 즐겁게 참여 하셨습니다.', 'img_201812071450099JVM3iOlmU.JPEG', 'N', 'N', 1, 'admin', '2018-12-07 05:52:52', '0000-00-00 00:00:00'),
	(23, '', '12월 여가활동-노래방', '어르신들께서 평소 부르시던 애창곡을 듣고 부르셨고 흥에 겨워 어깨춤도 추셨으며 타 어르신께서 노래를 부르실때 박수도 같이 치며 아주 즐겁게 참여 하셨습니다.', 'img_201812071450099JVM3iOlmU.JPEG', 'N', 'Y', 0, 'admin', '2018-12-07 05:52:52', '0000-00-00 00:00:00'),
	(24, '', '12월 인지치료-한글쓰기', '유인물에 그려진 그림을 보고 한글을 따라 쓰는 프로그램으로 한글쓰기를 통하여 어르신들의 기억력을 유지시키고 인지와 신체의 잔존 기능을 유지시키도록 도움을 드립니다.', 'img_20181207160605my0sldEFZb.JPEG', 'N', 'N', 0, 'admin', '2018-12-07 07:13:34', '0000-00-00 00:00:00'),
	(25, '', '12월 여가활동-네일아트', '어르신들께서 원하시는 색깔로 손톱을 칠해 드리며 어르신들도 예쁘게 꾸미며 즐겁게 생활하시도록 즐거움 및 만족감을 제공 해드리고 가치있는 존재임을 인식시켜 드릴 수 있도록 도움을 드립니다.', 'img_20181207161504pI6HrgcONw.JPEG', 'N', 'N', 0, 'admin', '2018-12-07 07:15:08', '0000-00-00 00:00:00'),
	(26, '', '12월 미술치료-겨울풍경 색칠하기', '눈사람이 그려진 겨울풍경 그림을 색칠하며 겨울과 관련된 대화도 많이 나누시고 다 색칠한 눈사람을 보시며 예쁘다고 좋아하셨고 색칠하기를 통하여 색의 인지 및 감각기능을 유지시키고 정서적 안정감을 제공하도록 도움을 드립니다..', 'img_20181207161534mdrL6BlPXk.JPEG', 'N', 'N', 0, 'admin', '2018-12-07 07:37:57', '0000-00-00 00:00:00'),
	(27, '', '12월 놀이치료-컵 쌓아올리기', '종이컵을 층층별로 탑처럼 쌓아 올리는 컵 쌓아올리기 프로그램을 통하여 어르신들의 상지 기능과 집중력을 향상시키고 인지능력을 유지시켜 드리며 쌓기를 완성했을때 성취감을 느낄 수 있도록 도움을 드렸습니다.', 'img_20181207164141KwoDUie01b.JPEG', 'N', 'N', 0, 'admin', '2018-12-07 07:55:41', '0000-00-00 00:00:00'),
	(28, '', '12월 외부공연 (동래초등학교 재학생 및 졸업생 봉사자)', '크리스마스를 맞이하여 동래초등학교 졸업생 및 재학생 봉사자분들이 공연을 와주셨습니다. 캐롤 및 어르신들께서 좋아하시는 노래를 바이올린, 플룻 등 다양한 악기로 연주하며 어르신들과 소통하며 교류할 수 있는 시간이었습니다. 어르신들께서도 같이 박수를 치며 아주 즐겁게 공연을 관람하셨습니다.', 'img_20181217155821Xqbvzm2VtK.JPEG', 'N', 'N', 0, 'admin', '2018-12-17 07:01:30', '0000-00-00 00:00:00'),
	(29, '', '12월 놀이치료-풍선배구', '풍선배구 프로그램은 배구공 대신 풍선으로 배구를 하듯 직원, 옆 어르신들과 풍선을 주고 받는 놀이로 집중력을 키워 드리고 신체의 잔존 기능을 유지시켜 드리며 타 어르신들과의 교류 형성에 도움을 드립니다.', 'img_20181221155839DczimftjX3.JPEG', 'N', 'N', 0, 'admin', '2018-12-21 07:01:38', '0000-00-00 00:00:00'),
	(30, '', '12월 미술치료-크리스마스 카드 만들기', '크리스마스를 맞이하여 어르신들과 함께 크리스마스 카드 만들기를 실시하였습니다. 카드에 그려진 트리 그림을 예쁘게 색칠하며 크리스마스에 대해 대화도 많이 나누며 즐겁게 참여하셨습니다.', 'img_20181221160204izrskCKZXd.JPEG', 'N', 'N', 0, 'admin', '2018-12-21 07:03:04', '0000-00-00 00:00:00'),
	(31, '', '12월 여가활동-노래방', '타 어르신들, 직원과 함께 좋아하는 노래를 부르며 박수도 치고 흥에 겨워 어깨춤도 추시며 아주 즐겁게 노래방 프로그램에 참여하셨습니다.', 'img_20181221160456KwDZIplE0M.JPEG', 'N', 'N', 0, 'admin', '2018-12-21 07:06:03', '0000-00-00 00:00:00'),
	(32, '', '12월 생신잔치-6층', '12월 생신을 맞은 어르신들 및 같은 병동에 계신 어르신들과 직원분들이 한자리에 모여 다같이 생신축하 노래도 불러 드리고 맛있는 음식도 나눠드시며 축하해주는 시간을 가지게 되었습니다. 휴게실로 나오기 어려운 와상 어르신들은 침상에서 다같이 축하 해드리며 타 어르신들과의 교류 형성을 도와 드리고 정서적 행복감을 제공하도록 하였습니다.', 'img_20181226162816Mu6S7qREJT.JPEG', 'N', 'N', 2, 'admin', '2018-12-26 07:35:46', '2018-12-26 16:37:42'),
	(33, '', '12월 생신잔치-4층', '12월 생신을 맞으신 어르신들 및 같은 병동 어르신들과 직원들이 한자리에 모여 어르신들의 생신파티를 해드렸습니다. 생일 주인공이신 한 어르신의 보호자분도 마침 면회 오셔서 모두 같이 참석하여 다같이 노래도 부르고 음식도 나눠 드시며 아주 즐거운 시간이었습니다.', 'img_20181227152646zTOF6RIalu.JPEG', 'N', 'N', 0, 'admin', '2018-12-27 06:28:48', '0000-00-00 00:00:00'),
	(34, '', '12월 생신잔치-5층', '12월에는 5층 어르신 두분이 생신 주인공이셨고 같은 병동에 계시는 다른 어르신들과 직원분들이 모두 같이 생일축하 노래도 불러 드리고 음식들도 나눠 드시며 아주 즐거운 시간을 보내었습니다. 평소 타 어르신들과 교류가 없던 어르신께서도 오늘은 노래도 부르고 대화도 많이 나누며 아주 즐겁게 생신파티에 참여하셨습니다.', 'img_20181228161914T2LlJ74kHv.JPEG', 'N', 'N', 2, 'admin', '2018-12-28 07:23:35', '0000-00-00 00:00:00'),
	(35, '', '12월 생신잔치-3층', '12월 생신을 맞으신 어르신 세분과 같은 병동 어르신들, 직원들이 한자리에 모여 다같이 생신을 축하드렸습니다. 옆 어르신들, 직원분들과 함께 맛있는 음식도 나눠 드시고 노래도 부르고 어깨춤도 추시며 아주 즐거운 시간이었습니다.', 'img_201812311622362NCdVExKAk.JPEG', 'N', 'N', 0, 'admin', '2018-12-31 07:24:27', '0000-00-00 00:00:00'),
	(36, '', '1월 여가활동-네일아트', '네일아트 프로그램을 통하여 어르신들의 자존감을 높여 드리고 무료한 병동생활에 활력을 제공하여 정서적 즐거움을 느낄 수 있도록 도움을 드립니다.', 'img_201901041444531dvOzhw7n3.JPEG', 'N', 'N', 1, 'admin', '2019-01-04 05:45:40', '0000-00-00 00:00:00'),
	(37, '', '1월 미술치료-1월 달력만들기', '2019년 황금돼지해를 맞이하여 돼지 그림이 그려진 달력을 만들어 보았습니다. 어르신들께서 직접 빈칸에 숫자도 기입하고 돼지 그림을 예쁘게 색칠하여 완성하였고 다 완성된 달력을 보시며 예쁘다며 좋아하셨고 다 완성된 달력은 어르신들께서 잘 보이는 곳에 다 붙여 드렸습니다.', 'img_20190104144722uLUz81IjwS.JPEG', 'N', 'N', 0, 'admin', '2019-01-04 05:49:18', '0000-00-00 00:00:00'),
	(38, '', '1월 놀이치료-고리던지기', '고리던지기 프로그램을 통해 어르신들의 신체와 인지의 잔존 기능을 유지시키고 옆 어르신들과 함께 신체활동을 하며 대화도 많이 나누시고 교류 형성에 도움을 드립니다.', 'img_20190104145000ahZnsjU9dc.JPEG', 'N', 'N', 2, 'admin', '2019-01-04 05:51:38', '0000-00-00 00:00:00'),
	(39, '', '1월 인지치료-시간맞추기', '시계가 그려진 그림과 옆에 숫자로 적혀진 시간을 맞추는 프로그램이며 어르신들의 신체와 인지의 잔존 기능을 유지시키는데 도움을 드립니다.', 'img_20190118163618If6FQ2s1P7.JPEG', 'N', 'N', 0, 'admin', '2019-01-18 07:36:59', '0000-00-00 00:00:00'),
	(40, '', '1월 미술치료-복주머니 종이접기', '새해를 맞이하여 복주머니 종이접기를 실시하였습니다. 어르신들께서 다 만든 복주머니를 보며 복이 들어 올 것 같다며 즐거워 하셨습니다.', 'img_20190118163718YKZUICPcjq.JPEG', 'N', 'N', 1, 'admin', '2019-01-18 07:38:13', '0000-00-00 00:00:00'),
