	(42, '', '1월 이미용 봉사활동', '전문 미용자격을 보유한 봉사자분께서 병동에 방문하여 어르신들께 이미용 서비스를 제공해드렸습니다.', 'img_20190118163959tkd4xRGOcl.JPEG', 'N', 'N', 0, 'admin', '2019-01-18 07:40:44', '0000-00-00 00:00:00'),
