	(44, '', '1월 놀이치료-종이자석낚시', '종이자석낚시 프로그램은 물고기가 그려진 그림에 자석을 붙여 마치 낚시를 하는 것처럼 즐겁게 참여하는 프로그램으로  어르신들의 신체 및 인지의 잔존 기능을 유지시켜줄 뿐 아니라 낚시를 하는 것과 같은 정서적 즐거움까지 제공해드립니다.', 'img_20190125121221oDLz0raH3J.JPEG', 'N', 'N', 0, 'admin', '2019-01-25 03:14:24', '0000-00-00 00:00:00'),
	(45, '', '1월 미술치료-한복그림 색칠하기', '설날을 앞두고 한복을 입은 귀여운 아기들의 그림을 색칠하였습니다. 어르신들께서 직접 색을 고르며 알록달록 예쁘게 색칠하며 신체와 인지의  잔존 기능을 유지시켜 주고 감각기능을 유지시키는데 도움을 드렸습니다.', 'img_20190125121819iQSvt3k0zd.JPEG', 'N', 'N', 0, 'admin', '2019-01-25 03:20:18', '0000-00-00 00:00:00'),
	(46, '', '1월 인지치료-한글쓰기', '한글이 적혀진 유인물을 보며 한글을 읽고 천천히 따라 쓰셨으며 어르신들의 신체와 인지의 잔존 기능을 유지시키는데 도움을 드렸습니다.', 'img_20190125122050nuJyRqXZo6.JPEG', 'N', 'N', 0, 'admin', '2019-01-25 03:22:19', '0000-00-00 00:00:00'),
	(47, '', '1월 이미용 봉사활동', '전문 미용자격을 보유한 봉사자분께서 병동에 방문하여 어르신들께 이미용 서비스를 제공해드렸습니다.', 'img_20190125122321VD9TXzG5rq.JPEG', 'N', 'N', 0, 'admin', '2019-01-25 03:23:29', '0000-00-00 00:00:00'),
	(48, '', '1월 생신잔치-6층', '1월 생신을 맞은 어르신들과 같은 병동 어르신들 및 직원들이 한자리에 모여 맛있는 음식도 나눠 드시고 생일 축하 노래도 부르며 즐겁게 생신잔치에 참여하셨습니다.', 'img_20190131160607RJ0GwKtVBe.JPEG', 'N', 'N', 0, 'admin', '2019-01-31 07:12:25', '0000-00-00 00:00:00'),
