	(52, '', '2월 놀이치료-고리던지기', '고리던지기 프로그램을 통해 어르신들의 신체와 인지의 잔존 기능을 유지시키고 무료한 병동생활에 활력을 줄 수 있도록 도움을 드렸습니다.', 'img_20190214143448QWKBAJIsVk.JPEG', 'N', 'N', 0, 'admin', '2019-02-14 05:35:50', '0000-00-00 00:00:00'),
	(53, '', '2월 미술치료-민속놀이 색칠하기', '민속놀이(연날리기) 그림을 색칠하며 어르신들과 함께 명절에 대해 대화도 많이 나누며 어린시절 민속놀이를 하던 과거 회상도 하시고 즐거운 시간을 보내었습니다.', 'img_20190214143627lauN6pIYiB.JPEG', 'N', 'N', 0, 'admin', '2019-02-14 05:39:06', '0000-00-00 00:00:00'),
	(54, '', '2월 놀이치료-화투그림 맞추기', '대부분의 어르신들께서 즐기고 좋아하셨던 고스톱의 그림을 어르신들께서 쉽게 볼 수 있도록 크게 만들어 그림을 맞춤으로써 인지의 잔존 기능을 유지시킬 수 있도록 놀이형식으로 진행하였습니다. 어르신들께서 아주 즐거워 하시며 그림을 맞추시는 모습을 볼 수 있었습니다.', 'img_20190214143929VCyKnQDhNX.JPEG', 'N', 'N', 1, 'admin', '2019-02-14 05:41:49', '0000-00-00 00:00:00'),
	(55, '', '2월 여가활동-노래방', '어르신들께서 평소 즐겨 부르시던 노래를 부르며 즐겁게 박수도 치고 타 어르신들과 대화도 많이 나누며 즐거운 시간을 보내었습니다.', 'img_20190214144306i9Dg0jOLps.JPEG', 'N', 'N', 0, 'admin', '2019-02-14 05:43:40', '0000-00-00 00:00:00'),
	(56, '', '2월 여가활동-네일아트', '어르신들께서 직접 좋아하시는 색을 직접 고르시고 매니큐어를 발라 드리니 너무 좋아하시는 모습을 볼 수 있었고 무료한 병동생활에 조금이나마 활력이 될 수 있도록 도움을 드렸습니다.', 'img_201902141448189GWFZrjUkT.JPEG', 'N', 'N', 1, 'admin', '2019-02-14 05:49:39', '0000-00-00 00:00:00'),
	(57, '', '2월 인지치료-점선따라 그리기', '점선을 따라 선을 그어 그림을 완성하고 예쁘게 색칠하는 프로그램으로 어르신들께서 집중하여 천천히 선을 따라 그으며 집중력을 키우고 인지와 신체의 잔존 기능을 유지시킬 수 있도록 도움을 드렸습니다.', 'img_20190214144956qDwFnCAzkb.JPEG', 'N', 'N', 1, 'admin', '2019-02-14 05:53:41', '0000-00-00 00:00:00'),
	(58, '', '2월 미술치료-복돼지 종이접기', '돼지해를 맞아 색종이로 귀여운 복돼지를 접는 프로그램을 실시하였습니다. 어르신들께서 다소 어려워 하시는 부분은 부분 보조 해드리며 마지막까지 집중하여 잘 따라 접으셨고 다 완성된 돼지를 보며 귀엽다고 좋아하시는 모습을 보이셨습니다.', 'img_20190214145420IVYsBhgxqv.JPEG', 'N', 'N', 1, 'admin', '2019-02-14 05:59:55', '0000-00-00 00:00:00'),
	(59, '', '2월 여가활동-노래방', '어르신들께서 평소 좋아하시던 노래를 따라 부르며 즐겁게 참여하셨고 가사를 인지함으로 기억력을 유지시키고 인지의 잔존 기능을 유지시키며 정서적 즐거움을 제공하도록 도움을 드렸습니다.', 'img_20190222142530cphIGlWrzn.JPEG', 'N', 'N', 0, 'admin', '2019-02-22 05:27:26', '0000-00-00 00:00:00'),
	(60, '', '2월 인지치료-퍼즐맞추기', '화투그림이 그려진 퍼즐 조각을 맞추며 신체와 인지의 잔존 기능을 유지시키고 집중력을 향상시키도록 도움을 드렸습니다.', 'img_20190222143137TszE5fqLdM.JPEG', 'N', 'N', 0, 'admin', '2019-02-22 05:36:17', '0000-00-00 00:00:00'),
	(61, '', '2월 여가활동-네일아트', '어르신들께서 평소 좋아하시던 색의 매니큐어를 직접 고르며 적극적인 참여 모습을 보이셨고 다 발라드린 후 예쁘다고 아주 즐거워 하시는 모습을 보이셨습니다.', 'img_20190222143634AFjZy6UGNM.JPEG', 'N', 'N', 0, 'admin', '2019-02-22 05:39:24', '0000-00-00 00:00:00'),
	(62, '', '2월 미술치료-스텐실', '어르신들께서 쉽게 하실 수 있도록 색연필로 스텐실을 실시하였습니다. 그림의 도안을 종이에 대고 색연필로 색칠하며 집중력을 향상시키고 직접 색과 그림을 고르며 감각을 발달시키고 정서적 즐거움도 제공할 수 있도록 도움을 드렸습니다.', 'img_2019022214394526CvYGw3Lj.JPEG', 'N', 'N', 1, 'admin', '2019-02-22 05:43:23', '0000-00-00 00:00:00'),
	(63, '', '2월 놀이치료-풍선배구', '풍선으로 배구를 하듯 놀이를 하는 풍선배구를 함으로써 신체의 잔존 기능을 유지시킬 수 있도록 도움을 드렸고 즐겁게 놀이를 하며 타 어르신, 직원과 대화도 많이 나누며 무료한 병동생활에 조금이나마 활력을  제공하는데 도움을 드렸습니다..', 'img_20190222144342plyhxeE6XM.JPEG', 'N', 'N', 0, 'admin', '2019-02-22 05:45:14', '0000-00-00 00:00:00'),
