	(66, '', '2월 생신잔치-4층', '2월 생신을 맞으신 어르신들과 같은 병동 어르신들, 직원들이 한자리에 모여 생신잔치를 하였습니다. 휴게실에 나오기 힘든 와상 어르신은 침상에서 축하를 해드렸으며 어르신들께서 타 어르신들과 맛있는 음식도 나눠 드시고 교류하며 즐거운 시간을 보내었습니다', 'img_20190228111307X6jd39nx4l.JPEG', 'N', 'N', 3, 'admin', '2019-02-28 02:13:35', '2019-02-28 11:15:09'),
