	(68, '', '3월 여가활동-노래방', '어르신들께서 평소 좋아하고 줄겨 부르시던 노래를 부르며 타 어르신들과 함께 박수도 많이 치고 흥겨워 하시며 즐겁게 참여하셨고 무료한 병동생활에 조금이나마 활력이 될 수 있도록 도움을 드렸습니다.', 'img_20190307105342Kjqh9eTA2u.JPEG', 'N', 'N', 0, 'admin', '2019-03-07 01:55:26', '0000-00-00 00:00:00'),
	(69, '', '3월 인지치료-빈칸 숫자 채우기', '빈칸에 순서대로 숫자를 채워 넣는 프로그램으로 어르신들 인지의 잔존 기능을 유지시키고 집중력을 향상시킬 수 있도록 도움을 드리며, 중간 중간 숫자적기에 어려움을 보이실때에는 부분 보조하여 숫자적기를 완성할 수 있도록 하였습니다.', 'img_201903071056133udQYmiNK9.JPEG', 'N', 'N', 1, 'admin', '2019-03-07 01:58:41', '0000-00-00 00:00:00'),
	(70, '', '3월 여가활동-네일아트', '네일아트 프로그램을 통해 무료한 어르신들의 병동생활에 활력을 드리고 직접 색을 고르고 예쁜 손을 보며 어르신들의 자존감도 향상시킬 수 있도록 도움을 드렸습니다.', 'img_201903071058542La9t4PfOA.JPEG', 'N', 'N', 1, 'admin', '2019-03-07 02:00:40', '0000-00-00 00:00:00'),
	(71, '', '3월 미술치료-3월 달력 만들기', '어르신들께서 직접 3월 달력 만들기를 해보았습니다. 빈칸에 맞는 숫자를 적어넣고 그림을 알록달록 예쁘게 색칠하며 신체와 인지의 잔존 기능도 유지시키고 직접 달력을 만들었다는 성취감도 가질 수 있도록 도움을 드렸습니다.', 'img_201903081644121Ui3KaBDkt.JPEG', 'N', 'N', 0, 'admin', '2019-03-08 07:45:10', '0000-00-00 00:00:00'),
	(72, '', '3월 놀이치료-도형쌓기', '크기가 다른 도형을 차례대로 쌓아 올리는 도형쌓기 프로그램을 실시함으로써 어르신들의 신체와 인지의 잔존 기능을 유지시키고 집중력을 향상시키고 타 어르신들과의 교류도 형서할 수 있도록 도움을 드렸습니다.', 'img_20190308164535ot0FxReQpd.JPEG', 'N', 'N', 1, 'admin', '2019-03-08 07:46:32', '0000-00-00 00:00:00'),
	(73, '', '3월 여가활동-노래방', '어르신들께서 평소 즐겨 부르던 노래를 같이 부르며 옆 어르신들과 교류를 형성하고 보다 활력있는 병동생활이 되도록 도움을 드렸습니다.', 'img_20190315111005X4fspYN8rj.JPEG', 'N', 'N', 0, 'admin', '2019-03-15 02:10:43', '0000-00-00 00:00:00'),
	(74, '', '3월 인지치료-낱말그림 연결하기', '낱말과 그림이 반씩 그려진 카드를 보며 단어와 그림을 유추하여 짝을 찾는 프로그램으로 어르신들의 인지와 신체의 잔존 기능을 유지시키고 집중력을 향상시킬 수 있도록 도움을 드렸습니다.', 'img_20190315111106BwylkUPYQD.JPEG', 'N', 'N', 0, 'admin', '2019-03-15 02:12:01', '0000-00-00 00:00:00'),
	(75, '', '3월 미술치료-봄 풍경 색칠하기', '봄을 맞이하여 꽃과 나무가 그려진 그림을 색칠하는 시간을 가져보았습니다. 어르신들께서 직접 색을 골라 알록달록 예쁘게 색칠하며 감각을 발달시키고 봄과 관련된 대화도 많이 나누며 즐거운 시간을 보내었습니다.', 'img_20190315111223JuEPzsxbjm.JPEG', 'N', 'N', 1, 'admin', '2019-03-15 02:13:24', '0000-00-00 00:00:00'),
	(76, '', '3월 미술치료-화투그림 맞추기', '화투그림을 보며 짝을 맞추는 프로그램으로 어르신들 인지의 잔존 기능을 유지시키고 과거 회상하며 옆 어르신들과 대화도 많이 나누며 즐겁게 참여하셨습니다.', 'img_20190315161922nb32RjpyAI.JPEG', 'N', 'N', 0, 'admin', '2019-03-15 07:20:28', '0000-00-00 00:00:00'),
	(77, '', '3월 여가활동-노래방', '노래방 프로그램을 통해 어르신들의 무료한 병동 생활에 조금이나마 즐거움을 드려 활력을 제공할 수 있도록 하였습니다.', 'img_20190327115419xhjtYK79I5.JPEG', 'N', 'N', 0, 'admin', '2019-03-27 02:54:56', '0000-00-00 00:00:00'),
	(78, '', '3월 인지치료-퍼즐맞추기', '퍼즐의 조각을 맞추며 어르신들의 인지와 신체의 잔존 기능을 유지시키고 집중력을 향상시키는데 도움을 드렸습니다.', 'img_20190327115514CYehoOjMp9.JPEG', 'N', 'N', 0, 'admin', '2019-03-27 02:55:55', '0000-00-00 00:00:00'),
	(79, '', '3월 여가활동-네일아트', '어르신들께서 좋아하는 색의 네일을 직접 고르며 발라드리니 예쁘다고 즐거워 하셨고 네일아트를 통해 자존감을 높이고 조금이나마 무료한 병동생활에 활력을 드리도록 하였습니다.', 'img_20190327115614AHIlc6qDX3.JPEG', 'N', 'N', 0, 'admin', '2019-03-27 02:58:06', '0000-00-00 00:00:00'),
