	(83, '', '3월 생신잔치-3층', '3월 생신을 맞이한 어르신들과 같은 병동 어르신들, 직원이 한자리에 모여 다같이 축하 노래도 불러 드리고 맛있는 음식도 나눠 드시며 아주 즐거운 생신파티를 하였습니다.', 'img_20190401103613ksFR8ZyHBW.JPEG', 'N', 'N', 0, 'admin', '2019-04-01 01:37:00', '0000-00-00 00:00:00'),
	(84, '', '4월 여가활동-노래방', '같은 병동 어르신들과 함께 평소 즐겨 부르시던 노래를 부르며 무료한 병동생활에 조금이나마 활력을 주고 타 어르신들과의 교류를 형성할 수 있도록 도움을 드렸습니다.', 'img_20190408114429kz9NsDJuQE.JPEG', 'N', 'N', 0, 'admin', '2019-04-08 02:45:24', '0000-00-00 00:00:00'),
