	(88, '', '4월 놀이치료-도형쌓기', '도형쌓기 프로그램은 여러가지 도형을 크기 순으로 쌓는 프로그램으로 타 어르신들과의 교류 형성에도 도움을 주고 집중력을 향상시키며 신체와 인지의 잔존 기능을 유지시킬 수 있도록 도움을 드립니다.', 'img_20190408115511dW9nToX6S1.JPEG', 'N', 'N', 0, 'admin', '2019-04-08 02:56:30', '0000-00-00 00:00:00'),
	(89, '', '4월 여가활동-노래방', '어르신들께서 평소 좋아하셨던 노래들을 부르며 무료한 병동생활에 조금이나마 활력을 주고 타 어르신들과 함께 박수도 치며 교류할 수 있는 시간이 되었습니다. ', 'img_20190412111245lDZK20hiU4.JPEG', 'N', 'N', 0, 'admin', '2019-04-12 02:13:49', '0000-00-00 00:00:00'),
	(90, '', '4월 인지치료-숫자 미로찾기', '숫자 미로찾기 프로그램이란 출발선에서부터 1부터 10까지의 수를 차례대로 찾으며 미로를 찾아 도착하는 인지활동 프로그램으로 어르신들께서 직접 숫자를 찾으며 숫자도 인지하고 기억력을 유지시키며 인지의 잔존 기능을 유지시키는데 도움을 드립니다.', 'img_201904121114094sUtVCM9pm.JPEG', 'N', 'N', 0, 'admin', '2019-04-12 02:16:25', '0000-00-00 00:00:00'),
	(91, '', '4월 여가활동-네일아트', '네일아트 프로그램을 통해 어르신들의 무료한 병동생활에 활력을 드리고 자존감을 높일 수 있는 시간이었고 직접 네일의 색을 고르며 즐거워 하셨고 옆 어르신들과 대화도 많이 나누셨습니다.', 'img_20190412111652HF0NC8JSQI.JPEG', 'N', 'N', 0, 'admin', '2019-04-12 02:17:25', '0000-00-00 00:00:00'),
	(92, '', '4월 미술치료-꽃다발 종이접기', '봄을 맞이하여 꽃다발 종이접기를 실시하였습니다. 어르신들을 위해 아주 쉬운 튤립꽃 접기를 하였고 어르신들께서 마지막까지 집중하여 천천히 잘 따라 하셨으며 다 완성된 꽃다발을 보며 예쁘다고 즐거워 하시는 모습을 볼 수 있었습니다.', 'img_20190412111749D7WZQbpqjO.JPEG', 'N', 'N', 0, 'admin', '2019-04-12 02:18:30', '0000-00-00 00:00:00'),
	(93, '', '4월 놀이치료-풍선배구', '풍선으로 배구하듯이 하는 풍선배구 프로그램을 통해 어르신들의 신체활동을 유도하여 신체의 잔존 기능을 유지시키고 집중력을 향상시키고 타 어르신들과의 교류 형성에도 도움을 드립니다.', 'img_20190412140527plLY9Nxun2.JPEG', 'N', 'N', 1, 'admin', '2019-04-12 06:02:17', '0000-00-00 00:00:00'),
	(94, '', '4월 여가활동 -노래방', '노래방 프로그램을 통해 어르신들께서 과거에 좋아하셨던 노래를 부르며 과거 회상도 하고 다같이 박수도 치고 흥겨워 어깨춤도 추시며 즐거운 시간을 보내게 되었습니다.', 'img_20190419113449vKbCA87orF.JPEG', 'N', 'N', 0, 'admin', '2019-04-19 02:35:26', '0000-00-00 00:00:00'),
	(95, '', '4월 인지치료-낱말카드 연결하기', '낱말카드 연결하기 프로그램이란 그림과 단어가 반씩 적힌 카드를 보며 연상하고 유추하여 카드의 나머지 장을 찾는 프로그램으로 어르신들 인지의 잔존 기능을 유지시켜 드리고 집중력을 향상시킬 수 있도록 도움을 드렸습니다.', 'img_2019041911355163TxjJXMRI.JPEG', 'N', 'N', 0, 'admin', '2019-04-19 02:37:56', '0000-00-00 00:00:00'),
	(96, '', '4월 여가활동-네일아트', '네일아트 프로그램을 통해 어르신들의 자존감을 향상시켜 드리고 무료한 병동생활에 조금이나마 활력과 즐거움을 드리도록 하였습니다.', 'img_20190419113814HrAO2RpKIN.JPEG', 'N', 'N', 0, 'admin', '2019-04-19 02:38:40', '0000-00-00 00:00:00'),
	(97, '', '4월 미술치료-스텐실', '스텐실이란 그림 모양판을 대고 색연필로 색칠을 하는 프로그램으로 어르신들께서 쉽게 따라 할 수 있으며 감각기능 발달 및 소근육 운동, 집중력 향상에 도움을 드릴 수 있고 그림을 보며 연상되는 대화도 많이 나누며 즐겁게 참여 하셨습니다.', 'img_20190419113911zyMD2P5sej.JPEG', 'N', 'N', 0, 'admin', '2019-04-19 02:40:52', '0000-00-00 00:00:00'),
	(98, '', '4월 여가활동-노래방', '어르신들께서 평소 즐겨시던 노래를 부르며 무료한 병동생활에 조금이나마 활력과 즐거움을 드리고 타 어르신들, 직원과의 교류를 형성할 수 있도록 도움을 드렸습니다.', 'img_20190426105157BywgWbG6Cs.JPEG', 'N', 'N', 0, 'admin', '2019-04-26 01:53:23', '0000-00-00 00:00:00'),
	(99, '', '4월 인지치료-과거 회상', '과거 사진을 보며 과거를 회상하며 기억을 되새기고 그림과 관련된 이야기를 하는 과거 회상 프로그램은 어르신들의 기억력을 유지시키고 인지의 잔존 기능을 유지시킬 수 있도록 도움을 드리며 옛추억을 떠올리며 어르신들께서 아주 즐거워 하시는 모습을 볼 수 있었습니다.', 'img_20190426105338mzcQBkMT7D.JPEG', 'N', 'N', 1, 'admin', '2019-04-26 01:58:09', '0000-00-00 00:00:00'),
	(100, '', '4월 생신잔치-6층', '4월 생신을 맞이한 어르신들 및 같은 병동 타 어르신들, 직원들과 함께 다같이 생신축하 노래도 부르고 맛있는 음식도 나눠 드시며 즐겁게 대화하는 시간이 되었습니다.', 'img_2019050314275417vH6XbLlh.JPEG', 'N', 'N', 0, 'admin', '2019-05-03 05:28:53', '0000-00-00 00:00:00'),
	(101, '', '4월 생신잔치-5층', '4월 생신을 맞은 어르신들과 같은 병동 어르신들께서 한자리에 모여 즐거운 생신파티를 하였습니다. 휴게실에 나오지 못하는 전신 와상 어르신들은 어르신들 자리에 직접 가 다같이 축하하며 즐거운 시간을 보내었습니다.', 'img_20190503142919WCBHG6tfgo.JPEG', 'N', 'N', 1, 'admin', '2019-05-03 05:30:25', '0000-00-00 00:00:00'),
	(102, '', '4월 생신잔치-3층', '4월 생신을 맞이한 어르신들께서 모두 와상 어르신이라 이번 생신파티는 각 어르신들의 자리에서 개인별로 축하 해드렸습니다. 직원들 및 같은방 어르신들께서 다같이 박수치고 생신축하 노래도 부르며 한마음으로 축하하는 시간이 되었고 어르신들께서도 미소를 보이는 등 비언어적 의사표현을 해주셔서 더욱 뜻깊은 시간이 되었습니다.', 'img_201905031430477W1wTAvbu5.JPEG', 'N', 'N', 2, 'admin', '2019-05-03 05:36:26', '0000-00-00 00:00:00'),
