	(256, '', '2월 여가활동-노래방', '어르신들께서 평소 좋아하셨던 노래를 부르며 같이 박수도 치고 옆 어르신들과 대화도 많이 나누며 즐겁게 참여 하셨고 무료한 병동 생활에 조금이나마 활력을 드리고 즐거움을 드릴 수 있는 시간이 되었습니다.', 'img_20200206105530to87P40vsm.JPEG', 'N', 'N', 0, 'admin', '2020-02-06 01:58:40', '0000-00-00 00:00:00'),
	(257, '', '2월 인지치료-과거 회상(옛 물건)', '어르신들께 옛 물건 그림을 보여 드리니 예전에 물건들을 사용하셨던 기억을 떠올리며 사용법 등 많은 이야기를 해주셨고 옛 추억을 떠올리며 즐거워 하시는 모습도 보이셨고 평소 말씀을 잘 하지 않던 어르신들도 옛날 그림을 보며 많은 대화를 나누며 적극적으로 프로그램에 참여하는 모습을 볼 수 있었습니다.', 'img_20200206105914BCXsPAdizo.JPEG', 'N', 'N', 2, 'admin', '2020-02-06 02:01:08', '0000-00-00 00:00:00'),
	(258, '', '2월 여가활동-네일아트', '어르신들께서 좋아하는 색의 네일을 직접 골라 발라 드리니 너무 예쁘다며 만족감을 보이셨고 네일아트 프로그램을 통해 어르신들 기분전환도 되고 활력을 드릴 수 있는 시간이 되었습니다.', 'img_20200206110206F1N7kMnj2q.JPEG', 'N', 'N', 1, 'admin', '2020-02-06 02:04:05', '0000-00-00 00:00:00'),
	(259, '', '2월 미술치료-2월 달력 만들기', '2월 달력 만들기 도안을 보여 드리니 숫자도 천천히 세며 기입하셨고 2월과 관련된 그림도 예쁘게 색칠하며 마지막까지 집중하여 참여 하셨고 다 완성된 달력을 보며 예쁘다며 옆에 붙여 달라고 하며 즐거워 하시는 모습을 볼 수 있었습니다.', 'img_20200207141827fg5IVq9dXx.JPEG', 'N', 'N', 0, 'admin', '2020-02-07 05:19:29', '0000-00-00 00:00:00'),
	(260, '', '2월 놀이치료-고리 던지기', '고리 던지기 프로그램을 통해 어르신들의 신체활동을 유도하고 집중력을 향상시킬 수 있도록 도움을 드렸으며 고리 던지기를 성공할때마다 어르신들께서 성취감을 느끼며 즐거워 하는 모습을 볼 수 있었습니다.', 'img_20200207141944sZAXreOjNx.JPEG', 'N', 'N', 1, 'admin', '2020-02-07 05:20:49', '0000-00-00 00:00:00'),
	(261, '', '2월 인지치료-', '그림 카드를 보며 그림에 맞는 단어를 찾는 프로그램으로 유인물이 아닌 그림을 보며 편하고 재미있게 학습할 수 있어서 어르신들께서 즐거워 하며 적극적인 참여 모습을 보이셨고 어르신들 인지의 잔존 기능을 유지시킬 수 있도록 도움을 드렸습니다.', 'img_20200228103807Ppi24wGLbV.JPEG', 'N', 'N', 3, 'admin', '2020-02-14 01:16:12', '2020-02-28 10:38:12'),
	(262, '', '2월 인지치료-덧셈 뺄셈 계산하기', '덧셈, 뺄셈하기 프로그램을 통해 어르신들 인지의 잔존 기능을 유지시키고 숫자를 기억하며 학습할 수 있는 시간이 되었고 중간 중간 어려운 문제는 천천히 반복 설명을 통해 해결할 수 있도록 부분 보조 해드렸습니다.', 'img_20200214101709C8hXRnkQJd.JPEG', 'N', 'N', 2, 'admin', '2020-02-14 01:18:54', '0000-00-00 00:00:00'),
	(263, '', '2월 미술치료-모자이크(우산 그림)', '알록달록 색종이를 찢어 붙이는 모자이크 프로그램을 통해 어르신들 소근육 발달에 도움을 드리고 인지 기능을 유지시키는데 도움을 드렸으며 그림과 관련된 대화도 많이 나누셨고 완성된 작품을 보며 예쁘다고 즐거워 하는 모습도 볼 수 있었습니다.', 'img_20200214101915I2jYtqJrcB.JPEG', 'N', 'N', 2, 'admin', '2020-02-14 01:21:12', '0000-00-00 00:00:00'),
	(264, '', '2월 인지치료-단어카드 맞추기', '그림을 보여 드리고 해당하는 단어를 찾는 단어카드 맞추기 프로그램을 통해 지루하고 따분한 한글 공부가 아닌 그림을 보며 재미있게 한글을 인지하고 기억할 수 있도록 도움을 드렸습니다.', 'img_20200221144841sEOv67jkTz.JPEG', 'N', 'N', 2, 'admin', '2020-02-21 05:50:09', '0000-00-00 00:00:00'),
	(265, '', '2월 인지치료-과거 회상(옛 대중교통)', '어르신들께 과거의 대중교통 그림을 보여 드리니 현재에는 잘 보지 못하는 택시, 버스 안내양 등 옛 추억을 떠올리며 많은 이야기를 해주셨고 어르신들께서 과거 회상 프로그램에는 항상 적극적이고 즐겁게 참여하는 모습을 보이셨습니다.', 'img_20200221145028w3POLj1sDg.JPEG', 'N', 'N', 1, 'admin', '2020-02-21 05:51:50', '0000-00-00 00:00:00'),
	(266, '', '2월 놀이치료-화투 그림 맞추기', '어르신들께서 예전에 많이들 해보셨던 화투의 그림을 보며 짝을 찾는 프로그램으로 어르신들 인지의 잔존 기능을 유지시켜 드리고 화투 그림을 맞추며 옛 기억도 떠올리며 많은 대화를 나누며 즐겁게 참여 하셨습니다.', 'img_20200221145213PBNekn5h0w.JPEG', 'N', 'N', 3, 'admin', '2020-02-21 05:52:52', '0000-00-00 00:00:00'),
	(267, '', '2월 미술치료-만다라 색칠하기', '만다라 색칠하기를 통해 어르신들 인지의 잔존 기능 유지 및 감각을 발달시키는데 도움을 드렸으며 색칠하기를 통해 정서적 안정감도 제공하고 대화도 많이 나누며 서로 소통하는 시간이 되었습니다.', 'img_20200228102623KjXUMiFLWR.JPEG', 'N', 'N', 1, 'admin', '2020-02-28 01:29:10', '0000-00-00 00:00:00'),
	(268, '', '2월 인지치료-과거 회상', '옛 생활 풍경 그림을 보여 드리며 옛 추억도 떠올려 대화를 나누는 프로그램으로 어르신들의 기억력 유지에 도움을 드리고 옛 추억을 회상하며 정서적 안정감 및 라포 형성을 할 수 있는 시간이 되었습니다.', 'img_20200228102929yev45IOVrS.JPEG', 'N', 'N', 2, 'admin', '2020-02-28 01:31:37', '0000-00-00 00:00:00'),
	(269, '', '2월 미술치료-색연필 스텐실', '스텐실 도안을 대고 색연필을 이용하여 그림을 그리는 프로그램으로 어르신들께서 손쉽게 따라하며 그림과 관련된 대화도 많이 나누셨고 완성된 그림을 보며 예쁘다고 즐거워 하는 모습을 볼 수 있었습니다.', 'img_2020022810320481xVXW0iE4.JPEG', 'N', 'N', 3, 'admin', '2020-02-28 01:33:53', '0000-00-00 00:00:00'),
	(270, '', '2월 놀이치료-고리 던지기', '고리 던지기 프로그램을 통해 침상 생활이 많은 어르신들께 신체 활동을 유도 해드리고 고리 던지기를 성공할때마다 성취감을 느낄 수 있는 시간이 되었으며 고리 던지기를 하며 대화도 많이 나누시고 아주 즐겁게 참여 하셨습니다.', 'img_20200228161137z7L0qrQgde.JPEG', 'N', 'N', 1, 'admin', '2020-02-28 07:12:55', '0000-00-00 00:00:00'),
	(271, '', '3월 인지치료-3월 달력 만들기', '어르신들꼐서 직접 숫자도 기입하고 3월과 관련된 그림을 색칠하며 3월 달력 만들기를 실시하였습니다. 달력 만들기 프로그램을 통해 숫자와 날짜를 인지시켜 드리고 색칠하기를 통해 소근육 발달에도 도움을 드릴 수 있는 시간이 되었습니다.', 'img_20200306100333Q13lfIqH7J.JPEG', 'N', 'N', 2, 'admin', '2020-03-06 01:05:01', '0000-00-00 00:00:00'),
	(272, '', '3월 미술치료-꽃 종이접기', '봄을 맞이하여 색종이로 예쁜 꽃을 접는 시간을 가져 보았습니다. 어르신들께서 손쉽게 꽃을 따라 접고 붙이며 인지와 신체의 잔존 기능을 유지하고 꽃을 보며 무료한 병동생활에 조금이나마 활력을 드릴 수 있는 시간이 되었습니다.', 'img_20200306100517fYbDdTPIeB.JPEG', 'N', 'N', 2, 'admin', '2020-03-06 01:06:50', '0000-00-00 00:00:00'),
	(273, '', '3월 인지치료-그림카드 맞추기', '그림 카드를 보며 그림에 맞는 단어를 맞추는 프로그램으로 어르신들께서 손쉽고 즐겁게 한글 공부도 하고 그림, 사물을 인지할 수 있도록 도움을 드렸고 어르신들께서 모두 재미있어하며 적극적으로 참여하는 모습을 볼 수 있었습니다.', 'img_20200309144014oj65XpQYbm.JPEG', 'N', 'N', 5, 'admin', '2020-03-09 05:41:43', '0000-00-00 00:00:00'),
	(274, '', '3월 인지치료-그림 카드 맞추기', '그림을 보며 해당하는 단어를 찾는 프로그램으로 어르신들께서 그림을 보며 재미있게 한글을 기억하고 사물 등을 기억하며 인지의 잔존 기능을 유지시킬 수 있는 시간이 되었습니다.', 'img_20200313141726zr8coJCY2F.JPEG', 'N', 'N', 1, 'admin', '2020-03-13 05:18:40', '0000-00-00 00:00:00'),
	(275, '', '3월 미술치료-모자이크(과일 그림)', '과일 그림이 그려진 도안에 색종이를 손으로 찢어 붙이는 모자이크 프로그램을 통해 어르신들의 소근육 발달 및 인지의 잔존 기능을 유지시킬 수 있도록 도움을 드렸고 완성된 작품을 보며 너무 예쁘다며 만족해 하는 모습도 볼 수 있었습니다.', 'img_20200313141853vdUOwBTNgF.JPEG', 'N', 'N', 2, 'admin', '2020-03-13 05:19:42', '0000-00-00 00:00:00'),
	(276, '', '3월 인지치료-조각 맞추기', '퍼즐을 맞추는 프로그램으로 어르신들께서 퍼즐 조각을 그냥 맞추기에는 다소 어려움을 보이시어 뒷면에 숫자를 적어 숫자에 해당하는 조각을 맞출 수 있도록 도움을 드렸습니다.', 'img_20200313142126AIOhw0aTxm.JPEG', 'N', 'N', 1, 'admin', '2020-03-13 05:22:10', '0000-00-00 00:00:00'),
	(277, '', '3월 미술치료-봄 그림 색칠하기', '봄을 맞이하여 봄 그림을 색칠하는 시간을 가져 보았습니다. 어르신들께서 직접 원하는 색을 골라 알록달록 예쁘게 색칠하셨고 다 완성된 그림을 보며 이렇게라도 꽃을 보니 봄이 온거 같다며 즐거워 하는 모습을 볼 수 있었습니다.', 'img_202003131422286qhBu0yfNz.JPEG', 'N', 'N', 1, 'admin', '2020-03-13 05:23:16', '0000-00-00 00:00:00'),
	(278, '', '3월 놀이치료-고리 던지기', '침상에 누워 계시는 시간이 많은 어르신들께 고리 던지기 프로그램을 통해 조금이나마 신체 활동을 유도하여 활력을 드리고 신체의 잔존 기능을 유지시킬 수 있도록 도움을 드렸고 고리 던지기를 성공할때마다 성취감을 느끼며 기뻐하는 모습을 보이며 즐겁게 참여 하셨습니다.', 'img_20200313142336SdXLRyDnAN.JPEG', 'N', 'N', 2, 'admin', '2020-03-13 05:24:44', '0000-00-00 00:00:00'),
	(279, '', '3월 미술치료-꽃 색칠하기', '어르신들께서 꽃 그림을 알록달록 예쁘게 색칠하며 소근육 발달에도 도움을 드리고 예쁜 그림을 보며 기분전환도 되고 좋다며 즐겁게 참여하는 모습을 볼 수 있었습니다.', 'img_20200320144313OEikMf8oQm.JPEG', 'N', 'N', 0, 'admin', '2020-03-20 05:44:43', '0000-00-00 00:00:00'),
	(280, '', '3월 인지치료-금액 계산하기', '화폐 그림이 그려진 도안을 보며 같은 금액을 찾아 연결하는 프로그램으로 어르신들께서 직접 금액을 계산하고 같은 금액을 찾으며 숫자 및 화폐단위를 계속 인지시켜 드리고 기억력 감퇴를 조금이나마 감소시켜 드릴 수 있는 시간이 되었습니다.', 'img_20200320144507EhY3IVbiFu.JPEG', 'N', 'N', 1, 'admin', '2020-03-20 05:46:21', '0000-00-00 00:00:00'),
	(281, '', '3월 놀이치료-화투 그림 맞추기', '화투 그림을 보며 화투의 숫자도 인지하고 같은 그림의 짝을 찾는 프로그램으로 어르신들 인지의 잔존 기능을 유지시켜 드리고 화투와 관련된 추억을 떠올리며 과거 회상하는 모습도 보이셨고 많은 대화를 나누며 즐겁게 참여하는 모습을 볼 수 있었습니다.', 'img_20200320144643mk3TbfpdNQ.JPEG', 'N', 'N', 2, 'admin', '2020-03-20 05:47:43', '0000-00-00 00:00:00'),
	(282, '', '3월 인지치료-숫자 연결하기', '숫자를 차례대로 연결하여 밑그림을 완성시키고 예쁘게 색칠하는 숫자 연결하기 프로그램을 통해 어르신들 인지의 잔존 기능을 유지시키고 소근육 발달에도 도움을 드렸으며 다 완성된 그림을 보며 대화도 많이 나누며 즐겁게 참여 하셨습니다.', 'img_20200403113253IQVvbYsMFc.JPEG', 'N', 'N', 0, 'admin', '2020-04-03 02:36:17', '0000-00-00 00:00:00'),
	(283, '', '3월 미술치료-색연필 스텐실', '스텐실 도안을 대고 색연필을 이용하여 색을 채워넣는 색연필 스텐실 프로그램은 어르신들께서 손쉽게 따라하여 그림을 완성시키고 완성된 그림을 보며 성취감도 느낄 수 있고 감각발달에도 도움을 드리는 시간이 되었습니다.', 'img_20200403114511vSeygGbYmc.JPEG', 'N', 'N', 0, 'admin', '2020-04-03 02:59:51', '0000-00-00 00:00:00'),
	(284, '', '3월 인지치료-색깔, 단어 맞추기', '색깔,단어 맞추기 프로그램이란 색깔에 해당하는 단어가 맞으면 O, 틀리면 X를 표시하는 프로그램으로 어르신들께서 색과 글을 동시에 인지할 수 있도록 도움을 드렸으며 어렵지 않게 잘 따라하는 모습을 볼 수 있었습니다.', 'img_20200403144012hSpa1EWBCs.JPEG', 'N', 'N', 0, 'admin', '2020-04-03 05:42:25', '0000-00-00 00:00:00'),
	(285, '', '3월 미술치료-만다라 색칠하기', '만다라 색칠하기 도안을 예쁘게 색칠하며 어르신들의 집중력을 키우고 소근육 발달에도 도움을 드렸으며 다 완성된 그림을 보며 예쁘다고 좋아하시며 대화도 많이 나누는 모습을 보이셨습니다.', 'img_20200403144242RyzMkQCo76.JPEG', 'N', 'N', 0, 'admin', '2020-04-03 05:43:28', '0000-00-00 00:00:00'),
	(286, '', '3월 놀이치료-색깔 분류하기', '여러가지 색이 섞인 색종이를 각각의 색깔 주머니에 꽂아 분류하는 프로그램으로 어르신들에게 재미있게 놀이하듯이 색을 인지시켜 드리고 색종이를 집으며 소근육 발달 및 분류하기를 통해 인지의 잔존 기능을 유지시키도록 도움을 드렸습니다.', 'img_20200403162931sc8A6GSCz7.JPEG', 'N', 'N', 0, 'admin', '2020-04-03 07:32:12', '0000-00-00 00:00:00'),
	(287, '', '3월 인지치료-끝말잇기', '어릴때 많이 하던 끝말잇기를 하며 어르신들께서 즐겁게 한글을 인지하고 기억할 수 있도록 도움을 드리는 시간이었으며 어르신들께서도 어릴때 하던걸 이렇게 다시 해보니 재미있다며 즐겁게 참여하는 모습을 볼 수 있었습니다.', 'img_20200403163713xEm6r3Vivj.JPEG', 'N', 'N', 0, 'admin', '2020-04-03 07:40:47', '0000-00-00 00:00:00'),
	(288, '', '3월 미술치료-봄 그림 색칠하기', '꽃과 나비가 어우러져 있는 그림을 색칠하며 집중력도 향상시키고 다 완성된 예쁜 그림을 보며 무료한 병동 생활에 조금이나마 활력을 드릴 수 있는 즐거운 시간이었습니다.', 'img_20200403164059VmXOBoFdNa.JPEG', 'N', 'N', 0, 'admin', '2020-04-03 07:42:04', '0000-00-00 00:00:00'),
	(289, '', '4월 인지치료-과거 회상 (봄 그림)', '어르신들께 봄과 관련된 그림을 보여 드리며 옛 추억을 떠올리며 대화를 나누는 프로그램으로 어르신들께서 화사한 봄꽃 그림을 보며 봄, 꽃과 관련된 대화도 많이 나누셨고 이렇게라도 봄이 온걸 보니 좋다며 즐거워 하는 모습을 보이셨습니다.', 'img_20200403164235SJlmH8Vph6.JPEG', 'N', 'N', 0, 'admin', '2020-04-03 07:43:57', '0000-00-00 00:00:00'),
	(290, '', '4월 미술치료-4월 달력 만들기', '달력의 빈칸에 숫자를 직접 기입하고 그림 도안을 예쁘게 색칠하여 4월 달력을 완성시키는 프로그램으로 어르신들께서 직접 달력을 만들며 성취감도 느끼고 만든 달력을 비치하여 드리니 더욱더 좋아하시며 의미있는 시간이 되었습니다.', 'img_20200403164418NFXD8lg21R.JPEG', 'N', 'N', 0, 'admin', '2020-04-03 07:46:40', '0000-00-00 00:00:00'),
	(291, '', '4월 놀이치료-도형 쌓기', '도형을 크기별로 분류하며 차례대로 쌓는 도형쌓기 프로그램을 통해 어르신들께서 재미있게 놀이를 하며 소근육 발달 및 집중력을 향상시킬 수 있도록 도움을 드렸습니다.', 'img_20200403164829T15VS3YnQz.JPEG', 'N', 'Y', 1, 'admin', '2020-04-03 07:52:09', '0000-00-00 00:00:00'),
	(292, '', '4월 놀이치료-도형 쌓기', '도형을 크기별로 분류하며 차례대로 쌓는 도형쌓기 프로그램을 통해 어르신들께서 재미있게 놀이를 하며 소근육 발달 및 집중력을 향상시킬 수 있도록 도움을 드렸습니다.', 'img_20200403164829T15VS3YnQz.JPEG', 'N', 'N', 1, 'admin', '2020-04-03 07:52:09', '0000-00-00 00:00:00'),
	(293, '', '4월 인지치료-도형,글자 맞추기', '각 도형에 적혀있는 글자를 보고 빈칸을 채워 단어, 문장을 완성하는 도형,글자 맞추기 프로그램에 어르신들께서 처음에는 다소 어려워 하는 모습을 보이셨으나 글자를 적는 시범을 보여 드리니 이후에는 어렵지 않게 잘 따라 하셨고 마지막까지 집중하여 글자를 찾아 적는 모습을 보이셨습니다.', 'img_20200417103736bL4eOdSzoJ.JPEG', 'N', 'N', 0, 'admin', '2020-04-17 01:38:51', '0000-00-00 00:00:00'),
	(294, '', '4월 미술치료-색연필 스텐실', '종이에 그림 도안을 대고 색칠을 하는 색연필 스텐실 프로그램에 어르신들께서 재미있다며 잘 따라 하셨고 색연필로 하나한 색칠할때마다 완성되는 그림들을 보며 예쁘다고 좋아하며 대화도 많이 나누는 모습을 보이셨습니다.', 'img_20200417104030DFYBO0HvpI.JPEG', 'N', 'N', 0, 'admin', '2020-04-17 01:41:28', '0000-00-00 00:00:00'),
	(295, '', '4월 놀이치료-고리 던지기', '평소 침상에서 생활하는 시간이 많은 어르신들께서 고리 던지기 프로그램을 통해 조금이나마 신체를 움직이며 활동을 유도할 수 있었고 고리 던지기에 성공을 할때마다 성취감도 느끼며 재미있게 참여 하셨습니다.', 'img_20200417104250kscNKpruBM.JPEG', 'N', 'N', 0, 'admin', '2020-04-17 01:43:43', '0000-00-00 00:00:00'),
	(296, '', '4월 인지치료-끝말잇기', '어릴때 많이 하던 끝말잇기를 직접 글로 적으며 실시하는 프로그램으로 어르신들 인지의 잔존 기능을 유지시키고 옛 추억을 떠올리며 단어 하나하나와 관련된 대화도 많이 나누며 즐겁게 참여 하셨습니다.', 'img_20200417104538UBl42atJZc.JPEG', 'N', 'N', 0, 'admin', '2020-04-17 01:46:45', '0000-00-00 00:00:00'),
	(297, '', '4월 미술치료-전통문양 색칠하기', '전통문양 색칠하기 프로그램을 통해 어르신들의 소근육 발달에 도움을 드렸고 어르신들께서 과거 전통가옥, 절 등에서 보았던 전통 문양에 대해 대화도 아주 많이 나누며 즐겁게 참여 하셨습니다.', 'img_20200417104706pfJAGEkv7n.JPEG', 'N', 'N', 1, 'admin', '2020-04-17 01:48:23', '0000-00-00 00:00:00'),
	(298, '', '4월 미술치료-물고기 종이접기', '어르신들과 함께 물고기 종이접기를 하고 바다 그림을 예쁘게 색칠하는 시간으로 어르신들 소근육 발달 및 인지의 잔존 기능을 유지시킬 수 있도록 도움을 드렸으며 어르신들께서 직접 종이를 접을때마다 물고기가 완성되는 것을 보시고 만족해 하며 즐거워 하는 모습을 보이셨습니다.', 'img_20200417104848Fpd7f9Cm4y.JPEG', 'N', 'N', 0, 'admin', '2020-04-17 01:49:54', '0000-00-00 00:00:00'),
	(299, '', '4월 인지치료-미로찾기', '미로찾기 프로그램을 통해 어르신들 인지의 잔존 기능을 유지시키도록 도움을 드렸으며 중간 중간 막히는 곳은 부분 보조하여 마무리 할 수 있도록 하였습니다.', 'img_20200504151636R97whdSGoz.JPEG', 'N', 'N', 0, 'admin', '2020-05-04 06:18:09', '0000-00-00 00:00:00'),
	(300, '', '4월 미술치료-만다라 색칠하기', '어르신들께서 만다라 색칠하기 프로그램에 적극적인 참여 모습을 보이셨으나 색칠하기를 통해 집중력을 향상시키고 감각 발달 및 소근육 발달을 도와 드리고 정서적 안정감을 제공할 수 있도록 도움을 드렸습니다.', 'img_20200504151857gDHQRxqbVP.JPEG', 'N', 'N', 0, 'admin', '2020-05-04 06:19:49', '0000-00-00 00:00:00'),
	(301, '', '4월 인지치료-과거 회상', '어르신들께 옛날 그림을 보여 드리며 옛 추억을 떠올려 같이 대화 나누는 프로그램으로 어르신들께서 과거에 사용하셨던 물건들을 보며 사용법도 알려 주시고 즐겁게 대화 나누셨습니다.', 'img_20200504152005N1AQlUnxj0.JPEG', 'N', 'N', 0, 'admin', '2020-05-04 06:20:59', '0000-00-00 00:00:00'),
	(302, '', '4월 인지치료-도형,글자 맞추기', '도형,글자 맞추기 프로그램이란 각 도형마다 적힌 글자를 하나하나 적어가며 문장이나 단어를 완성하는 프로그램으로 어르신들 인지의 잔존 기능을 유지시키고 문장을 직접 읽고 쓰며 기억력을 유지시킬 수 있도록 도움을 드렸습니다.', 'img_20200504152149LQvXEtg05j.JPEG', 'N', 'N', 1, 'admin', '2020-05-04 06:22:58', '0000-00-00 00:00:00'),
	(303, '', '4월 미술치료-숫자별 색칠하기', '각 그림에 숫자별로 정해진 색깔을 찾아 색칠하는 프로그램으로 어르신들께서 직접 숫자도 찾고 숫자에 맞는 색깔을 찾아 색칠하며 인지능력을 유지시키고 쉽게 그림을 완성할 수 있도록 도움을 드렸으며 다 완성된 그림을 보며 만족해 하는 모습을 볼 수 있었습니다.', 'img_20200504152310zyrC8RxGnd.JPEG', 'N', 'N', 1, 'admin', '2020-05-04 06:24:43', '0000-00-00 00:00:00'),
	(304, '', '5월 인지치료-과거 회상', '어르신들께서 예전에 많이 보셨던 옛 시골 풍경 그림을 보여 드리며 대화 나누는 프로그램으로 어르신들께서 옛 추억을 떠올리며 즐겁게 많은 대화를 나누셨고 어르신들과 같이 공감하며 소통할 수 있는 시간이 되었습니다.', 'img_20200504152504BjXFCHDxSi.JPEG', 'N', 'N', 1, 'admin', '2020-05-04 06:27:51', '0000-00-00 00:00:00'),
	(305, '', '5월 미술치료-5월 달력 만들기', '5월은 어버이날,스승의날이 있는 달로 이번 5월 달력 만들기는 카네이션 그림을 색칠하며 달력을 만드는 시간을 가져 보았습니다. 어르신들 각자의 취향대로 카네이션을 예쁘게 색칠하고 숫자도 순서대로 기입하며 달력을 완성하셨고 다 완성된 달력을 보며 만족해 하며 즐거워 하는 모습을 보이셨습니다.', 'img_2020051510420881iwBPdRur.JPEG', 'N', 'N', 0, 'admin', '2020-05-15 01:44:07', '0000-00-00 00:00:00'),
	(306, '', '5월 어버이날 행사 (5월 8일-카네이션 달아 드리기', '5월 8일 어버이날을 맞아 각 병동 모든 어르신들께 직원들이 다같이 카네이션을 달아 드렸습니다. 한가족이라는 마음으로 가족분들을 대신하여 정성껏 카네이션을 달아 드리며 감사인사도 함께 건내 드리니 어르신들께서 너무 좋아하시며 기뻐하는 모습을 보이셨습니다.', 'img_20200515104820fF5sp3LJkI.JPEG', 'N', 'N', 3, 'admin', '2020-05-15 01:48:30', '2020-05-15 10:54:45'),
	(307, '', '5월 인지치료-퍼즐 맞추기', '퍼즐 맞추기 프로그램에 어르신들께서 그냥 맞추기를 하면 다소 어려워 하시어 퍼즐 조각 뒤에 숫자를 적어놓고 숫자에 맞게 찾아서 완성하도록 유도 해드리니 어르신들께서 모두 쉽게 잘 따라 하셨고 다 완성된 퍼즐을 보며 성취감, 만족감을 느끼며 즐거워 하시는 모습을 볼 수 있었습니다.', 'img_20200515105114cDkjwSVER3.JPEG', 'N', 'N', 0, 'admin', '2020-05-15 01:52:19', '0000-00-00 00:00:00'),
	(308, '', '5월 미술치료-꽃 색칠하기', '어르신들께서 색칠하기 중에 제일 관심가지고 좋아하시는 꽃 그림 색칠하기를 실시하였습니다. 알록달록 예쁜 꽃을 완성하며 소근육 발달에 도움을 드릴 뿐 아니라 감각발달에도 도움을 드리고 꽃과 관련된 대화도 많이 나누며 즐겁게 참여 하셨습니다.', 'img_20200515105244t7CKN9gwOd.JPEG', 'N', 'N', 0, 'admin', '2020-05-15 01:54:22', '0000-00-00 00:00:00'),
	(309, '', '5월 인지치료-금액 계산하기', '돈 그림이 그려진 교안을 보며 금액을 계산하여 같은 금액끼리 연결하는 프로그램으로 어르신들 인지의 잔존 기능을 유지시키고 기억력을 유지시킬 수 있도록 도움을 드렸으며 중간 중간 계산이 어려운 부분은 부분보조하여 같이 마무리 하였습니다.', 'img_20200515105555Q9z3PGL1cX.JPEG', 'N', 'N', 0, 'admin', '2020-05-15 01:57:04', '0000-00-00 00:00:00'),
	(310, '', '5월 미술치료-만다라 색칠하기', '만다라 색칠하기 프로그램을 통해 어르신들의 신체의 잔존 기능 유지 및 감각 발달을 도와 드리며 한곳에 집중하며 색칠을 함으로써 정서적 안정감도 제공해 드릴 수 있는 시간이 되었습니다.', 'img_20200522103745LFJknxYj3Z.JPEG', 'N', 'N', 0, 'admin', '2020-05-22 01:38:49', '0000-00-00 00:00:00'),
	(311, '', '5월 놀이치료-동물카드 맞추기', '동물 그림이 그려진 카드를 보고 그림의 반쪽을 찾는 프로그램으로 어르신들께 그림을 보며 재미있게 한글 공부도 하고 동물도 인지시켜 드릴 수 있었습니다. 어르신들께서도 재미있어 하시며 즐겁게 대화 나누며 적극적인 참여 모습을 보이셨습니다.', 'img_20200522104728PmMadHskUD.JPEG', 'N', 'N', 0, 'admin', '2020-05-22 01:49:41', '0000-00-00 00:00:00'),
	(312, '', '5월 인지치료-문장 따라 말하기', '긴 문장에 적힌 교안을 보며 따라 말하는 프로그램으로 어르신들께 한글도 인지시켜 드리고 말하는 것을 잊지않게 계속 대화 유도하였고 어르신들께서 즐겁게 참여하는 모습을 보이셨습니다.', 'img_20200522105337zEMRXfu4dA.JPEG', 'N', 'N', 0, 'admin', '2020-05-22 02:00:35', '0000-00-00 00:00:00'),
	(313, '', '5월 미술치료-옥수수 종이접기', '옥수수 그림이 그려진 도안에 색종이를 동그랗게 접어 옥수수알을 만들어 붙이는 프로그램으로 어르신들께서 대부분 쉽게 잘 따라 만드셨고 아주 재미있어 하시며 마무리하셨고 다완성된 작품을 보며 즐겁게 대화 나누셨습니다.', 'img_2020052211005309mkXwbFjs.JPEG', 'N', 'N', 0, 'admin', '2020-05-22 02:01:41', '0000-00-00 00:00:00'),
	(314, '', '5월 인지치료-특정 글자 찾기', '여러가지 비슷한 글자들이 적힌 교안을 보고 지정된 글자를 찾고 갯수를 세어 기입하는 프로그램으로 어르신들 인지의 잔존 기능을 유지시켜 드리고 집중력을 향상시킬 수 있도록 도움을 드렸습니다.', 'img_20200522110311SzEUBXYfFC.JPEG', 'N', 'N', 0, 'admin', '2020-05-22 02:07:45', '0000-00-00 00:00:00'),
	(315, '', '5월 놀이치료-화투 그림 맞추기', '어르신들께서 예전에 화투는 한번씩 다 쳐보셨던 기억을 떠올리며 크게 확대된 화투 그림의 짝을 맞추는 프로그램 입니다. 어르신들께서 재미있게 그림의 짝을 맞추며 어르신들 인지의 잔존 기능을 유지시켜 드리고 기억력을 유지시킬 수 있도록 도움을 드렸습니다.', 'img_20200529102846gwa0L5PDdt.JPEG', 'N', 'N', 0, 'admin', '2020-05-29 01:29:38', '0000-00-00 00:00:00'),
	(316, '', '5월 인지치료-신발 끈 묶기', '어르신들의 소근육 발달 및 인지기능을 유지시켜 드리기 위해 신발끈 묶기를 실시하였습니다. 어렵지 않게 잘 따라하는 어르신들이 계신 반면 끈 끼우기에 어려움을 보이는 어르신도 계셔 부분 보조하며 도움을 드렸습니다.', 'img_20200529103002IpdmfXbxCo.JPEG', 'N', 'N', 0, 'admin', '2020-05-29 01:30:56', '0000-00-00 00:00:00'),
	(317, '', '5월 생신잔치-5층', '코로나로 인하여 잠시 중단했던 생신잔치를 다시 하게 되었습니다. 철저한 개인 위생관리 및 마스크 착용 후 다같이 한자리에 모여 생신 주인공 어르신들을 축하 해주며 즐거운 시간을 보내었습니다.', 'img_202005291031429jph3xcT4Y.JPEG', 'N', 'N', 0, 'admin', '2020-05-29 01:33:04', '0000-00-00 00:00:00'),
	(318, '', '5월 생신잔치-6층', '코로나로 인하여 잠시 중단했던 생신잔치를 다시 하게 되었습니다. 철저한 개인 위생관리 및 마스크 착용 후 다같이 한자리에 모여 생신 주인공 어르신들을 축하 해주며 즐거운 시간을 보내었습니다.', 'img_2020052910332907C8jUWlK4.JPEG', 'N', 'N', 0, 'admin', '2020-05-29 01:33:33', '0000-00-00 00:00:00'),
	(319, '', '5월 생신잔치-4층', '코로나로 인하여 잠시 중단했던 생신잔치를 다시 하게 되었습니다. 철저한 개인 위생관리 및 마스크 착용 후 다같이 한자리에 모여 생신 주인공 어르신들을 축하 해주며 즐거운 시간을 보내었습니다.', 'img_20200529103353ALRY9xTMN3.JPEG', 'N', 'N', 4, 'admin', '2020-05-29 01:33:58', '0000-00-00 00:00:00'),
	(320, '', '5월 생신파티-3층', '코로나로 인하여 잠시 중단했던 생신잔치를 다시 하게 되었습니다. 철저한 개인 위생관리 및 마스크 착용 후 오늘은 전신 와상 어르신으로 어르신들 각 자리에 가서 다같이 모여 생신축하를 해드렸고 어르신들께서도 활짝 웃으며 좋아하는 모습을 보이셨습니다.', 'img_20200529144756ws2QMfEYFe.JPEG', 'N', 'N', 0, 'admin', '2020-05-29 05:49:05', '0000-00-00 00:00:00'),
	(321, '', '6월 인지치료-과거회상(6월 꽃)', '6월에 피는 꽃 그림을 보며 대화 나누는 프로그램으로 어르신들께서 대부분 꽃 이름을 말씀 드리니 기억하며 옛 기억을 떠올리며 관련된 대화를 즐겁게  나누셨습니다.', 'img_20200605150516uqxsMw3U86.JPEG', 'N', 'N', 0, 'admin', '2020-06-05 06:06:52', '0000-00-00 00:00:00'),
	(322, '', '6월 인지치료-퍼즐 맞추기', '어르신들께서 퍼즐 맞추기에 다소 어려움을 보이시어 퍼즐 조각과 퍼즐판 뒤에 같은 숫자를 기입하여 같은 숫자를 찾아 맞추기를 하시도록 유도 해드리니 이후에는 쉽게 잘 따라 하셨고 마지막까지 집중하여 퍼즐 맞추기를 마무리 하는 모습을 보이셨습니다.', 'img_20200605150720Pnv0SQ8aqr.JPEG', 'N', 'N', 0, 'admin', '2020-06-05 06:10:38', '0000-00-00 00:00:00'),
