	(324, '', '6월 미술치료-6월 달력 만들기', '6월 달력 만들기 도안을 보며 날짜의 빈칸에 숫자도 정확히 깅비하시고 6월에 피는 장미꽃을 예쁘게 색칠하셨고 중간 중간 대화도 많이 나누며 즐겁게 참여 하셨습니다.', 'img_20200605151407mtjCxTQqOy.JPEG', 'N', 'N', 0, 'admin', '2020-06-05 06:14:47', '0000-00-00 00:00:00'),
	(325, '', '6월 인지치료-문장 따라 쓰기', '여러개의 문장을 따라쓰는 프로그램으로 어르신들께 한글을 지속적으로 인지시켜 드리며 기억력을 유지시키고 인지의 잔존 기능을 유지시킬 수 있도록 도움을 드렸습니다.', 'img_20200612145648t7EpBjOl9i.JPEG', 'N', 'N', 0, 'admin', '2020-06-12 05:58:04', '0000-00-00 00:00:00'),
	(326, '', '6월 인지치료-숫자 연결하기', '숫자를 순서대로 연결하여 그림을 완성시키고 예쁘게 색칠하는 프로그램으로 어르신들 인지의 잔존 기능을 유지시켜 드리고 소근육 발달에도 도움을 드릴 수 있는 시간이었습니다.', 'img_202006121458327H81iRT0WK.JPEG', 'N', 'N', 0, 'admin', '2020-06-12 06:07:15', '0000-00-00 00:00:00'),
	(327, '', '6월 미술치료-색종이 끼우기', '알록달록 예쁜 색종이 띠를 엇갈려 끼워 작품을 완성시키는 프로그램으로 어르신들께서 처음에는 조금 어려워 하는 모습을 보이셨으나 천천히 설명 드리며 시범을 보여 드리니 이후에는 잘 따라 하셨고 다 완성된 작품을 보며 예쁘다고 만족해 하는 모습을 볼 수 있었습니다.', 'img_20200612150741bQg6kuIlV0.JPEG', 'N', 'N', 0, 'admin', '2020-06-12 06:08:46', '0000-00-00 00:00:00'),
	(328, '', '6월 놀이치료-그림 카드 맞추기', '동물 그림이 그려진 카드 반쪽을 깔아놓고 반쪽을 보여 드리며 짝을 찾는 프로그램으로 어르신들께서 어렵지 않게 동물과 한글을 인지하며 학습할 수 있는 시간이 되었고 각 동물과 관련된 대화도 많이 나누며 즐겁게 참여 하셨습니다.', 'img_20200612150914q8DrfsRLPY.JPEG', 'N', 'N', 0, 'admin', '2020-06-12 06:11:32', '0000-00-00 00:00:00'),
