	(333, '', '6월 인지치료-숫자, 도형 맞추기', '도형을 찾아 도형에 적혀있는 글자나 숫자를 적는 프로그램으로 어르신들께서 처음에는 조금 어려워 하셨으나 하나하나 짚어 드리며 천천히 설명 드리니 이후에는 잘 따라 하셨고 마지막까지 집중하여 마무리하는 모습을 볼 수 있었습니다.', 'img_20200626142804wtazhxrFeL.JPEG', 'N', 'N', 0, 'admin', '2020-06-26 05:39:14', '0000-00-00 00:00:00'),
