	(340, '', '7월 인지치료-7월 달력 만들기', '어르신들께서 달력 만들기 프로그램에는 항상 적극적인 참여 모습을 보이며 날짜도 정확하게 기입하고 알록달록 색칠하기도 집중하여 마무리 하는 모습을 보이셨습니다.', 'img_20200703141545JPSsENk4Q8.JPEG', 'N', 'N', 0, 'admin', '2020-07-03 05:18:00', '0000-00-00 00:00:00'),
	(341, '', '7월 미술치료-바다 그림 색칠하기', '7월 여름을 맞이하여 바다 그림을 색칠하는 시간을 가져 보았습니다. 바다에 사는 여러 해양 생물들을 색칠하며 어르신들의 소근육 발달 및 감각 발달을 도와 드리고 집중력을 유지시킬 수 있도록 도움을 드렸습니다.', 'img_20200703141824oFWjJ7DmXw.JPEG', 'N', 'N', 2, 'admin', '2020-07-03 05:19:17', '0000-00-00 00:00:00'),
	(342, '', '7월 미술치료-색깔, 글자 맞추기', '각 단어와 단어의 색깔이 일치하는지 하지 않는지를 구분해 내는 프로그램으로 중간 중간 헷갈려 하는 부분은 부분 보조하였으며 대부분 적극적인 참여 모습을 보이며 즐겁게 대화 나누셨습니다.', 'img_202007171637571DkpSeatZL.JPEG', 'N', 'N', 0, 'admin', '2020-07-17 07:39:56', '0000-00-00 00:00:00'),
	(343, '', '7월 놀이치료-동물 그림 맞추기', '동물 그림을 보고 동물의 이름을 찾는 프로그램으로 어르신들께 쉽고 재미있게 한글과 그림을 익힐 수 있도록 도움을 드렸습니다.', 'img_20200717164018kPx1h0fapH.JPEG', 'N', 'N', 0, 'admin', '2020-07-17 07:40:52', '0000-00-00 00:00:00'),
	(344, '', '7월 미술치료-물고기 종이접기', '어르신들께서 모두 물고기 종이접기 프로그램에 관심을 보이며 적극적인 참여 모습을 보이셨고 마지막까지 어렵지 않게 잘 따라 접고 다 완성된 작품을 보며 예쁘다고 만족해 하는 모습을 볼 수 있었습니다.', 'img_20200717164114953NCqOJAL.JPEG', 'N', 'N', 0, 'admin', '2020-07-17 07:47:32', '0000-00-00 00:00:00'),
	(345, '', '7월 환자 낙상예방교육-6층', '인지저하 어르신들 대상으로 주기적이고 반복적으로 낙상예방 교육을 실시하여 낙상사고를 줄일 수 있도록 도움을 드렸습니다.', 'img_20200717164818IBjRm2DEJS.JPEG', 'N', 'N', 1, 'admin', '2020-07-17 07:48:55', '0000-00-00 00:00:00'),
	(346, '', '7월 미술치료-숫자별 색칠하기', '숫자가 적힌 도안에 숫자에 맞는 색으로 색칠하는 프로그램으로 어르신들께서 어렵지 않게 잘 따라 하셨고 프로그램이 끝난 후 공부도 되고 재미도 있고 예쁘고 좋다며 만족해 하셨습니다.', 'img_20200717164916rfcN178n04.JPEG', 'N', 'N', 0, 'admin', '2020-07-17 07:50:21', '0000-00-00 00:00:00'),
	(347, '', '7월 인지치료-한글쓰기', '한글 문장이 적힌 교안을 따라 쓰는 프로그램으로 어르신들 인지의 잔존 기능을 유지시켜 드리도록 도움을 드렸습니다.', 'img_20200717165041z38vThNtB4.JPEG', 'N', 'N', 0, 'admin', '2020-07-17 07:51:13', '0000-00-00 00:00:00'),
	(348, '', '7월 미술치료-과일 색칠하기', '어르신들께서 과일 색칠하기 도안을 보여 드리니 너무 예쁘다며 관심을 보이며 적극적인 참여 모습을 보이셨고 마지막까지 집중하여 예쁘게 색칠하셨고 중간 중간 과일과 관련된 대화도 많이 나누며 즐겁게 참여 하셨습니다.', 'img_20200717165129zlK0uY51HD.JPEG', 'N', 'N', 0, 'admin', '2020-07-17 07:52:31', '0000-00-00 00:00:00'),
