	(350, '', '7월 환자 낙상예방교육-4층', '인지저하 어르신들 대상으로 주기적이고 반복적으로 낙상예방 교육을 실시하여 낙상사고를 줄일 수 있도록 도움을 드렸습니다.', 'img_202008061556425PthUK64Yo.JPEG', 'N', 'N', 1, 'admin', '2020-08-06 06:56:46', '0000-00-00 00:00:00'),
