	(352, '', '7월 인지치료-화투 그림 맞추기', '어르신들께서 모두 예전에 화투를 쳐보셨던 기억을 떠올리며 화투의 짝을 잘 맞추셨고 과거 회상하며 대화도 많이 나누며 즐겁게 참여 하셨습니다.', 'img_20200806155843N7TVLB4Ofm.JPEG', 'N', 'N', 0, 'admin', '2020-08-06 06:59:11', '0000-00-00 00:00:00'),
