	(401, '', '11월 낙상예방교육-6층', '인지저하 어르신들 대상으로 주기적이고 반복적으로 낙상예방 교육을 실시하여 낙상사고를 줄일 수 있도록 도움을 드렸습니다.', 'img_202011161440402Bt0pmY8gK.JPEG', 'N', 'N', 3, 'admin', '2020-11-16 05:41:18', '0000-00-00 00:00:00'),
	(402, '', '11월 인지치료-과거 회상(옛 물건)', '옛날에 어르신들께서 많이 사용하셨던 물건들의 그림을 보며 과거 회상하며 대화를 나누는 프로그램으로 어르신들께서 옛 추억을 떠올리며 많은 대화를 나누셨고 기억력을 유지시켜 드리고 공감대를 형성하여 서로 소통할 수 있는 시간이 되었습니다.', 'img_20201116144148wtC3pVjY9K.JPEG', 'N', 'N', 0, 'admin', '2020-11-16 05:43:00', '0000-00-00 00:00:00'),
	(403, '', '11월 놀이치료-화투 그림 맞추기', '크게 인쇄된 화투의 그림을 보며 짝을 찾는 프로그램으로 어르신들 인지의 잔존 기능을 유지시켜 드렸으며 어르신들께서 예전에 화투를 쳐보셨던 기억을 떠올리며 즐겁게 참여 하셨습니다.', 'img_20201116144315UPKWTzEIM2.JPEG', 'N', 'N', 0, 'admin', '2020-11-16 05:44:24', '0000-00-00 00:00:00'),
	(404, '', '11월 미술치료-색연필 스텐실', '스텐실 도안을 이용하여 색연필로 예쁘게 그리고 색칠하는 프로그램으로 어르신들의 소근육 발달 및 감각 발달을 도와 드렸으며 어르신들께서 손쉽게 그림이 완성되니 즐거워 하며 만족해 하는 모습을 볼 수 있었습니다.', 'img_20201116144513lMn13ruxqG.JPEG', 'N', 'N', 1, 'admin', '2020-11-16 05:47:04', '0000-00-00 00:00:00'),
	(405, '', '11월 인지치료-11월 달력 만들기', '11월과 관련된 그림을 예쁘게 색칠하고 날짜를 직접 기입하며 달력 만들기를 실시하였고 어르신들께서 손수 직접 만든 달력을 보며 더욱더 뿌듯해 하고 만족해 하는 모습을 보이셨습니다.', 'img_20201116144721fFgTu07KCS.JPEG', 'N', 'N', 0, 'admin', '2020-11-16 05:48:29', '0000-00-00 00:00:00'),
	(406, '', '11월 미술치료-잠자리 종이접기', '어르신들과 함께 잠자리 종이접기를 실시하였습니다. 어르신들 모두 어렵지 않게 색종이를 들고 종이접기를 따라 하셨고 다 완성된 작품을 보며 잠자리가 귀엽고 예쁘다며 즐겁게 대화 나누는 모습을 보이셨습니다.', 'img_20201116144842J1PbzMwLhq.JPEG', 'N', 'N', 0, 'admin', '2020-11-16 05:49:44', '0000-00-00 00:00:00'),
	(407, '', '11월 낙상예방교육-5층', '인지저하 어르신들 대상으로 주기적이고 반복적으로 낙상예방 교육을 실시하여 낙상사고를 줄일 수 있도록 도움을 드렸습니다.', 'img_20201203151225j8zlSgUWBZ.JPEG', 'N', 'N', 0, 'admin', '2020-12-03 06:12:29', '0000-00-00 00:00:00'),
	(408, '', '11월 인지치료-특정 글자 찾기', '여러가지 글자가 섞인 교안을 보고 지정해준 특정 글자를 찾는 프로그램으로 어르신들께 한글을 인지시켜 드리며 기억력을 유지시켜 드리고 인지의 잔존 기능을 유지시킬 수 있도록 도움을 드렸습니다.', 'img_20201203151254A3dqfC5Xvy.JPEG', 'N', 'N', 0, 'admin', '2020-12-03 06:13:35', '0000-00-00 00:00:00'),
	(409, '', '11월 미술치료-가을 풍경 색칠하기', '가을과 관련된 그림을 예쁘게 색칠하는 프로그램으로 어르신들께서 다른 프로그램에 비해 색칠하기 프로그램에는 참여도도 높고 만족도도 높은 모습을 볼 수 있었고 가을 그림과 관련된 대화도 많이 나누며 즐겁게 참여 하셨습니다.', 'img_20201203151356fsDd3W4MLR.JPEG', 'N', 'N', 0, 'admin', '2020-12-03 06:14:37', '0000-00-00 00:00:00'),
	(410, '', '11월 인지치료-숫자 이어 그리기', '차례대로 적힌 숫자를 연결하여 선을 긋고 그림이 완성되면 예쁘게 색칠하는 프로그램으로 어르신들 인지의 잔존 기능을 유지시켜 드리고 감각 발달 및 소근육 발달에도 도움을 드릴 수 있는 시간이 되었습니다.', 'img_20201203151454OGUlV2ATKI.JPEG', 'N', 'N', 0, 'admin', '2020-12-03 06:15:34', '0000-00-00 00:00:00'),
	(411, '', '11월 놀이치료-퍼즐 맞추기', '퍼즐그림을 맞추는 프로그램으로 어르신들께서 그냥 퍼즐 조각을 맞추기에는 다소 어려움을 보이시어 조각과 퍼즐판에 숫자를 적어 해당 숫자에 맞는 조각을 맞춰 넣을 수 있도록 도움을 드렸고  숫자를 적어 드리니 어르신들께서 어렵지 않게 잘 따라 하셨고 다 완성된 퍼즐을 보며 만족감, 성취감을 느끼는 모습을 보이셨습니다.', 'img_20201203151553RtplOm5GIq.JPEG', 'N', 'N', 0, 'admin', '2020-12-03 06:17:26', '0000-00-00 00:00:00'),
	(412, '', '11월 생신잔치', '11월 생신을 맞은 어르신들과 같은 병동 어르신들께서 다같이 한자리에 모여 맛있는 음식도 나눠 드시고 즐거운 시간을 보내었고 같은 병동 어르신들께서 서로 소통할 수 있는 시간이 되었습니다. (음식섭취시간 외에는 마스크 철저히 착용하여 진행하였습니다)', 'img_20201203152112ZkCGipFmsg.JPEG', 'N', 'N', 5, 'admin', '2020-12-03 06:20:15', '2020-12-03 15:21:15'),
	(413, '', '11월 생신잔치-5층', '11월 생신을 맞은 어르신들과 같은 병동 어르신들께서 다같이 한자리에 모여 맛있는 음식도 나눠 드시고 즐거운 시간을 보내었고 같은 병동 어르신들께서 서로 소통할 수 있는 시간이 되었습니다. (음식섭취시간 외에는 마스크 철저히 착용하여 진행하였습니다)', 'img_20201203152035b1ZDgF7Vip.JPEG', 'N', 'N', 2, 'admin', '2020-12-03 06:20:38', '0000-00-00 00:00:00'),
	(414, '', '12월 미술치료-12월 달력 만들기', '12월을 맞이하여 12월 달력 만들기를 실시하였습니다. 어르신들께서 직접 날짜도 써넣으시고 관련된 그림을 예쁘게 색칠하고 대화도 많이 나누며 즐겁게 참여 하셨고 다 완성된 달력을 보며 매달 이렇게 달력을 만들게 해주니 좋다며 만족해 하는 모습을 보이셨습니다.', 'img_202012031522242pw7qPdMfj.JPEG', 'N', 'N', 4, 'admin', '2020-12-03 06:23:53', '0000-00-00 00:00:00'),
	(415, '', '12월 인지치료-과거 회상(겨울 그림)', '겨울과 관련된 그림을 보여 드리니 어르신들께서 옛 추억을 떠올리며 과거 회상하는 모습을 보이셨고 평소 말씀을 잘 하지 않던 어르신들도 과거 회상 프로그램을 할때에는 대답도 잘 하시고 소통하는 모습을 보이셨습니다.', 'img_202012031524176bNFdDAJUV.JPEG', 'N', 'N', 4, 'admin', '2020-12-03 06:25:16', '0000-00-00 00:00:00'),
	(416, '', '12월 인지치료-동물카드 연결하기', '동물 그림이 반쪽씩 그려진 카드의 짝을 찾는 프로그램으로 어르신들께 한글과 동물을 인지시켜 드리며 인지의 잔존 기능을 유지시켜 드리고 기억력을 유지시키는데 도움을 드렸고 그림과 관련된 대화도 많이 나누며 즐겁게 참여 하셨습니다.', 'img_20201204153344u5MRryW4Gc.JPEG', 'N', 'N', 6, 'admin', '2020-12-04 06:34:50', '0000-00-00 00:00:00'),
