	(651, '', '4월 인지치료-퍼즐 맞추기', '어르신들께 퍼즐 맞추기 교구를 드리니 처음에는 어려워 하며 소극적인 참여 모습을 보이셨으나 퍼즐 조각을 하나하나 집어 드리며 설명 해드리니 이후에는 잘 따라 맞추셨고 퍼즐 맞추기를 통해 인지의 잔존 기능을 유지시키고 소근육 발달에도 도움을 드릴 수 있었습니다.', 'img_202205021121566RghkPcrf8.JPEG', 'N', 'N', 0, 'admin', '2022-05-02 02:24:25', '0000-00-00 00:00:00'),
	(652, '', '4월 미술치료-봄꽃 색칠하기', '꽃이 만개하는 봄을 맞이하여 봄꽃 색칠하기를 해보았습니다. 어르신들께서 예쁜 꽃 도안을 색칠하며 밖에서 못보는 꽃을 이렇게라도 보니 좋다며 즐겁게 참여 하셨고 다완성된 그림을 보며 만족해 하는 모습을 보이셨습니다.', 'img_20220502112541vPIGdnZijm.JPEG', 'N', 'N', 0, 'admin', '2022-05-02 02:26:44', '0000-00-00 00:00:00'),
	(653, '', '4월 여가활동-네일아트', '어르신들께서 직접 좋아하는 색의 네일을 고르고 발라 드리니 예쁘다며 만족해 하셨고 이렇게라도 꾸미니 기분전화도 되고 너무 좋다며 즐거워 하는 모습을 보이셨습니다.', 'img_20220502112804Inrm5QpfTv.JPEG', 'N', 'N', 0, 'admin', '2022-05-02 02:29:10', '0000-00-00 00:00:00'),
	(654, '', '4월 놀이치료-동물그림카드 맞추기', '어르신들께 동물의 반쪽이 그려진 그림 카드를 드리고 나머지 반쪽이 그려진 카드를 보여 드리며 짝을 찾는 프로그램으로 어르신들께서 재미있는 놀이처럼 단어와 그림을 인지하도록 하였습니다.', 'img_20220502112924I8G4xPwAQz.JPEG', 'N', 'N', 0, 'admin', '2022-05-02 02:32:58', '0000-00-00 00:00:00'),
	(655, '', '4월 미술치료-만다라 색칠하기', '만다라 색칠하기를 통해 감각 발달 및 정서적 안정감을 제공할 수 있는 시간이 되었고 어르신들께서 직접 좋아하는 색을 고르며 예쁘게 색칠하고 다완성된 그림을 보며 만족해 하는 모습을 볼 수 있었습니다.', 'img_20220502113322HtRhsTPNCV.JPEG', 'N', 'N', 0, 'admin', '2022-05-02 02:34:25', '0000-00-00 00:00:00'),
	(656, '', '4월 생신파티-각 병동', '코로나 확산으로 인해 어르신들 개별 침상에서 생신선물(양말)을 나눠 드리고 개별적으로 간식을 나눠 드려 드실 수 있도록 하였고 어르신들께서 고마워 하며 언어적, 비언어적으로 표현해주셨습니다.', 'img_202205021139018wYEPfubQT.JPEG', 'N', 'N', 3, 'admin', '2022-05-02 02:37:09', '2022-05-02 11:39:06'),
	(657, '', '5월 인지치료-과거 회상(옛 풍경)', '어르신들께 옛 풍경 그림을 보여 드리며 대화를 유도하는 과거 회상 프로그램을 통해 어르신들의 기억력을 유지시키고 대화를 나누며 정서적으로 교감을 나눌 수 있는 시간이 되었습니다.', 'img_20220512155038Z9F4B3gpyH.JPEG', 'N', 'N', 0, 'admin', '2022-05-12 06:51:42', '0000-00-00 00:00:00'),
	(658, '', '5월 미술치료-5월 달력 만들기', '어르신들께서 직접 5월 달력을 만드는 프로그램으로 빈칸에 숫자도 차례대로 써 넣으시고 그림도 예쁘게 색칠하며 달력을 마무리 하였고 다 완성된 달력을 보며 만족해 하는 모습을 보이셨습니다.', 'img_20220512155207O8eEafyxKm.JPEG', 'N', 'N', 0, 'admin', '2022-05-12 06:52:51', '0000-00-00 00:00:00'),
	(659, '', '5월 어버이날 행사-카네이션 달아 드리기', '5월8일 어버이날을 맞이하여 미리 각 병동 직원들이 모든 어르신들께 보호자를 대신하여 카네이션을 달아 드리며 어르신들께 어버이 은혜에 감사함을 전달 해드리고 서로 교감하며 정을 나눌 수 있는 시간이 되었고 어르신들께서 너무 좋아하는 모습을 보이셨습니다.', 'img_20220512155307TzUNwFclga.JPEG', 'N', 'N', 1, 'admin', '2022-05-12 06:55:37', '2022-05-12 15:56:34'),
	(660, '', '5월 미술치료-5월 달력 만들기', '어르신들께서 직즙 달력을 만들며 숫자도 인지하고 예쁜 그림을 색칠하며 소근육 발달도 도와드리고 직접 만든 달력을 보며 만족감을 느낄 수 있는 시간이었습니다.', 'img_2022052716095309UwLPtNpJ.JPEG', 'N', 'N', 0, 'admin', '2022-05-27 07:10:49', '0000-00-00 00:00:00'),
	(661, '', '5월 인지치료-퍼즐 맞추기', '퍼즐 맞추기를 통해 신체와 인지의 잔존 기능을 유지시킬 수 있고 퍼즐 조각을 맞추며 성취감도 느낄 수 있는 시간이 되었습니다.', 'img_20220527161058pWDESBKlRT.JPEG', 'N', 'N', 0, 'admin', '2022-05-27 07:12:59', '0000-00-00 00:00:00'),
	(662, '', '5월 미술치료-만다라 색칠하기', '만다라 색칠하기를 통해 감각 발달 및 정서적 안정감을 제공할 수 있는 시간이 되었고 어르신들께서 직접 좋아하는 색을 고르며 예쁘게 색칠하고 다완성된 그림을 보며 만족해 하는 모습을 볼 수 있었습니다.', 'img_20220527161314ocy6IZEiUv.JPEG', 'N', 'N', 0, 'admin', '2022-05-27 07:13:35', '0000-00-00 00:00:00'),
	(663, '', '5월 놀이치료-단어카드 맞추기', '어르신들과 알록달록 그림카드를 보며 그림의 단어를 맞추는 놀이로 놀이를 통해 즐겁게 그림과 단어를 인지할 수 있도록 도움을 드렸습니다.', 'img_20220527161508K1tFofan5q.JPEG', 'N', 'N', 0, 'admin', '2022-05-27 07:15:55', '0000-00-00 00:00:00'),
	(664, '', '5월 인지치료-덧셈뺄셈하기', '여러가지 숫자가 적힌 덧셈뺄셈을 하며 어르신들 인지의 잔존 기능을 유지시킬 수 있는 시간이 되었습니다.', 'img_202205271616025tphPY4S0g.JPEG', 'N', 'N', 0, 'admin', '2022-05-27 07:16:45', '0000-00-00 00:00:00'),
	(665, '', '5월 놀이치료-도형쌓기', '크기별로 나눠진 도형을 차례대로 쌓으며 소근육 발달 및 집중력을 키울 수 있는 시간이 되었고 도형탑 쌓기를 완성하신 후 성취감도 느낄 수 있는 시간이 되었습니다.', 'img_20220527161655EpZtwLeD5q.JPEG', 'N', 'N', 0, 'admin', '2022-05-27 07:17:47', '0000-00-00 00:00:00'),
	(666, '', '5월 인지치료-같은 단어 찾기', '비슷하게 적힌 단어들 사이에서 같은 단어들을 찾는 프로그램으로 어르신들의 집중력을 높이고 인지의 잔존 기능을 유지시킬 수 있도록 도움을 드렸습니다.', 'img_20220527161755jA8tRYfeyT.JPEG', 'N', 'N', 0, 'admin', '2022-05-27 07:18:34', '0000-00-00 00:00:00'),
	(667, '', '5월 미술치료-꽃 화병 색칠하기', '예쁜 꽃 화병을 색칠하며 어르신들의 감각 발달 및 소근육 발달에도 도움을 드렸고 다 완성된 그림을 보며 모두 예쁘다고 만족감을 표하셨습니다.', 'img_202205271618515Tqem7g4fN.JPEG', 'N', 'N', 0, 'admin', '2022-05-27 07:19:30', '0000-00-00 00:00:00'),
	(668, '', '5월 생신잔치 (5/26,5/27,5/30,5/31)', '각 병동별 5월 생신을 맞이한 어르신들께 직접 찾아가 생신선물(양말)을 전달하고 축하해드렸으며 코로나로 인해 각자 개별 자리로 찾아가 음식도 나눠드리고 축하해드리는 시간을 가졌습니다.', 'img_2022060314340225UJOQuhE8.JPEG', 'N', 'N', 1, 'admin', '2022-06-03 05:33:11', '2022-06-03 14:34:10'),
	(669, '', '6월 미술치료-6월 달력 만들기', '어르신들께서 달력 만들기 프로그램에는 항상 적극적인 참여 모습을 보이셨고 직접 숫자를 쓰고 그림을 색칠하며 달력을 완성함으로 어르신들 소근육 발달 및 인지와 신체의 잔존 기능을 유지시키는데 도움을 드렸고 완성된 달력을 보며 만족감을 보이셨습니다.', 'img_202206031435407z8WeSa0Ns.JPEG', 'N', 'N', 0, 'admin', '2022-06-03 05:37:01', '0000-00-00 00:00:00'),
	(670, '', '6월 인지치료-과거회상 (옛물건)', '옛날에 사용하였던 물건의 그림을 보며 편하게 대화 나누는 프로그램으로 어르신들께서 과거 회상하며 옛 추억을 떠올려 즐겁게 대화 나누는 모습을 볼 수 있었습니다.', 'img_20220628142619KYh0Xx9glu.JPEG', 'N', 'N', 0, 'admin', '2022-06-28 05:27:02', '0000-00-00 00:00:00'),
	(671, '', '6월 놀이치료-화투 그림 맞추기', '어르신들과 함께 확대된 화투의 그림을 맞추는 시간을 가져 보았습니다. 어르신들께서 예전에 다들 한번쯤 화투를 쳐보셔서 어렵지 않게 잘 따라 하셨고 어렵지 않게 짝을 맞추며 기억력 유지 및 인지의 잔존 기능을 유지킬 수 있는 시간이 되었습니다.', 'img_20220628142718BhIxcMHJVZ.JPEG', 'N', 'N', 0, 'admin', '2022-06-28 05:28:47', '0000-00-00 00:00:00'),
	(672, '', '6월 인지치료-한글쓰기', '여러가지 단어가 적힌 글을 따라 쓰며  어르신들의 인지 및 신체의 잔존기능을 유지시킬 수 있도록 도움을 드렸습니다.', 'img_20220628142912lVCsc9q6j4.JPEG', 'N', 'N', 2, 'admin', '2022-06-28 05:37:29', '0000-00-00 00:00:00'),
	(673, '', '6월 인지치료-점선 따라 그리기', '점선으로 그려진 도형을 따라 그리는 프로그램으로 어르신들께서 어렵지 않게 잘 따라 하셨고 중간 중간 부분 보조 해드리며 같이 실시하였습니다.', 'img_20220628143742ymvVbCSIls.JPEG', 'N', 'N', 0, 'admin', '2022-06-28 05:39:46', '0000-00-00 00:00:00'),
	(674, '', '6월 미술치료-만다라 색칠하기', '만다라 색칠하기를 통해 감각 발달 및 정서적 안정감을 제공할 수 있는 시간이 되었고 어르신들께서 직접 좋아하는 색을 고르며 예쁘게 색칠하고 다완성된 그림을 보며 만족해 하는 모습을 볼 수 있었습니다.', 'img_20220628143950isCgYWXDIb.JPEG', 'N', 'N', 0, 'admin', '2022-06-28 05:40:03', '0000-00-00 00:00:00'),
	(675, '', '6월 인지치료-끝말잇기', '단어를 하나하나 적으며 끝말을 이어가는 끝말잇기 프로그램에 어르신들께서 처음에는 다시 어려워 하며 소극적인 참여 모습을 보이셨으나 방법을 터득하신 후에는 어렵지 않게 잘 따라 하셨고 어르신들께서 단어를 생각하고 적으며 인지기능을 유지시킬 수 있는 시간이 되었습니다.', 'img_20220628144009TlnG5LBAEK.JPEG', 'N', 'N', 0, 'admin', '2022-06-28 05:41:38', '0000-00-00 00:00:00'),
	(676, '', '6월 미술치료-꽃,나비 색칠하기', '여러가지 꽃과 나비가 그려진 도안을 색칠하는 프로그램으로 어르신들께서 모두 그림에 관심을 보이며 적극적인 참여 모습을 보이셨고 마지막까지 집중하여 색칠하기를 마무리 하는 모습을 볼 수 있었고 완성되 그림을 보며 예쁘다며 만족해 하는 모습을 볼 수 있었습니다.', 'img_20220628144153minXN0KZ2c.JPEG', 'N', 'N', 0, 'admin', '2022-06-28 05:43:09', '0000-00-00 00:00:00'),
	(677, '', '6월 인지치료-퍼즐 맞추기', '퍼즐의 조각을 맞추며 어르신들 소근육 발달 및 인지의 잔존 기능을 유지시킬 수 있는 시간이 되었고 퍼즐 조각이 많은 어려운 퍼즐은 부분 보조하여 같이 마무리 하였습니다.', 'img_20220628144317TkHvXZ0WsF.JPEG', 'N', 'N', 1, 'admin', '2022-06-28 05:44:26', '0000-00-00 00:00:00'),
	(678, '', '6월 미술치료-토끼 그림 색칠하기', '어르신께 색칠하기 도안을 보여 드리니 모두 귀엽고 예쁘다며 토끼에 관심을 보이며 적극적인 참여 모습을 보이셨고 이후 마지막까지 집중하여 예쁘게 색칠하는 모습을 볼 수 있었습니다.', 'img_20220628144434pfH3FcrBYe.JPEG', 'N', 'N', 1, 'admin', '2022-06-28 05:45:30', '0000-00-00 00:00:00'),
	(679, '', '6월 생신잔치', '6월 생신을 맞은 어르신들을 개인별로 찾아가 축하 해드리며 맛있는 음식과 선물(양말)을 나눠 드렸고 소통이 어려운 전신 와상 어르신들께는 개인 사물함에 놓아 드렸으며 어르신들께서 언어적, 비언어적으로 고맙다고 표현해주시는 모습을 볼 수 있었으며 서로 대화도 많이 나누며 즐거운 시간이 되었습니다.', 'img_20220704145905MgPr6mxGnb.JPEG', 'N', 'N', 3, 'admin', '2022-07-04 05:59:19', '0000-00-00 00:00:00'),
	(680, '', '7월 미술치료 - 달력만들기', '어르신들께서 직접 좋아하는 색을 골라 빈칸에 숫자를 써넣고 그림을 예쁘게 색칠하며 달력을 만드셨고 대부분의 어르신들께서 음력도 표기해주길 원하여 이번달부터는 음력날도 표기 해드리니 너무 좋아하며 만족해 하는 모습을 보이셨습니다.', 'img_20220707144356zm94XyqFBG.JPEG', 'N', 'N', 0, 'admin', '2022-07-07 05:45:33', '0000-00-00 00:00:00'),
	(681, '', '7월 인지치료 - 과거 회상(옛 여름 풍경)', '바다, 옛 원두막 수박 사진, 옛 아이스크림 사진 등 옛날 여름 풍경 그림을 보여 드리며 그림과 관련된 대화를 유도 해드리니  어르신들께서 옛 추억을 떠올리며 평소 말씀을 잘 하지 않던 어르신도 대화를 많이 나누며 즐거워 하는 모습을 보이셨습니다.', 'img_20220707144600szCb21H7uM.JPEG', 'N', 'N', 0, 'admin', '2022-07-07 05:47:18', '0000-00-00 00:00:00'),
	(682, '', '7월 인지치료  - 퍼즐 맞추기', '퍼즐 맞추기 교구를 드리니 조각이 적은 쉬운 퍼즐은 스스로 잘 맞추셨고 조각이 많은 퍼즐은 중간 중간 부분 보조 해드리며 같이 맞추기를 실시하였고 퍼즐을 다 맞추실때마다 어르신들께서 성취감을 느끼며 박수를 치고 즐거워 하는 모습도 볼 수 있었습니다.', 'img_2022070714473297lYwfqPXB.JPEG', 'N', 'N', 1, 'admin', '2022-07-07 05:48:26', '0000-00-00 00:00:00'),
	(683, '', '7월 놀이치료-풍선배구', '풍선을 이용하여 배구처럼 치고 흔들며 어르신들의 신체활동을 유도하는 프로그램으로 침상에서 무료한 시간을 많이 보내는 어르신들께 조금이나마 활력을 드리고 신체활동을 유도하여 신체의 잔존 기능을 유지시키도록 도움을 드렸습니다.', 'img_20220715112425ikKrsOTn9R.JPEG', 'N', 'N', 0, 'admin', '2022-07-15 02:25:36', '0000-00-00 00:00:00'),
	(684, '', '7월 미술치료-점선 따라 그리기', '점선을 따라 그림을 그리고 색칠을 하는 프로그램으로 어르신들의 소근육 발달 및 집중력을 유지시킬 수 있도록 도움을 드렸습니다.', 'img_20220715112558Oixe0M1Kc5.JPEG', 'N', 'N', 0, 'admin', '2022-07-15 02:26:54', '0000-00-00 00:00:00'),
	(685, '', '7월 미술치료-바다 그림 색칠하기', '여름과 관련된 바다를 떠올리며 바닷속 동물들을 예쁘게 색칠하는 시간을 가져 보았습니다. 어르신들께서 아기자기한 그림을 보며 예쁘다고 만족해 하는 모습을 볼 수 있었습니다.', 'img_20220715112711oZE10uznbr.JPEG', 'N', 'N', 0, 'admin', '2022-07-15 02:27:52', '0000-00-00 00:00:00'),
	(686, '', '7월 여가활동-네일아트', '어르신들의 손톱이 많이 자라고 발라 놓은 매니큐어가 벗겨져  매니큐어를 다시 예쁘게 발라 드렸고 무료한 침상생활에 조금이나마 즐거움과 활력을 드릴 수 있는 시간이 되었습니다.', 'img_20220715112828HXQtN689KS.JPEG', 'N', 'N', 0, 'admin', '2022-07-15 02:28:32', '0000-00-00 00:00:00'),
	(687, '', '7월 인지치료-끝말잇기', '끝말잇기를 방법을 설명 드리고 천천히 단어를 생각하고 적으며 인지의 잔존 기능을 유지시킬 수 있도록 도움을 드렸고 단어와 관련된 대화도 많이 나누며 즐거운 시간을 보냈습니다.', 'img_20220715112837fp2qheK5iZ.JPEG', 'N', 'N', 0, 'admin', '2022-07-15 02:29:25', '0000-00-00 00:00:00'),
	(688, '', '7월 미술치료-점선 따라 그리기', '점선을 따라 선을 그어 밑그림을 완성시킨 후 알록달록 예쁘게 색칠하는 프로그램으로 어르신들의 소근육 발달 및 감각 발달에 도움을 드릴 수 있는 시간이 되었습니다.', 'img_20220808103655Mi5QVE8BSj.JPEG', 'N', 'N', 0, 'admin', '2022-08-08 01:38:57', '0000-00-00 00:00:00'),
	(689, '', '7월 인지치료-퍼즐 맞추기', '퍼즐의 조각을 맞추며 어르신들 소근육 발달 및 인지의 잔존 기능을 유지시킬 수 있는 시간이 되었고 퍼즐 조각이 많은 어려운 퍼즐은 부분 보조하여 같이 마무리 하였습니다.', 'img_20220808103920Iq9SKiZ3mF.JPEG', 'N', 'N', 2, 'admin', '2022-08-08 01:39:35', '0000-00-00 00:00:00'),
	(690, '', '7월 인지치료-같은 글자 찾기', '여러개의 비슷한 단어들이 섞여있는 도안을 보며 같은 글자들을 찾는 프로그램으로 어르신들의 기억력 유지 및 인지의 잔존 기능을 유지시킬 수 있도록 도움을 드렸으며 처음에는 다소 어려워 하시어 중간 중간 부분 보조하여 마무리 하였습니다.', 'img_20220808104003v0Z7dcr5mt.JPEG', 'N', 'N', 0, 'admin', '2022-08-08 01:40:56', '0000-00-00 00:00:00'),
	(691, '', '7월 놀이치료-화투 그림 맞추기', '화투 그림을 확대하여 만든 카드를 보며 화투의 짝을 찾는 프로그램으로 어르신들께서 예전에 화투를 쳐보았던 기억을 떠올리며 아주 즐겁게 참여 하셨고 대부분 스스로 짝을 잘 찾으며 관련된 대화도 많이 나누며 즐겁게 마무리 하였습니다.', 'img_20220808104125xw9mZyIARl.JPEG', 'N', 'N', 0, 'admin', '2022-08-08 01:42:14', '0000-00-00 00:00:00'),
	(692, '', '7월 생신파티 (7/28-4,6w ~ 7/29-3,5w)', '7월 생신을 맞은 어르신들을 개인별로 찾아가 축하 해드리며 맛있는 음식과 선물(양말)을 나눠 드렸고 소통이 어려운 전신 와상 어르신들께는 개인 사물함에 놓아 드렸으며 어르신들께서 언어적, 비언어적으로 고맙다고 표현해주시는 모습을 볼 수 있었으며 서로 대화도 많이 나누며 즐거운 시간이 되었습니다.', 'img_20220808105200yK2gJrOHD4.JPEG', 'N', 'N', 2, 'admin', '2022-08-08 01:52:09', '0000-00-00 00:00:00'),
	(693, '', '8월 미술치료-8월 달력 만들기', '8월 달력 만들기를 통해 어르신들께 숫자, 날짜를 인지시켜 드리고 그림도 예쁘게 색칠하였고, 직접 만든 달력을 보며 모두 만족해 하는 모습을 보이셨습니다.', 'img_20220808105429olwzAc2TR4.JPEG', 'N', 'N', 0, 'admin', '2022-08-08 01:55:38', '0000-00-00 00:00:00'),
	(694, '', '8월 인지치료-단어카드 맞추기', '그림을 보며 이름을 맞추는 단어카드 맞추기 프로그램에 어르신들께서 모두 관심을 보이며 적극적인 참여 모습을 보이셨고 그림과 관련된 대화도 나누며 즐겁게 한글을 인지시켜 드리고 기억력 유지에도 도움을 드릴 수 있는 시간이 되었습니다.', 'img_20220808113031XBNW5aYrpC.JPEG', 'N', 'N', 1, 'admin', '2022-08-08 02:31:45', '0000-00-00 00:00:00'),
	(695, '', '8월 미술치료-8월 달력 만들기', '어르신들께서 직접 8월과 관련된 그림도 색칠하고 빈칸에 날짜를 써넣으며 본인만의 스타일로 달력을 만드셨고 달력 만들기를 통해 날짜와 요일, 숫자를 인지시켜 드리며 자연스럽게 인지기능을 유지시켜 드릴 수 있는 시간이 되었습니다.', 'img_20220817152933GRsY3EmPKJ.JPEG', 'N', 'N', 0, 'admin', '2022-08-17 06:29:36', '0000-00-00 00:00:00'),
	(696, '', '8월 인지치료-끝말잇기', '어르신들께서 끝말잇기 프로그램을 통해 단어를 생각하고 적으며 인지의 잔존 기능을 유지시키고 기억력을 유지시킬 수 있는 시간이 되었으며, 단어와 관련된 대화도 많이 나누며 즐겁게 참여 하셨습니다.', 'img_20220817153038YCwJl3Hd5N.JPEG', 'N', 'N', 0, 'admin', '2022-08-17 06:30:41', '0000-00-00 00:00:00'),
	(697, '', '8월 여가활동-네일아트', '어르신들의 손톱이 많이 자라고 발라 놓은 매니큐어가 벗겨져  매니큐어를 다시 예쁘게 발라 드렸으며, 무료한 병동생활에 잠시나마 활력을 드리고 기분전환이 될 수 있는 시간이 되었습니다.', 'img_20220817153243TbxlqOw920.JPEG', 'N', 'N', 0, 'admin', '2022-08-17 06:32:46', '0000-00-00 00:00:00'),
	(698, '', '8월 놀이치료-도형쌓기', '크기별로 나눠진 도형을 차례대로 쌓으며 소근육 발달 및 집중력을 키울 수 있는 시간이 되었고 도형탑 쌓기를 완성하신 후 성취감도 느낄 수 있는 시간이 되었습니다.', 'img_20220817153315vEzLGdh78e.JPEG', 'N', 'N', 0, 'admin', '2022-08-17 06:33:18', '0000-00-00 00:00:00'),
	(699, '', '8월 놀이치료-고리 던지기', '고리던지기 프로그램을 통해 침상에서 생활하는 시간이 많은 어르신들에게 잠시나마 신체활동을 유도하고 활력을 드릴 수 있는 시간이 되었으며, 링이 고리에 들어갈때마다 어르신들께서 기뻐하며 성취감을 느끼는 모습을 볼 수 있었습니다.', 'img_202208171534573AZouwhi7c.JPEG', 'N', 'N', 0, 'admin', '2022-08-17 06:35:00', '0000-00-00 00:00:00'),
	(700, '', '8월 미술치료-만다라 색칠하기', '만다라 색칠하기를 통해 어르신들에게 정서적 안정감을 제공하고, 소근육 발달 및 감각 발달에도 도움을 드릴 수 있는 시간이 되었고, 다 완성된 그림을 보며 모두 예쁘다고 좋아하며 만족해 하는 모습을 보이셨습니다.족해 ', 'img_20220817153738nkIqO43CFo.JPEG', 'N', 'N', 0, 'admin', '2022-08-17 06:37:41', '0000-00-00 00:00:00'),
	(701, '', '8월 미술치료-물고기 종이접기', '색종이로 물고기를 예쁘게 접어보는 시간을 가져보았습니다. 접는 방법이 아주 쉬워 어르신들께서 대부분 어렵지 않게 잘 따라 접으셨고 다 완성된 작품을 보며 스스로 종이접기를 해냈다는 만족감과 성취감을 느끼며 즐거워 하는 모습을 보이셨습니다.', 'img_20220831155438Vt7EKlwXdH.JPEG', 'N', 'N', 0, 'admin', '2022-08-31 06:55:55', '0000-00-00 00:00:00'),
	(702, '', '8월 인지치료-퍼즐 맞추기', '퍼즐 맞추기 교구를 드리니 조각이 적은 쉬운 퍼즐은 스스로 잘 맞추셨고 조각이 많은 퍼즐은 중간 중간 부분 보조 해드리며 같이 맞추기를 실시하였고 퍼즐을 다 맞추실때마다 어르신들께서 성취감을 느끼며 박수를 치고 즐거워 하는 모습도 볼 수 있었습니다.', 'img_20220831155610YTk3uSZOi5.JPEG', 'N', 'N', 3, 'admin', '2022-08-31 06:56:34', '0000-00-00 00:00:00'),
	(703, '', '8월 미술치료-동물 그림 색칠하기', '예쁜 동물이 그려진 도안을 직접 골라 알록달록 예쁘게 색칠하였습니다. 색칠하기를 통해 어르신들의 소근육 발달 및 자기표현력을 향상 시킬 수 있는 시간이 되었습니다.', 'img_202208311558440yZgTblHra.JPEG', 'N', 'N', 0, 'admin', '2022-08-31 06:59:41', '0000-00-00 00:00:00'),
	(704, '', '8월 인지치료-퍼즐 맞추기', '퍼즐 조각을 맞추며 어르신들의 소근육 발달 및 인지기능을 유지시키고 퍼즐 조각이 하나하나 맞을때마다 기뻐하며 성취감도 보이며 즐겁게 참여 하셨습니다.', 'img_20220906163128I1lCscKiVD.JPEG', 'N', 'N', 0, 'admin', '2022-09-06 07:32:18', '0000-00-00 00:00:00'),
	(705, '', '9월 미술치료-9월 달력 만들기', '9월을 맞아 어르신들과 9월 달력 만들기를 진행하여 날짜를 직접 써보고, 그림을 완성하여 예쁜 달력을 만들었습니다. 9월은 추석이 있어 추석 그림을 보며 추석과 관련된 대화도 많이 나누며 즐겁게 참여 하셨습니다.', 'img_20220906163540zNuW1GcgJx.JPEG', 'N', 'N', 1, 'admin', '2022-09-06 07:36:42', '0000-00-00 00:00:00'),
	(706, '', '9월 놀이치료-도형쌓기', '도형을 크기별로 쌓으며 어르신들의 집중력을 유지시키고 소근육 발달에도 도움을 드릴 수 있는 시간이 되었고, 도형탑이 완성되니 어르신들께서 기뻐하며 성취감을 느끼는 모습도 보이셨습니다.', 'img_20220906163912e95MBoHsQS.JPEG', 'N', 'N', 1, 'admin', '2022-09-06 07:39:15', '0000-00-00 00:00:00'),
	(707, '', '9월 인지치료-과거 회상(추석 관련 그림)', '추석을 맞이하여 추석과 관련된 그림들을 보여 드리며 대화를 나누는 시간을 가져보았습니다. 어르신들께서 옛 추억을 떠올리며 차례상, 송편빚기, 명절놀이 등 즐겁게 대화 나누셨고 이렇게나마 얘기를 나누고 하니 명절기분이 난다며 즐거워 하는 모습을 볼 수 있었습니다.', 'img_20220908154941dUpnP9kwYu.JPEG', 'N', 'N', 1, 'admin', '2022-09-08 06:51:10', '0000-00-00 00:00:00'),
	(708, '', '9월 낙상예방교육', '지속적인 낙상예방교육을 통해 일상생활에서 발생할 수 있는 낙상을 예방하여 안전한 병동생활이 될 수 있도록 도움을 드렸습니다.', 'img_20220916153134OXba3op89f.JPEG', 'N', 'N', 0, 'admin', '2022-09-16 06:35:06', '0000-00-00 00:00:00'),
	(709, '', '9월 인지치료-끝말잇기', '끝말잇기를 방법을 설명 드리고 천천히 단어를 생각하고 적으며 인지의 잔존 기능을 유지시킬 수 있도록 도움을 드렸고 단어와 관련된 대화도 많이 나누며 즐거운 시간을 보냈습니다.', 'img_20220916153653sG2g1HWeOd.JPEG', 'N', 'N', 0, 'admin', '2022-09-16 06:37:05', '0000-00-00 00:00:00'),
	(710, '', '9월 놀이치료-화투그림 맞추기', '크게 확대된 화투 그림을 보며 짝을 맞추는 프로그램으로 어르신들께서 대부분 다 화투를 쳐보았던 기억을 떠올리며 스스로 짝도 잘 맞추고 대화도 많이 나누며 즐거워 하였습니다.', 'img_20220916153721ivWZYelfQD.JPEG', 'N', 'N', 0, 'admin', '2022-09-16 06:38:20', '0000-00-00 00:00:00'),
	(711, '', '9월 미술치료-점선 따라 그리기', '점선을 따라 그림을 그리고 색칠을 하는 프로그램으로 어르신들의 소근육 발달 및 집중력을 유지시킬 수 있도록 도움을 드렸습니다.', 'img_20220916153843KD4OMhUPub.JPEG', 'N', 'N', 0, 'admin', '2022-09-16 06:40:13', '0000-00-00 00:00:00'),
	(712, '', '9월 놀이치료-그림카드 맞추기', '그림과 단어카드의 짝을 맞추는 프로그램으로 어르신들께 단어를 인지시켜 드리며 기억력을 유지시켜 드릴 수 있는 시간이 되었습니다.', 'img_20220916154039vgcklWIRQ8.JPEG', 'N', 'N', 0, 'admin', '2022-09-16 06:41:49', '0000-00-00 00:00:00'),
	(713, '', '9월 인지치료-덧셈,뺄셈하기', '어르신들과 덧셈과 뺄셈, 곱셈과 나눗셈을 통해 인지저하를 예방하고 수식을 익히는 시간을 가졌습니다', 'img_20220928164353ilIp7uXYew.JPEG', 'N', 'Y', 1, 'admin', '2022-09-28 07:44:05', '0000-00-00 00:00:00'),
	(714, '', '9월 인지치료-덧셈,뺄셈하기', '어르신들과 덧셈과 뺄셈, 곱셈과 나눗셈을 통해 인지저하를 예방하고 수식을 익히는 시간을 가졌습니다', 'img_20221005145639U4tyEV8e0b.JPEG', 'N', 'N', 1, 'admin', '2022-10-05 05:57:00', '2022-10-05 14:58:30'),
	(715, '', '9월 미술치료-가을 그림 색칠하기', '가을과 관련된 그림인 허수아비를 색칠하며 어르신들 소근육 발달 및 감각 발달을 도와 드리고 그림과 관련된 대화도 많이 나누며 즐겁게 참여 하였습니다.', 'img_20221005145727lWVOZYp9MK.JPEG', 'N', 'N', 0, 'admin', '2022-10-05 05:58:07', '0000-00-00 00:00:00'),
	(716, '', '9월 인지치료-퍼즐 맞추기', '퍼즐 조각을 맞추며 어르신들의 소근육 발달 및 인지기능을 유지시키고 퍼즐 조각이 하나하나 맞을때마다 기뻐하며 성취감도 보이며 즐겁게 참여 하셨습니다.', 'img_20221005145854gQRblkAsZc.JPEG', 'N', 'N', 0, 'admin', '2022-10-05 05:59:08', '0000-00-00 00:00:00'),
	(717, '', '9월 미술치료-만다라 색칠하기', '만다라 색칠하기를 통해 감각 발달 및 정서적 안정감을 제공할 수 있는 시간이 되었고 어르신들께서 직접 좋아하는 색을 고르며 예쁘게 색칠하고 다완성된 그림을 보며 만족해 하는 모습을 볼 수 있었습니다.', 'img_20221005145921AzMHWfmqkN.JPEG', 'N', 'N', 0, 'admin', '2022-10-05 05:59:37', '0000-00-00 00:00:00'),
	(718, '', '9월 인지치료-숫자 이어 그리기', '숫자를 차례대로 연결하며 그림을 완성해가는 프로그램으로 어르신들께 숫자를 익혀 드리고 이어 그리기를 통해 소근육 발달도 도와 드릴 수 있는 시간이 되었습니다.', 'img_20221005150001yaHQPnUrkC.JPEG', 'N', 'N', 0, 'admin', '2022-10-05 06:01:01', '0000-00-00 00:00:00'),
	(719, '', '9월 놀이치료-그림 카드 맞추기', '그림과 단어카드의 짝을 맞추는 프로그램으로 어르신들께 단어를 인지시켜 드리며 기억력을 유지시켜 드릴 수 있는 시간이 되었습니다.', 'img_20221005150110fMtn0N2bHo.JPEG', 'N', 'N', 0, 'admin', '2022-10-05 06:01:32', '0000-00-00 00:00:00'),
	(720, '', '9월 생신파티', '9월 생신을 맞은 어르신들을 개인별로 찾아가 축하 해드리며 맛있는 음식과 선물(양말)을 나눠 드렸고 소통이 어려운 전신 와상 어르신들께는 개인 사물함에 놓아 드렸으며 어르신들께서 언어적, 비언어적으로 고맙다고 표현해주시는 모습을 볼 수 있었으며 서로 대화도 많이 나누며 즐거운 시간이 되었습니다.', 'img_20221005150507fID6X72El4.JPEG', 'N', 'N', 1, 'admin', '2022-10-05 06:05:13', '0000-00-00 00:00:00'),
	(721, '', '10월 낙상예방교육', '침상에서 생활하는 시간이 많은 어르신들께 낙상예방을 위해 알기 쉬운 그림자료를 보여 드리며 설명 해드렸고 낙상사고를 예방할 수 있도록 지속적으로 인지시켜 드리고 있습니다. ', 'img_20221005150745XdKenyNJvb.JPEG', 'N', 'N', 0, 'admin', '2022-10-05 06:07:53', '0000-00-00 00:00:00'),
	(722, '', '10월 미술치료-10월 달력 만들기', '달력만들기를 통해 어르신들께 날짜와 숫자를 지속적으로 인지시켜 드리며 기억력을 유지시켜 드리고 직접 만든 달력을 보며 만족해 하는 모습을 보이셨습니다.', 'img_20221005150843KzLFZWuhk7.JPEG', 'N', 'N', 0, 'admin', '2022-10-05 06:08:50', '0000-00-00 00:00:00'),
	(723, '', '10월 놀이치료-화투 그림 맞추기', '크게 만든 화투의 그림을 보며 짝을 찾는 프로그램으로 어르신들의 기억력을 유지시켜 드리고 화투그림을 통해 재미있게 숫자도 익히고 그림과 단어를 익힐 수 있도록 도움을 드릴 수 있는 시간이었습니다.', 'img_20221021152051JntyAOWRL0.JPEG', 'N', 'N', 0, 'admin', '2022-10-21 06:21:44', '0000-00-00 00:00:00'),
	(724, '', '10월 미술치료-다람쥐 그림 색칠하기', '가을을 맞이하여 다람쥐와 도토리가 그려진 그림을 색칠하는 시간을 가져보았습니다. 알록달록 어르신들께서 원하는 색의 색연필을 직접 고르고 색칠하며 어르신들의 소근육 발달 및 감각발달을 도와드릴 수 있는 시간이 되었고 그림과 관련된 대화도 많이 나누며 즐겁게 참여 하였습니다.', 'img_20221021152201lxLRfrSXZg.JPEG', 'N', 'N', 0, 'admin', '2022-10-21 06:22:59', '0000-00-00 00:00:00'),
	(725, '', '10월 인지치료-끝말잇기', '단어를 하나하나 적으며 끝말을 이어가는 끝말잇기 프로그램에 어르신들께서 처음에는 다시 어려워 하며 소극적인 참여 모습을 보이셨으나 방법을 터득하신 후에는 어렵지 않게 잘 따라 하셨고 어르신들께서 단어를 생각하고 적으며 인지기능을 유지시킬 수 있는 시간이 되었습니다.', 'img_20221021152314MDxSjY2yX4.JPEG', 'N', 'N', 0, 'admin', '2022-10-21 06:23:32', '0000-00-00 00:00:00'),
	(726, '', '10월 인지치료-퍼즐 맞추기', '어르신들께서 퍼즐 조각을 하나하나 맞춰가는 프로그램으로 어르신들 인지의 잔존 기능을 유지시켜 드리고 퍼즐이 완성될때마다 기뻐하며 성취감도 느낄 수 있는 시간이었습니다.', 'img_20221021152348jXq9GrI7mD.JPEG', 'N', 'N', 0, 'admin', '2022-10-21 06:24:58', '0000-00-00 00:00:00'),
	(727, '', '10월 놀이치료-풍선배구', '풍선으로 배구하듯 손으로 쳐보고 만져도 보는 프로그램으로 침상생활이 많은 어르신들께 조금이나마 신체활동을 유도하여 활력을 드릴 수있는 시간이 되었습니다.', 'img_202210211525462JeKZOMfPN.JPEG', 'N', 'N', 0, 'admin', '2022-10-21 06:25:50', '0000-00-00 00:00:00'),
	(728, '', '10월 놀이치료-동물 그림 카드 맞추기', '동물이 반반씩 그려진 카드를 드리며 짝을 찾도록 유도하는 프로그램으로 어르신들께서 동물 반쪽 그림을 유심히 보며 집중하여 맞추셨고 어르신들께 카드놀이를 통해 즐겁게 동물과 동물의 이름을 익혀드리고 기억력을 유지시킬 수 있도록 도움을 드렸습니다.', 'img_20221021152700riM3pkZBxv.JPEG', 'N', 'N', 0, 'admin', '2022-10-21 06:28:01', '0000-00-00 00:00:00'),
	(729, '', '10월 놀이치료-도형쌓기', '크기별로 나눠진 도형을 차례대로 쌓으며 소근육 발달 및 집중력을 키울 수 있는 시간이 되었고 도형탑 쌓기를 완성하신 후 성취감도 느낄 수 있는 시간이 되었습니다.', 'img_20221021153541SEOVIHwd21.JPEG', 'N', 'N', 1, 'admin', '2022-10-21 06:35:46', '0000-00-00 00:00:00'),
	(730, '', '10월 미술치료-오리 그림 색칠하기', '알을 낳는 오리 그림을 예쁘게 색칠하는 시간을 가져보았습니다. 어르신들께서 귀여운 그림에 관심을 보이며 적극적으로 참여 해주셨고 알록달록 원하는 색으로 예쁘게 색칠하며 대화도 많이 나누고 즐겁게 마무리 하였습니다.', 'img_20221102144048NICLPaqbJK.JPEG', 'N', 'N', 0, 'admin', '2022-11-02 05:41:50', '0000-00-00 00:00:00'),
	(731, '', '10월 인지치료-수 세어보기', '그림의 수를 세어 같은 숫자와 선을 연결하는 프로그램으로 어르신들 인지의 잔존 기능을 유지시켜 드리고 기억력을 유지시켜 드릴 수 있는 시간이 되었습니다.', 'img_20221102144206J4KMwUaRWm.JPEG', 'N', 'N', 0, 'admin', '2022-11-02 05:43:00', '0000-00-00 00:00:00'),
	(732, '', '10월 여가활동 - 네일아트', '어르신들의 손톱이 많이 자라고 발라 놓은 매니큐어가 벗겨져  매니큐어를 다시 예쁘게 발라드렸습니다~', 'img_202211021443210iEKfHauWL.JPEG', 'N', 'N', 0, 'admin', '2022-11-02 05:43:25', '0000-00-00 00:00:00'),
	(733, '', '10월 놀이치료-컵쌓기', '컵을 쌓아올려 탑을 쌓는 프로그램으로 어르신들 소근육 발달 및 집중력을 향상 시키도록 도움을 드렸고 탑이 완성될때 어르신들께서 기뻐하며 성취감을 느끼는 모습도 볼 수 있었습니다.', 'img_20221102144418VztyYIs47C.JPEG', 'N', 'N', 0, 'admin', '2022-11-02 05:44:21', '0000-00-00 00:00:00'),
	(734, '', '10월 생신잔치', '10월 생신을 맞이한 어르신들께 직접 양말을 선물로 전달 해드리고, 음식도 나눠 드리며 즐거운 시간이 되었으며 어르신들께서 언어적, 비언어적으로 고마움과 즐거움을 표현해주시는 모습을 볼 수 있었습니다.', 'img_20221102144736lLr3naDciy.JPEG', 'N', 'N', 0, 'admin', '2022-11-02 05:47:39', '0000-00-00 00:00:00'),
	(735, '', '11월 미술치료-11월 달력 만들기', '11월 달력을 직접 만드는 시간을 가져보았습니다. 빈칸에 날짜를 차례대로 써넣고 관련된 그림도 예쁘게 색칠하며 마무리 하였고, 직접 만든 달력을 보며 모두 만족해 하는 모습을 볼 수 있었습니다.', 'img_20221123161522r2TIzynW9H.JPEG', 'N', 'N', 0, 'admin', '2022-11-23 07:17:28', '0000-00-00 00:00:00'),
	(736, '', '11월 놀이치료-그림 카드 맞추기', '그림과 단어카드의 짝을 맞추는 프로그램으로 어르신들께 단어를 인지시켜 드리며 기억력을 유지시켜 드릴 수 있는 시간이 되었습니다.', 'img_20221123161753kJDQvFGteg.JPEG', 'N', 'N', 0, 'admin', '2022-11-23 07:18:03', '0000-00-00 00:00:00'),
	(737, '', '11월 미술치료-낙엽 나무 꾸미기', '나무가 그려진 도안에 낙엽을 하나하나 붙이며 가을 낙엽 나무를 완성하는 프로그램으로 어르신들께서 직접 낙엽을 붙이며 어르신들 소근육 발달 및 감각 발달을 도와드릴 수 있는 시간이 되었고, 완성된 나무 그림을 보며 가을이 온것 같다고 예쁘고 좋다며 만족해 하는 모습을 보이셨습니다.', 'img_20221123161820hpaGoIq95H.JPEG', 'N', 'N', 0, 'admin', '2022-11-23 07:20:19', '0000-00-00 00:00:00'),
