	(769, '', '1월 놀이치료-컵쌓기', '종이컵을 단계별로 쌓으며 어르신들의 소근육 발달 및 집중력을 향상시킬 수 있도록 도움을 드렸으며 마지막 컵이 쌓일때 어르신들께서 성취감을 느끼며 기뻐하는 모습을 볼 수 있었습니다.', 'img_20230118145933CluwYJSgNW.JPEG', 'N', 'N', 2, 'admin', '2023-01-18 05:59:37', '0000-00-00 00:00:00'),
