	(771, '', '1월 미술치료-한복 색칠하기', '다가올 설날을 맞이하여 한복을 예쁘게 색칠하는 시간을 가져보았습니다. 한복을 색칠하며 설날과 관련된 대화도 많이 나누고 즐겁게 마무리 하였으며 색칠하기를 통해 어르신들의 감각을 자극시키고 소근육 발달에도 도움을 드릴 수 있는 시간이 되었습니다.', 'img_202301181500572jaA3Rudpg.JPEG', 'N', 'N', 0, 'admin', '2023-01-18 06:02:39', '0000-00-00 00:00:00'),
	(772, '', '1월 낙상예방교육', '침상에서 생활하는 시간이 많은 어르신들께 낙상예방을 위해 알기 쉬운 그림자료를 보여 드리며 설명 해드렸고 낙상사고를 예방할 수 있도록 지속적으로 인지시켜 드리고 있습니다. ', 'img_20230118150327qiROc81xTD.JPEG', 'N', 'Y', 1, 'admin', '2023-01-18 06:03:51', '0000-00-00 00:00:00'),
	(773, '', '1월 낙상예방교육', '침상에서 생활하는 시간이 많은 어르신들께 낙상예방을 위해 알기 쉬운 그림자료를 보여 드리며 설명 해드렸고 낙상사고를 예방할 수 있도록 지속적으로 인지시켜 드리고 있습니다. ', 'img_20230118150428DG5qUOZjTS.JPEG', 'N', 'N', 0, 'admin', '2023-01-18 06:05:00', '0000-00-00 00:00:00'),
	(774, '', '1월 낙상예방교육', '침상에서 생활하는 시간이 많은 어르신들께 낙상예방을 위해 알기 쉬운 그림자료를 보여 드리며 설명 해드렸고 낙상사고를 예방할 수 있도록 지속적으로 인지시켜 드리고 있습니다. ', 'img_20230131150255X7PkDsnI0Y.JPEG', 'N', 'N', 0, 'admin', '2023-01-31 06:03:13', '0000-00-00 00:00:00'),
	(775, '', '1월 미술치료-복주머니 종이접기', '다가올 설날을 맞이하여 색종이로 복주머니를 예쁘게 접고 그림도 예쁘게 색칠하는 시간을 가져보았습니다. 직접 종이접기와 색칠하기를 하며 어르신들 소근육 발달에도 도움을 드리고 덕담도 나누며 즐거운 시간을 보내었습니다.', 'img_20230131150340sE7Y06nzRc.JPEG', 'N', 'N', 1, 'admin', '2023-01-31 06:04:35', '0000-00-00 00:00:00'),
	(776, '', '1월 놀이치료-풍선 배구', '풍선을 이용하여 배구처럼 치고 흔들며 어르신들의 신체활동을 유도하는 프로그램으로 침상에서 무료한 시간을 많이 보내는 어르신들께 조금이나마 활력을 드리고 신체활동을 유도하여 신체의 잔존 기능을 유지시키도록 도움을 드렸습니다.', 'img_20230131150516DHUsBmI6WE.JPEG', 'N', 'N', 1, 'admin', '2023-01-31 06:05:19', '0000-00-00 00:00:00'),
