	(779, '', '1월 놀이치료-도형 쌓기', '도형을 크기별로 쌓으며 어르신들의 집중력을 유지시키고 소근육 발달에도 도움을 드릴 수 있는 시간이 되었고, 도형탑이 완성되니 어르신들께서 기뻐하며 성취감을 느끼는 모습도 보이셨습니다.', 'img_20230131150630jJqmfK7vhT.JPEG', 'N', 'N', 0, 'admin', '2023-01-31 06:06:37', '0000-00-00 00:00:00'),
	(780, '', '1월 인지치료-미로 찾기', '시작점부터 도착점까지 길을 찾는 미로 찾기 프로그램을 통해 어르신들 인지의 잔존 기능을 유지시키고 집중력을 향상시킬 수 있는 시간이 되었습니다.', 'img_20230131151326L3fXTMq4BJ.JPEG', 'N', 'N', 0, 'admin', '2023-01-31 06:13:29', '0000-00-00 00:00:00'),
	(781, '', '1월 생신파티', '1월 생신을 맞이한 어르신들에게 직접 선물(양말)을 전달 해드리고, 맛있는 음식도 나눠 드리며 즐거운 시간을 보내며 축하 해드렸습니다.', 'img_20230210161716aX5oYVBA9e.JPEG', 'N', 'N', 0, 'admin', '2023-02-10 07:17:20', '0000-00-00 00:00:00'),
