	(784, '', '2월 놀이치료-그림 카드 맞추기', '그림을 보며 이름을 맞추는 단어카드 맞추기 프로그램에 어르신들께서 모두 관심을 보이며 적극적인 참여 모습을 보이셨고 그림과 관련된 대화도 나누며 즐겁게 한글을 인지시켜 드리고 기억력 유지에도 도움을 드릴 수 있는 시간이 되었습니다.', 'img_20230214161546ZQGmyDYvuR.JPEG', 'N', 'N', 1, 'admin', '2023-02-14 07:15:57', '0000-00-00 00:00:00'),
	(785, '', '2월 인지치료-수 세어보기', '빈칸에 차례대로 숫자를 써넣고 세어보는 시간을 가져보았습니다. 어르신들께서 천천히 차례대로 숫자를 적으며 인지의 잔존 기능을 유지시켜 드리고 집중력을 향상시킬 수 있는 시간이 되었습니다.', 'img_202302141616206mUfiTEDrx.JPEG', 'N', 'N', 0, 'admin', '2023-02-14 07:17:18', '0000-00-00 00:00:00'),
