	(798, '', '3월 인지치료-한글(단어,문장)쓰기', '그림을 보며 단어와 문장을 따라 쓰기를 실시하였습니다. 한글쓰기를 통해 어르신에게 지속적으로 한글을 인지시켜 드리고 기억력을 유지시켜 드릴 수 있도록 도움을 드렸습니다.', 'img_20230314160242ugXcQZPGkI.JPEG', 'N', 'N', 0, 'admin', '2023-03-14 07:03:47', '0000-00-00 00:00:00'),
	(799, '', '3월 낙상예방교육', '침상에서 생활하는 시간이 많은 어르신들께 낙상예방을 위해 알기 쉬운 그림자료를 보여 드리며 설명 해드렸고, 보행이 가능한 어르신들에게도 낙상위험을 알려드리고 예방법을 설명드려 낙상사고를 예방할 수 있도록 지속적으로 인지시켜 드리고 있습니다. ', 'img_20230314160407IBnR6omajq.JPEG', 'N', 'N', 0, 'admin', '2023-03-14 07:04:16', '0000-00-00 00:00:00'),
	(800, '', '3월 인지치료-퍼즐 맞추기', '퍼즐 조각을 맞추며 어르신들의 소근육 발달 및 인지기능을 유지시키고 퍼즐 조각이 하나하나 맞을때마다 기뻐하며 성취감도 보이며 즐겁게 참여 하셨습니다.', 'img_20230314160442qewg6YsTJK.JPEG', 'N', 'N', 0, 'admin', '2023-03-14 07:04:48', '0000-00-00 00:00:00'),
	(801, '', '3월 놀이치료-화투 그림 맞추기', '화투 그림을 확대하여 만든 카드를 보며 화투의 짝을 찾는 프로그램으로 어르신들께서 예전에 화투를 쳐보았던 기억을 떠올리며 아주 즐겁게 참여 하셨고 대부분 스스로 짝을 잘 찾으며 관련된 대화도 많이 나누며 즐겁게 마무리 하였습니다.', 'img_20230314160522g1cLrmpYeR.JPEG', 'N', 'N', 0, 'admin', '2023-03-14 07:05:24', '0000-00-00 00:00:00'),
	(802, '', '3월 인지치료-끝말잇기', '끝말잇기를 방법을 설명 드리고 천천히 단어를 생각하고 적으며 인지의 잔존 기능을 유지시킬 수 있도록 도움을 드렸고 단어와 관련된 대화도 많이 나누며 즐거운 시간을 보냈습니다.', 'img_20230314160542W8XoLglc2U.JPEG', 'N', 'N', 0, 'admin', '2023-03-14 07:05:49', '0000-00-00 00:00:00'),
	(803, '', '3월 미술치료-점선 따라 그리기', '점선을 따라 그림을 그리고 색칠을 하는 프로그램으로 어르신들의 소근육 발달 및 집중력을 유지시킬 수 있도록 도움을 드렸습니다.', 'img_202303141606127F8eCdltW2.JPEG', 'N', 'N', 0, 'admin', '2023-03-14 07:06:15', '0000-00-00 00:00:00'),
	(804, '', '3월 여가활동-네일아트', '어르신들의 손톱이 많이 자라고 발라 놓은 매니큐어가 벗겨져  매니큐어를 다시 예쁘게 발라드렸습니다~ 침상에서 무료한 시간을 많이 보내는 어르신들께 네일아트를 통해 기분전환도 시켜 드리고 자기 만족도도 높일 수 있는 시간이 되었습니다.', 'img_20230403115236x67iMrImL8.JPEG', 'N', 'N', 0, 'admin', '2023-04-03 02:52:40', '0000-00-00 00:00:00'),
	(805, '', '3월 미술치료-벚꽃 나무 만들기', '벚꽃이 피는 계절을 맞이하여 벚꽃 나무 만들기를 해보았습니다. 나뭇가지 그림 위에 직접 벚꽃을 풀로 붙이며 벚꽃나무를 완성하였고, 다 완성된 그림을 보며 이렇게 가까이서 벚꽃나무를 볼 수 있어서 너무 행복하다며 만족해 하는 모습을 볼 수 있었습니다.', 'img_20230403115258TBhClfqi4D.JPEG', 'N', 'N', 0, 'admin', '2023-04-03 02:54:08', '0000-00-00 00:00:00'),
	(806, '', '3월 놀이치료-도형쌓기', '도형을 크기별로 쌓으며 어르신들의 집중력을 유지시키고 소근육 발달에도 도움을 드릴 수 있는 시간이 되었고, 도형탑이 완성되니 어르신들께서 기뻐하며 성취감을 느끼는 모습도 보이셨습니다.', 'img_20230403115426B5oZgn8KRD.JPEG', 'N', 'N', 0, 'admin', '2023-04-03 02:54:30', '0000-00-00 00:00:00'),
	(807, '', '3월 인지치료-덧셈,뺄셈하기', '덧셈,뺄셈을 통해 어르신들에게 지속적으로 숫자를 인지시켜 드리고 계산법을 기억하며 인지의 잔존 기능을 유지시켜 드릴 수 있는 시간이 되었습니다.', 'img_20230403115442xTi6C4eR9L.JPEG', 'N', 'N', 0, 'admin', '2023-04-03 02:54:51', '0000-00-00 00:00:00'),
	(808, '', '3월 미술치료-만다라 색칠하기', '만다라 색칠하기를 통해 어르신들에게 정서적 안정감을 제공하고, 소근육 발달 및 감각 발달에도 도움을 드릴 수 있는 시간이 되었고, 다 완성된 그림을 보며 모두 예쁘다고 좋아하며 만족해 하는 모습을 보이셨습니다.족해 ', 'img_20230405153627EIePiJxDKX.JPEG', 'N', 'N', 0, 'admin', '2023-04-05 06:36:34', '0000-00-00 00:00:00'),
	(809, '', '3월 낙상예방교육', '침상에서 생활하는 시간이 많은 어르신들께 낙상예방을 위해 알기 쉬운 그림자료를 보여 드리며 설명 해드렸고 낙상사고를 예방할 수 있도록 지속적으로 인지시켜 드리고 있습니다. ', 'img_20230405153655f0JUjISL6m.JPEG', 'N', 'N', 0, 'admin', '2023-04-05 06:37:13', '0000-00-00 00:00:00'),
	(810, '', '3월 놀이치료-동물 그림 맞추기', '동물이 반반씩 그려진 카드를 드리며 짝을 찾도록 유도하는 프로그램으로 어르신들께서 동물 반쪽 그림을 유심히 보며 집중하여 맞추셨고 어르신들께 카드놀이를 통해 즐겁게 동물과 동물의 이름을 익혀드리고 기억력을 유지시킬 수 있도록 도움을 드렸습니다.', 'img_202304051538441ZbhoQznJr.JPEG', 'N', 'N', 0, 'admin', '2023-04-05 06:38:56', '0000-00-00 00:00:00'),
	(811, '', '3월 미술치료-꽃다발 색칠하기', '예쁜 꽃다발을 색칠하며 어르신들에게 정서적 안정감을 제공하고 소근육 발달에도 도움을 드릴 수 있는 시간이 되었고, 색칠하기를 하며 중간 중간 대화도 많이 나누며 즐겁게 참여하셨습니다.', 'img_20230405153917T6rs4FUJqD.JPEG', 'N', 'N', 0, 'admin', '2023-04-05 06:39:57', '0000-00-00 00:00:00'),
