	(822, '', '4월 인지치료-수 세어보기', '그림을 보며 갯수를 세어 빈칸에 알맞는 숫자를 적거나 숫자가 적힌것 중 답을 찾아 동그라미 치는 시간을 가져보았습니다. 수를 세며 어르신들에게 지속적으로 숫자와 계산법을 인지시켜 드리고 기억력을 유지시킬 수 있도록 도움을 드릴 수 있었습니다.', 'img_20230428141221fGMrNvu6CD.JPEG', 'N', 'N', 0, 'admin', '2023-04-28 05:13:28', '0000-00-00 00:00:00'),
	(823, '', '4월 미술치료-무지개 물고기 색칠하기', '물고기 그림을 무지개처럼 알록달록 예쁘게 색칠하는 시간을 가져보았습니다. 색칠하기를 통해 어르신들 소근육 발달에도 도움을 드리고 집중력을 향상시킬 수 있는 시간이 되었고 , 다 완성된 그림을 보며 예쁘다며 만족해 하는 모습도 볼 수 있었습니다.', 'img_20230428141339IgQaunKtM7.JPEG', 'N', 'N', 0, 'admin', '2023-04-28 05:14:55', '0000-00-00 00:00:00'),
	(824, '', '4월 생신파티-각 병동', '4월 생신을 맞이한 어르신들께 개별적으로 선물(양말)을 전달해드리고, 각 병동 어르신들에게 맛있는 음식도 나눠 드리며 즐거운 시간을 보내었습니다. 코로나로 인하여 선물 및 음식전달은 개별적으로 진행하였으며, 어르신들께서 언어적, 비언어적으로 고마움을 표현해 주셨습니다. ', 'img_20230428141511dNqn5O73rA.JPEG', 'N', 'N', 1, 'admin', '2023-04-28 05:16:47', '0000-00-00 00:00:00'),
