	(826, '', '5월 미술치료-5월 달력 만들기', '달력의 빈칸에 날짜도 차례대로 기입하고, 5월과 관련된 그림도 예쁘게 색칠하며 직접 5월 달력을 만드는 시간을 가져보았습니다. 스스로 직접 달력을 만들며 숫자와 날짜를 인지시켜 드리고 소근육 발달에도 도움을 드릴 수 있는 시간이 되었습니다.', 'img_202305121518156Hgp7cOVCD.JPEG', 'N', 'N', 1, 'admin', '2023-05-12 06:18:20', '0000-00-00 00:00:00'),
	(827, '', '5월 낙상예방교육', '침상에서 생활하는 시간이 많은 와상 어르신들, 보행은 가능하나 불안정한 보행 및 워커 보조로 낙상의 위험이 큰 어르신들에게 지속적으로 낙상의 위험을 알려 드리고 예방법을 설명 드리며 보다 안전한 병동생활이 될 수 있도록 도움을 드렸습니다.', 'img_20230512151918pzufETLXJ0.JPEG', 'N', 'N', 0, 'admin', '2023-05-12 06:19:25', '0000-00-00 00:00:00'),
	(828, '', '5월 인지치료-퍼즐 맞추기', '퍼즐 조각을 맞추며 어르신들 인지의 잔존 기능을 유지시켜 드릴 수 있었고, 조각이 많은 퍼즐은 부분 보조하여 같이 맞추기를 마무리 하였습니다.', 'img_20230512152039YEabKPloh3.JPEG', 'N', 'N', 0, 'admin', '2023-05-12 06:20:43', '0000-00-00 00:00:00'),
	(829, '', '5월 놀이치료-동물 그림 맞추기', '동물 그림 카드를 보며 해당하는 동물의 이름을 찾는 프로그램으로 어르신들에게 재미있게 한글과 동물을 인지시켜 드리고 기억력을 유지시켜 드릴 수 있는 시간이 되었습니다.', 'img_20230512152149sl2716NqQ0.JPEG', 'N', 'N', 0, 'admin', '2023-05-12 06:21:53', '0000-00-00 00:00:00'),
	(830, '', '5월 8일 어버이날 행사-1', '5월 8일 어버이날을 맞이하여 각 병동 어르신들에게 직원들이 카네이션을 달아 드리고 소정의 간식을 나눠 드리는 시간을 가져보았습니다. 자녀분들을 대신하여 직원들이 어버이 은혜에 감사하다는 인사도 전하며 어르신들과 즐겁고 행복한 어버이날을 보내었습니다.', 'img_20230512152322cXvpwjnJ6R.JPEG', 'N', 'N', 5, 'admin', '2023-05-12 06:23:33', '0000-00-00 00:00:00'),
	(831, '', '5월 8일 어버이날 행사 - (주)부산헬스케어 시니어 요양두유 후원', '5월 8일 어버이날을 맞이하여 (주)부산헬스케어에서 어르신들에게 시니어 요양두유를 후원 해주었습니다. 각 층 어르신들에게 간식과 함께 두유를 전달 해드리니 맛있게 드시며 행복한 어버이날을 보내었습니다.', 'img_20230512152345cAd9k8hDsm.JPEG', 'N', 'N', 5, 'admin', '2023-05-12 06:38:22', '0000-00-00 00:00:00'),
	(832, '', '5월 인지치료-과거 회상(여러가지 꽃 그림)', '여러가지 꽃 그림을 보며 대화를 나누는 시간을 가져보았습니다. 꽃과 관련된 대화를 나누며 옛 추억도 떠올리고 과거 회상하는 모습을 보이셨고 대화를 나누며 어르신들과 소통하고 정서적 교감을 나눌 수 있는 시간이 되었습니다.', 'img_20230523160213xP83upgmr7.JPEG', 'N', 'N', 0, 'admin', '2023-05-23 07:03:11', '0000-00-00 00:00:00'),
	(833, '', '5월 미술치료-점선 따라 그리기', '점선을 따라 밑그림을 그리고 예쁘게 색칠하는 프로그램으로 어르신들의 소근육 발달 및 집중력을 향상시킬 수 있는 시간이 되었습니다.', 'img_202305231603357qs5mnSTHQ.JPEG', 'N', 'N', 0, 'admin', '2023-05-23 07:04:25', '0000-00-00 00:00:00'),
	(834, '', '5월 낙상예방교육', '침상에서 생활하는 시간이 많은 와상 어르신들, 보행은 가능하나 불안정한 보행 및 워커 보조로 낙상의 위험이 큰 어르신들에게 지속적으로 낙상의 위험을 알려 드리고 예방법을 설명 드리며 보다 안전한 병동생활이 될 수 있도록 도움을 드렸습니다.', 'img_20230523160433m8diqsXC10.JPEG', 'N', 'N', 0, 'admin', '2023-05-23 07:04:43', '0000-00-00 00:00:00'),
	(835, '', '5월 인지치료-퍼즐 맞추기', '퍼즐 조각을 맞추며 어르신들 인지의 잔존 기능을 유지시켜 드릴 수 있었고, 조각이 많은 퍼즐은 부분 보조하여 같이 맞추기를 마무리 하였습니다.', 'img_20230523160457iv3TLYGhxP.JPEG', 'N', 'N', 0, 'admin', '2023-05-23 07:05:03', '0000-00-00 00:00:00'),
	(836, '', '5월 미술치료-장미 꽃다발 색칠하기', '5월 장미가 피는 계절을 맞이하여 장미 꽃다발을 색칠하는 시간을 가져보았습니다. 꽃을 예쁘게 색칠하며 어르신들과 대화도 많이 나누고 기분전환 하는 시간이 되었습니다.', 'img_20230523160542iC1ZtNj3nS.JPEG', 'N', 'N', 1, 'admin', '2023-05-23 07:06:30', '0000-00-00 00:00:00'),
	(837, '', '5월 낙상예방교육', '침상에서 생활하는 시간이 많은 와상 어르신들, 보행은 가능하나 불안정한 보행 및 워커 보조로 낙상의 위험이 큰 어르신들에게 지속적으로 낙상의 위험을 알려 드리고 예방법을 설명 드리며 보다 안전한 병동생활이 될 수 있도록 도움을 드렸습니다.', 'img_20230531165205OXYHgPoNwc.JPEG', 'N', 'N', 0, 'admin', '2023-05-31 07:52:28', '0000-00-00 00:00:00'),
	(838, '', '5월 인지치료-같은 글자 찾기', '비슷하나 조금씩 다르게 적힌 글자들을 보며 같은 글자를 찾는 프로그램으로 어르신들 집중력을 향상시켜 드리고 기억력을 유지시킬 수 있는 시간이 되었고 중간 중간 부분 보조 해드리며 같이 마무리 하였습니다.', 'img_202305311653198mbg6d1eZ2.JPEG', 'N', 'N', 0, 'admin', '2023-05-31 07:54:28', '0000-00-00 00:00:00'),
	(839, '', '5월 미술치료-강아지 그리고 색칠하기', '강이지 밑그림이 그려진 도안을 보며 따라 그리고 예쁘게 색칠하는 시간을 가져보았습니다. 어르신들께서 강아지 그림을 너무 귀여워 하며 즐겁게 대화도 많이 나누며 마무리 하셨고, 따라 그리기와 색칠하기를 통해 어르신들 소근육 발달에도 도움을 드릴 수 있는 시간이 되었습니다.', 'img_20230531165454ib6v2S5cyk.JPEG', 'N', 'N', 0, 'admin', '2023-05-31 08:01:27', '0000-00-00 00:00:00'),
	(840, '', '5월 놀이치료-도형쌓기', '도형을 크기대로 쌓아 올리는 프로그램으로 어르신들에게 크기의 개념을 알려 드리고 손으로 도형을 집고 쌓으며 소근육 발달에도 도움을 드리고 도형쌓기가 성공하면 성취감도 느끼며 기뻐하는 모습도 볼 수 있었습니다.', 'img_20230531170251YIJqCU7RMT.JPEG', 'N', 'N', 0, 'admin', '2023-05-31 08:02:54', '0000-00-00 00:00:00'),
	(841, '', '5월 놀이치료-고리 던지기', '어르신들께서 처음에는 고리 던지기를 어려워 하며 실패도 하였으나 몇번 하고 방법을 터득하신 후에는 천천히 링을 잡고 집중하여 던지셨고, 고리 던지기에 성공할때마다 아주 기뻐하며 박수도 치고 성취감을 느끼며 즐거워 하셨고, 고리 던지기를 통해 조금이나마 신체활동을 유도하여 보다 활력있는 시간을 보낼 수 있도록 도움을 드렸습니다.', 'img_202305311707009GEjDHvTsC.JPEG', 'N', 'N', 1, 'admin', '2023-05-31 08:07:04', '0000-00-00 00:00:00'),
	(842, '', '5월 생신잔치-각 병동', '5월 생신을 맞이한 어르신들에게 맛있는 음식과 생신 선물(양말)을 전달 해드렸습니다. 코로나로 인해 어르신들 개별적으로 침상에 찾아가 양말을 전달하고 음식을 전달 해드리니 너무 고맙다며 언어적으로 표현해 주시는 어르신도 계셨고, 언어적 의사소통이 불가능한 어르신들은 고개를 끄덕이는 등 비언어적으로 표현해 주시는 모습을 볼 수 있었고, 어르신들과 대화도 많이 나누며 즐거운 시간을 보내었습니다.', 'img_202305311707208le2vDa3YS.JPEG', 'N', 'N', 0, 'admin', '2023-05-31 08:09:05', '0000-00-00 00:00:00'),
