	(844, '', '6월 인지치료-과거 회상(여름 그림)', '다가오는 여름을 맞이하여 여름 관련된 그림을 보며 대화 나누는 시간을 가져보았습니다. 어르신들께서 그림을 보며 옛 추억도 떠올리고 과거 회상하며 즐겁게 대화 나누며 정서적 교감을 나누는 시간이 되었습니다.', 'img_20230614155424pwsAzSku56.JPEG', 'N', 'N', 0, 'admin', '2023-06-14 06:54:29', '0000-00-00 00:00:00'),
