	(884, '', '9월 미술치료-9월 달력 만들기', '달력의 빈칸에 날짜도 차례대로 기입하고, 9월과 관련된 그림도 예쁘게 색칠하며 직접 9월 달력을 만드는 시간을 가져보았습니다. 스스로 직접 달력을 만들며 숫자와 날짜를 인지시켜 드리고 소근육 발달에도 도움을 드릴 수 있는 시간이 되었습니다.', 'img_202309211438574lmBdEhzgY.JPEG', 'N', 'N', 0, 'admin', '2023-09-21 05:39:27', '0000-00-00 00:00:00'),
	(885, '', '9월 인지치료-한글쓰기', '한글쓰기 도안을 드리며 천천히 따라 쓰기를 유도하니 어르신들께서 천천히 따라쓰셨고 마지막까지 집중하여 쓰신 후 대화도 많이 나누셨고, 한글쓰기를 통해 어르신들 인지의 잔존 기능을 유지시키도록 도움을 드렸습니다.', 'img_20230921144258Wlghst9TVJ.JPEG', 'N', 'N', 0, 'admin', '2023-09-21 05:43:04', '0000-00-00 00:00:00'),
	(886, '', '9월 낙상예방교육', '침상에서 생활하는 시간이 많은 와상 어르신들, 보행은 가능하나 불안정한 보행 및 워커 보조로 낙상의 위험이 큰 어르신들에게 지속적으로 낙상의 위험을 알려 드리고 예방법을 설명 드리며 보다 안전한 병동생활이 될 수 있도록 도움을 드렸습니다.', 'img_20230921144320p8Cl5ascmY.JPEG', 'N', 'N', 1, 'admin', '2023-09-21 05:43:24', '0000-00-00 00:00:00'),
