	(911, '', '11월 낙상예방교육', '침상에서 생활하는 시간이 많은 와상 어르신들, 보행은 가능하나 불안정한 보행 및 워커 보조로 낙상의 위험이 큰 어르신들에게 지속적으로 낙상의 위험을 알려 드리고 예방법을 설명 드리며 보다 안전한 병동생활이 될 수 있도록 도움을 드렸습니다.', 'img_20231116143333EqF4JYybvA.JPEG', 'N', 'N', 1, 'admin', '2023-11-16 05:33:36', '0000-00-00 00:00:00'),
	(912, '', '11월 놀이치료-단어카드 맞추기', '그림을 보여 드리며 해당하는 단어를 찾는 시간을 가져보았습니다. 놀이식으로 단어와 그림을 어르신들께 인지시켜 드리며 대화도 많이 나누고 즐겁게 마무리 하였습니다.', 'img_20231116143511GihTHZP62n.JPEG', 'N', 'N', 1, 'admin', '2023-11-16 05:35:14', '0000-00-00 00:00:00'),
	(913, '', '11월 인지치료-같은 단어 찾기', '비슷하나 조금씩 다르게 적힌 글자들을 보며 같은 글자를 찾는 프로그램으로 어르신들 집중력을 향상시켜 드리고 기억력을 유지시킬 수 있는 시간이 되었고 중간 중간 부분 보조 해드리며 같이 마무리 하였습니다.', 'img_20231116143542Z9P8lnbYfF.JPEG', 'N', 'N', 1, 'admin', '2023-11-16 05:35:45', '0000-00-00 00:00:00'),
	(914, '', '11월 인지치료-퍼즐 맞추기', '퍼즐 조각을 맞추며 어르신들 인지의 잔존 기능을 유지시켜 드릴 수 있었고, 조각이 많은 퍼즐은 부분 보조하여 같이 맞추기를 마무리 하였습니다.', 'img_20231130142604rSGQn0PDRx.JPEG', 'N', 'N', 0, 'admin', '2023-11-30 05:26:17', '0000-00-00 00:00:00'),
	(915, '', '11월 미술치료-숫자 이어 그리기', '숫자를 1,2,3~ 순서대로 선을 이어 그리고 색칠하는 시간을 가져보았습니다. 숫자를 하나하나 짚어가며 인지하고 선을 그으며 어르신들에게 지속적으로 인지의 잔존 기능을 유지시켜 드릴 수 있는 시간이 되었습니다.', 'img_20231130142638FhwvmdaoXQ.JPEG', 'N', 'N', 1, 'admin', '2023-11-30 05:26:58', '0000-00-00 00:00:00'),
	(916, '', '11월 낙상예방교육', '침상에서 생활하는 시간이 많은 와상 어르신들, 보행은 가능하나 불안정한 보행 및 워커 보조로 낙상의 위험이 큰 어르신들에게 지속적으로 낙상의 위험을 알려 드리고 예방법을 설명 드리며 보다 안전한 병동생활이 될 수 있도록 도움을 드렸습니다.', 'img_202311301427165XoEniYMqB.JPEG', 'N', 'N', 2, 'admin', '2023-11-30 05:27:19', '0000-00-00 00:00:00'),
	(917, '', '11월 미술치료-꽃다발 색칠하기', '꽃다발을 알록달록 예쁘게 색칠하는 시간을 가져보았습니다. 어르신들께서 각자 좋아하는 색을 골라 집중하여 색칠하신 후 다 완성된 그림을 보며 만족해 하는 모습을 보이셨고, 색칠하기를 통해 어르신들 소근육 발달에 도움을 드릴 수 있는 시간이 되었습니다.', 'img_20231130142743nZHLlwGrx1.JPEG', 'N', 'N', 0, 'admin', '2023-11-30 05:28:27', '0000-00-00 00:00:00'),
	(918, '', '11월 미술치료-화투그림 색칠하기', '화투 그림을 보며 따라 색칠하는 시간을 가져보았습니다. 어르신들께서 예전에 화투를 보신 기억을 떠올리며 화투와 관련된 대화도 많이 나누고 즐겁게 참여 하셨습니다.', 'img_20231130142845dIgRvMUtm6.JPEG', 'N', 'N', 0, 'admin', '2023-11-30 05:28:55', '0000-00-00 00:00:00'),
	(919, '', '11월 생신잔치', '11월 생신을 맞이한 어르신들에게 생신선물(양말)을 전달 해드리고 같은 병동 어르신들에게도 맛있는 음식을 나눠 드리며 즐거운 시간을 보냈으며, 선물을 받은 어르신들께서 고맙다고 언어적, 비언어적으로 표현해 주시며 대화도 많이 나누는 시간이 되었습니다.', 'img_202311301432315hWwou2LBe.JPEG', 'N', 'N', 2, 'admin', '2023-11-30 05:32:06', '2023-11-30 14:32:34'),
	(920, '', '12월 미술치료-12월 달력 만들기', '달력의 빈칸에 날짜도 차례대로 기입하고, 12월과 관련된 그림도 예쁘게 색칠하며 직접 12월 달력을 만드는 시간을 가져보았습니다. 스스로 직접 달력을 만들며 숫자와 날짜를 인지시켜 드리고 소근육 발달에도 도움을 드릴 수 있는 시간이 되었습니다.', 'img_20231206143956IgiGhKqYj0.JPEG', 'N', 'N', 2, 'admin', '2023-12-06 05:39:59', '0000-00-00 00:00:00'),
	(921, '', '12월 인지치료-끝말잇기', '단어를 차례대로 끝말을 이어가며 적는 시간을 가져보았습니다. 끝말잇기를 하며 단어를 직접 생각하고 적으며 어르신들 인지의 잔존 기능을 유지시키도록 도움을 드렸습니다.', 'img_20231206144046WSDHQPgOqX.JPEG', 'N', 'N', 0, 'admin', '2023-12-06 05:40:49', '0000-00-00 00:00:00'),
	(922, '', '12월 미술치료 - 12월 달력만들기', '달력의 빈칸에 날짜도 차례대로 기입하고, 12월과 관련된 그림도 예쁘게 색칠하며 직접 12월 달력을 만드는 시간을 가져보았습니다. 스스로 직접 달력을 만들며 숫자와 날짜를 인지시켜 드리고 소근육 발달에도 도움을 드릴 수 있는 시간이 되었습니다.', 'img_20240102091616FPo5BsHcOZ.JPEG', 'N', 'N', 2, 'admin', '2024-01-02 00:17:05', '0000-00-00 00:00:00'),
	(923, '', '12월 미술치료 - 색칠하기', '크리스마스를 맞아 크리스마스 리스 도안을 나눠드리고 어르신들께서 직접 마음에 드는 색깔을 활용하여 색칠하는 시간을 가졌습니다. 색칠을 칠함으로써 어르신들의 소근육발달에 도움을 드렸습니다.', 'img_20240102091743s16dQuyZxl.JPEG', 'N', 'N', 0, 'admin', '2024-01-02 00:19:09', '0000-00-00 00:00:00'),
	(924, '', '12월 생신잔치', '12월 생신을 맞이한 어르신들에게 생신선물(양말)을 전달 해드리고 개별적으로 음식도 나눠 드리며 축하 해드렸습니다. 같은방 어르신들도 함께 축하를 해주시며 대화도 많이 나누고 즐거운 시간이 되었습니다.', 'img_20240102091939IzrnXW9Th0.JPEG', 'N', 'N', 1, 'admin', '2024-01-02 00:19:44', '0000-00-00 00:00:00'),
	(925, '', '1월 인지치료 - 동물그림 카드 맞추기', '어르신들께 그림카드를 보여 드리며 동물 카드 짝을 맞추는 활동을 진행함으로써 자아 성취감을 가질 수있도록 도와주었습니다. 어른신들께서는 게임에 적극적인 참여 모습을 보였으며 그림과 관련된 대화도 많이 나누며 즐겁게 참여하셨습니다.', 'img_20240105141401sAfZDLlEtM.JPEG', 'N', 'N', 0, 'admin', '2024-01-05 05:14:07', '0000-00-00 00:00:00'),
	(926, '', '1월 인지치료 -  과거회상', '어르신에게 겨울그림(화로, 썰매, 눈사람 등)을 보여드리며 정서적 교감 및 지지뿐 만 아니라 정서적 안정감을 제공하였습니다. 어르신들이 과거를 회상하며 대화를 나눔으로써 인지에 자극을 주고 기억력 저하를 감소시키고 인지의 잔존 기능을 유지시킬 수있도록 도움을 주었습니다.', 'img_20240105141421pUTl0g5Iv3.JPEG', 'N', 'N', 1, 'admin', '2024-01-05 05:16:57', '0000-00-00 00:00:00'),
	(927, '', '1월 낙상예방교육 ', '어르신들께서 쉽게 인지할 수 있는 낙상예방교육 자료를 보여 드리며 상황별 낙상 종류 및 낙상을 예방할 수 있는 방법을 설명드림으로써 낙상으로 발생되는 입원환자 상해의 발생을 줄이고 낙상으로 인한 잠재적 위험을 예방하기 위해 낙상예방교육을 실시했습니다.', 'img_202401051417280a4SHz68ym.JPEG', 'N', 'N', 0, 'admin', '2024-01-05 05:19:03', '0000-00-00 00:00:00'),
	(928, '', '1월 미술치료 - 1월 달력만들기', '1월을 맞아 한복을 입고 있는 모습이 담긴 그림에 어르신들이 직접 색칠을 하고 계절에 따른 특징과 변화를 표현할 수 있도록 하였습니다.  달력만들기를 함으로써 수를 순서대로 구분할 수 있도록 도움을 드렸습니다.', 'img_20240105141925tQuEZKLgfV.JPEG', 'N', 'N', 1, 'admin', '2024-01-05 05:22:05', '0000-00-00 00:00:00'),
	(929, '', '1월 인지치료 - 같은 글자 찾기', '예시 글자와 비슷하게 생긴 글자가 여러개 있는 교안을 어르신들에게 보여드리고 어르신들이 직접 예시 글자와 똑같은 글자를 찾아내는 활동을 하였습니다. 어르신분들께서는 천천히 교안을 보고  글자 찾는 활동을 통해 어르신들의 잔존 기능을 유지 할 수 있는 시간이 되었습니다. 또한 여러글자가 겹쳐있는 글자를 보고 단어를 알아내는 활동을 추가로 진행했습니다. ', 'img_202401121558584CrnjPSeta.JPEG', 'N', 'N', 1, 'admin', '2024-01-12 07:01:04', '0000-00-00 00:00:00'),
	(930, '', '1월 낙상예방교육', '침상에서 생활하는 시간이 많은 와상 어르신들, 보행은 가능하나 불안정한 보행 및 워커 보조로 낙상의 위험이 큰 어르신들에게 지속적으로 낙상의 위험을 알려 드리고 예방법을 설명 드리며 보다 안전한 병동생활이 될 수 있도록 도움을 드렸습니다.', 'img_20240112160143WJKi4BSyFk.JPEG', 'N', 'N', 1, 'admin', '2024-01-12 07:01:51', '0000-00-00 00:00:00'),
	(931, '', '1월 인지치료 - 끝말잇기', '사회복지사와 어르신이 번갈아 가며 끝말잇기를 진행했습니다. 초반에는 끝말잇기 방법을 몰라 어려워하던 어르신에게 예시안을 보여드리며 설명해드리니 어르신들은 여러장을 채워가며 재밌게 활동을 마쳤습니다. ', 'img_20240112160252FeY4G2WhJn.JPEG', 'N', 'N', 1, 'admin', '2024-01-12 07:08:20', '0000-00-00 00:00:00'),
	(932, '', '1월 놀이치료 - 도형쌓기 ', '어르신들의 소근육 발달을 위해 큰 도형부터 작은 도형까지 쌓아 올리는 놀이활동을 진행했습니다. 어르신들은 떨리는 손으로 도형쌓기를 모두 완성하였고 잘하시는 어르신분들은 거꾸로 도형을 쌓는 등 다양한 방법으로 소근육 발달을 촉진시켰습니다.', 'img_202401121608294O5wILuxdj.JPEG', 'N', 'N', 3, 'admin', '2024-01-12 07:12:03', '0000-00-00 00:00:00'),
	(933, '', '1월 인지치료 - 덧셈뺄셈하기', '어르신들에게 덧셈뺄셈 교안을 보여주고 활동함으로써 어르신들의 숫자 및 기호인식에 도움을 드렸습니다. 어르신들은 교안을 보고 스스로 막힘없이 숫자를 계산하였습니다. 어려운 부분은 옆에서 보조하며 어르신들의 자존감을 높여주는 활동이 되었습니다.', 'img_2024012214101660J5ySWIlv.JPEG', 'N', 'N', 1, 'admin', '2024-01-22 05:12:16', '0000-00-00 00:00:00'),
	(934, '', '1월 미술치료 - 겨울풍경 색칠하기', '어르신들이 현재 날씨 및 계절을 인식할 수있도록 현재 상황에 맞는 계절 풍경 도안을 보여드렸습니다. 어르신들은 도안에 맞게 여러색을 활용하여 예쁜 그림을 완성했습니다.', 'img_20240122141233lSDwgUvhHm.JPEG', 'N', 'N', 0, 'admin', '2024-01-22 05:15:15', '0000-00-00 00:00:00'),
	(935, '', '1월 인지치료  - 화투그림맞추기', '사회복지사가 보여주는 화투그림에 맞는 짝을 찾는 활동을 하였습니다. 어르신들께서 예전에 화투를 보신 기억을 떠올리며 화투와 관련된 대화도 많이 나누고 즐겁게 참여 하셨습니다.', 'img_20240126133131kMhIDC3E8v.JPEG', 'N', 'N', 0, 'admin', '2024-01-26 04:31:32', '0000-00-00 00:00:00'),
	(936, '', '1월 미술치료 - 만다라 색칠하기', '어르신들께 만다라 도안을 보여드리며 만다라의 유래, 뜻을 함께 설명해주었습니다. 어르신들은 만다라활동을 통해 잠시나마 걱정과 불안을 떨쳐내고 오로지 나에게만 집중할 수 있는시간을 가졌습니다.', 'img_20240126133140Hx9cjJ8ubL.JPEG', 'N', 'N', 2, 'admin', '2024-01-26 04:32:39', '0000-00-00 00:00:00'),
	(937, '', '1월 인지치료 - 구구단', '구구단 프로그램을 통해 어르신들의 지능감퇴 및 집중력 저하현상을 극복하고자 활동을 진행하였습니다. 어르신들은 구구단 활동지를 보며 빠르게 답을 적어내려가셨고 어려운 부분은 활동보조를 제공하여 활동을 마무리하였습니다. 구구단은 통해 어르신들 잔존 기능 및 기억력을 유지시킬 수 있는 시간이 되었습니다. ', 'img_20240202114511TqWUtvYjPa.JPEG', 'N', 'N', 0, 'admin', '2024-02-02 02:50:14', '0000-00-00 00:00:00'),
	(938, '', '1월 미술치료 - 점선 따라 그리기', '어르신들께 점선이 그려진 도안을 드리며 천천히 점선을 따라 그림을 완성시키는 활동을 진행하였습니다. 어르신들은 활동을 통해 소근육 발달 및 집중력 향상에 도움을 드릴 수 있는 시간이 되었습니다. 어르신들은 완성된 도안을 보며 박수를 치고 좋아하셨습니다.', 'img_20240202115039rz6nZC9myA.JPEG', 'N', 'N', 0, 'admin', '2024-02-02 03:02:53', '0000-00-00 00:00:00'),
	(939, '', '1월 생신잔치', '1월 생신을 맞이한 어르신들에게 생신선물(양말)을 전달 해드리고 같은 병동 어르신들에게도 맛있는 음식을 나눠 드리며 즐거운 시간을 보냈으며, 선물을 받은 어르신들께서 고맙다고 언어적, 비언어적으로 표현해 주시며 대화도 많이 나누는 시간이 되었습니다.', 'img_20240202140404xasmMed6hg.JPEG', 'N', 'N', 0, 'admin', '2024-02-02 05:04:46', '0000-00-00 00:00:00'),
	(940, '', '2월 미술치료 - 2월달력만들기', '2월을 맞이하여 어르신들이 2월달력을 꾸미는시간을 가져봤습니다. 어르신들은 빈칸에 알맞은 날짜를 적으며 수를 인지하였고 그려진도안을 예쁘게 꾸몄습니다. 어르신들이 각자 본인이 꾸민달력을 수시로 볼 수 있게 상두대에 붙여두었습니다.', 'img_20240205093356Uxoges8kE0.JPEG', 'N', 'N', 2, 'admin', '2024-02-05 00:40:00', '0000-00-00 00:00:00'),
	(941, '', '2월 미술치료 - 2월달력만들기', '2월을 맞이하여 어르신들이 2월달력을 꾸미는시간을 가져봤습니다. 어르신들은 빈칸에 알맞은 날짜를 적으며 수를 인지하였고 그려진도안을 예쁘게 꾸몄습니다. 어르신들이 각자 본인이 꾸민달력을 수시로 볼 수 있게 상두대에 붙여두었습니다.', 'img_20240213100318YHKOX5tRn9.JPEG', 'N', 'N', 0, 'admin', '2024-02-13 01:03:26', '0000-00-00 00:00:00'),
	(942, '', '2월 여가활동 - 네일아트', '침상에서 많은 시간을 보내는 어르신들을 위해 네일아트 활동을 진행하였습니다. 어르신들은 여러색깔의 매니큐어를 보며 어떤 색을 바를지 행복한 고민하였고 예쁜색으로 가꾸어지는 손을 보며 즐거워했으며 다음에도다른 색깔로 발라달라고 요청했습니다. 침상에서 많은 생활을 하여 무료한 시간을 활기차게 보낼 수있었던 활동이었습니다.', 'img_20240213100334KgGv9CqhVY.JPEG', 'N', 'N', 2, 'admin', '2024-02-13 01:07:56', '2024-02-13 10:08:33'),
	(943, '', '2월 미술치료 - 복주머니 만들기', '2월 설날을 맞이하여 복주머니 도안을 어르신들이 직접 접으며 복주머니를 만드는 시간을 가졌습니다. 어르신들은 떨리는 손으로 복주머니를 완성하였고 편지지에 가족들에게 전달 하고싶은 마음을 적어보는 시간을 가졌습니다. 어르신들은 완성된 복주머니를 보며 좋아하였고, 면회 시 가족들에게 전달하겠다고 말씀하셨습니다.', 'img_20240213100847RkhrqBGf3c.JPEG', 'N', 'N', 2, 'admin', '2024-02-13 01:10:53', '0000-00-00 00:00:00'),
	(944, '', '2월 인지치료 - 과거회상(설날사진)', '어르신들에게 2월을 맞이하여 송편, 차례 지내는 모습이 담긴 사진을 보여드렸습니다. 어르신들은 옛날 본인들이 하셨던 음식, 떡, 차례 기억을 더듬어 보는 시간을 가졌습니다. 과거회상을 통해 어르신들의 잔존기억능력을 발달시키고 추억을 회상할 수 있는 시간이 되었습니다.', 'img_20240216171637s3QB9R6YH1.JPEG', 'N', 'N', 1, 'admin', '2024-02-16 08:18:01', '0000-00-00 00:00:00'),
	(945, '', '2월 낙상예방교육', '어르신들께서 쉽게 인지할 수 있는 낙상예방교육 자료를 보여 드리며 상황별 낙상 종류 및 낙상을 예방할 수 있는 방법을 설명드림으로써 낙상으로 발생되는 입원환자 상해의 발생을 줄이고 낙상으로 인한 잠재적 위험을 예방하기 위해 낙상예방교육을 실시했습니다.', 'img_20240216171806eDN3JgPj97.JPEG', 'N', 'N', 0, 'admin', '2024-02-16 08:18:30', '0000-00-00 00:00:00'),
	(946, '', '2월 놀이치료 - 퍼즐맞추기', '어르신들에게 퍼즐 도안을 보여드리며 퍼즐을 완성시키는 시간을 가져보았습니다. 어르신들은 처음에 어려워하다 1-2개 도움을 받고 난  뒤로는 어르신들 혼자 퍼즐을 모두 완성하셨습니다. 퍼즐놀이를 통해 공간지각능력, 상상력 등을 키울 수 있었습니다.', 'img_20240216171836g3oSn8vBRc.JPEG', 'N', 'N', 1, 'admin', '2024-02-16 08:20:06', '0000-00-00 00:00:00'),
	(947, '', '2월 미술치료 - 점선 따라 그리기', '어르신들에게 점선이 그려진 그림 도안을 나눠드리고 점선에 따라 선을 그을 수 있게끔 도와드렸습니다.어르신들은 숫자 순서대로 선을 그어가며 도안을 완성하였습니다. 활동을 통해 어르신들의 소근육 발달 및 집중력 향상에도 도움이 되었습니다.', 'img_20240219094020FuoWrXkNhP.JPEG', 'N', 'N', 1, 'admin', '2024-02-19 00:58:09', '2024-03-08 10:56:03'),
	(948, '', '2월 인지치료 - 미로찾기', '어르신들의 공간지각능력과 인지발달을 위해 미로찾기 도안을 드렸습니다. 어르신들은 처음에 어려워했으나 올바른 길을 깨닫고 난 후 점진적으로 선을 자신감있게 긋는 등 활동적인 모습을 보였습니다. 어르신들은 한번 깨닫고 나니까 쉽게진행헀다며 즐거워했습니다.', 'img_20240223115341cn4MHau8ts.JPEG', 'N', 'N', 3, 'admin', '2024-02-23 02:55:24', '2024-03-08 10:56:13'),
	(949, '', '2월 미술치료 - 화투그림그리기', '어르신들이 쉽게 즐길 수 있는 화투 도안을 드리고 예전에 놀이로 사용한 화투에 대한 이야기를 하였습니다. 어르신들은 어렸을 때 즐겨 쳤다며 좋아하는 모습을 보였습니다. 그림속 도안을 화투와 똑같은 색으로 칠하며 어르신들의 인지능력 및 소근육발달에 도움을 주었습니다.', 'img_20240223115603AovLdiqZtD.JPEG', 'N', 'N', 1, 'admin', '2024-02-23 02:57:17', '2024-03-08 10:56:27'),
	(950, '', '2월 놀이치료 - 화투그림 맞추기', '어르신들에게 화투그림이 그려진 교안을 드리며 본 직원이 보여주는 도안과 알맞는 짝을 맞춰야 함을 안내해드렸습니다. 어르신들은 예전부터 자주 했던 화투놀이여서 곧잘 따라하고 즐거워하는 모습이셨습니다. 놀이치료 활동을 통해 어르신들의 인지능력과 잔존기억을 발달할 수 있었던 시간입니다.', 'img_20240223160922qnC10lhpTZ.JPEG', 'N', 'N', 1, 'admin', '2024-02-23 07:12:50', '2024-03-08 10:56:34'),
	(951, '', '2월 인지치료 -  그림 맞추기', '봄을 맞이하여 어르신들에게 봄꽃 그림을카드 보여준 뒤 그림에 맞는 꽃이름이 적힌 도안을 보고 알맞는 꽃이름에 붙여보는 시간을 가졌습니다. 어르신들은 오랜만에 보는 꽃이라며 옛날에 집앞에 폈던 꽃과 평소 좋아하는 꽃 이름을 알려주며 즐거워했습니다. 어르신들의 잔존기억을 되살릴 수 있는 시간이 되었습니다. ', 'img_20240229140107blutsUMn5G.JPEG', 'N', 'N', 3, 'admin', '2024-02-29 05:24:28', '2024-03-08 10:56:41'),
	(952, '', '2월 놀이치료 - 블록쌓아올리기', '어르신과 나무블록을 가지고 젠가놀이를 진행했습니다. 처음에는 어려운 듯이 머뭇거렸으나 점차 활동에 재미를 붙여 즐겁게 치료를 완료했습니다. 어르신은 떨리는 손을 붙잡고 나무블록을 쓰러뜨리지 않기 위해 집중하였고 성공할때마다 박수를 치며 크게 웃었습니다. 활동을 통해 어르신들의 집중력을 높일 수 있는 시간이 되었습니다.', 'img_20240229142435Mv1wqQBKFi.JPEG', 'N', 'N', 1, 'admin', '2024-02-29 05:26:28', '2024-03-08 10:56:48'),
	(953, '', '2월 생신잔치', '2월 생신을 맞이한 어르신들에게 생신선물(양말)을 전달 해드리고 개별적으로 음식도 나눠 드리며 축하 해드렸습니다. 같은방 어르신들도 함께 축하를 해주시며 대화도 많이 나누고 즐거운 시간이 되었습니다.', 'img_20240229142632iw3m9sBlqN.JPEG', 'N', 'N', 1, 'admin', '2024-02-29 05:26:50', '0000-00-00 00:00:00'),
	(954, '', '3월 미술치료 - 달력만들기', '3월을 맞이하여 어르신들이 3월달력을 꾸미는시간을 가져봤습니다. 어르신들은 빈칸에 알맞은 날짜를 적으며 수를 인지하였고 그려진도안을 예쁘게 꾸몄습니다. 어르신들이 각자 본인이 꾸민달력을 수시로 볼 수 있게 상두대에 붙여두었습니다.', 'img_20240308105452T3hYUJepmj.JPEG', 'N', 'N', 1, 'admin', '2024-03-08 01:55:26', '2024-03-08 10:55:52'),
	(955, '', '3월 여가활동 - 네일아트', '어르신들에게 네일아트를 제공하는 시간을 가졌습니다. 어르신들은 예쁘게 가꾸어지는 손을 보며 즐거워하였고, 직접 색을 고르며 다음에는 어떤 색을 할지 행복한 고민을 하는 시간이 되었습니다. ', 'img_20240308105700ykX5BM9Q1x.JPEG', 'N', 'N', 0, 'admin', '2024-03-08 01:58:09', '0000-00-00 00:00:00'),
	(956, '', '3월 놀이치료 - 도형쌓기', '어르신들과 함께 도형을 빼고 쌓는  게임을 진행하였습니다. 어르신들은 떨리는 손을 붙잡고 활동에 집중하였습니다. 이와같은 활동을 통해 어르신들의 집중력을 향상시키고 소근육을 자극시키는 효과를 도와드렸습니다.', 'img_20240322150651jKgPTWNRZM.JPEG', 'N', 'N', 1, 'admin', '2024-03-22 06:08:11', '0000-00-00 00:00:00'),
	(957, '', '3월 미술치료 - 점선따라그리기', '어르신들에게 점선이 그려진 그림 도안을 나눠드리고 점선에 따라 선을 그을 수 있게끔 도와드렸습니다.어르신들은 숫자 순서대로 선을 그어가며 도안을 완성하였습니다. 활동을 통해 어르신들의 소근육 발달 및 집중력 향상에도 도움이 되었습니다.', 'img_20240322150813VYh0dDt9Pa.JPEG', 'N', 'N', 0, 'admin', '2024-03-22 06:08:46', '0000-00-00 00:00:00'),
	(958, '', '3월 인지치료 - 단어맞추기', '어르신들이 잘 알수있는  음식재료들을 활용한 게임을 직접 제작하여 어르신들과 인지치료를 진행했습니다. 어르신들에게 식재료가 그려진 교안을 배부한 후 랜덤으로 한글자씩 배부하였습니다. 어르신은 글자를 보고 그림에 올바르게 맞춰보는 활동을 통해 인지력을 향상시킬 수 있었습니다.  ', 'img_20240322150850L1ecqsQM9Y.JPEG', 'N', 'N', 2, 'admin', '2024-03-22 06:11:48', '0000-00-00 00:00:00'),
	(959, '', '3월 인지치료 - 틀린그림찾기', '어르신들에게 두개의 그림을 보여드린 후 틀린 부분을 찾는 활동을 진행했습니다. 어르신들은 양쪽 그림을 번갈아가며 확인하며 틀린부분을 모두 찾아냈습니다. 이와 같은 활동을 통해 어르신들의 관찰력과 집중력을 높일 수 있는 시간이 되었습니다.', 'img_20240322151400M8PnusIOSF.JPEG', 'N', 'N', 0, 'admin', '2024-03-22 06:14:07', '0000-00-00 00:00:00'),
	(960, '', '3월 미술치료 - 색칠하기', '어르신들의 소근육 발달과 창의력을 높이기 위해 색칠하기 활동을 진행했습니다. 어르신들은 꼼꼼하게 원하는 색으로 색칠을 진행하였고, 똑같이 색칠해야 하는 도안에서는 색이 똑같은지 확인하는 작업을 진행하며 활동을 무사히 마쳤습니다.', 'img_20240322151412D4FnuE5fYk.JPEG', 'N', 'N', 1, 'admin', '2024-03-22 06:15:32', '0000-00-00 00:00:00'),
	(961, '', '3월 인지치료 - 수 세어보기', '어르신들의 인지능력 향상을 위해 친숙한 화폐를 활용하여 수 세어보기를 진행했습니다. 어르신들은 일반 숫자보다 화폐를 사용하였기에 훨씬 빠르게 숫자를 더하고 뺄 수 있었던 활동이었습니다.', 'img_20240329091017J3IonfCdU7.JPEG', 'N', 'N', 0, 'admin', '2024-03-29 00:11:20', '0000-00-00 00:00:00'),
	(962, '', '3월 인지치료 - 덧셈뺄셈하기', '어르신들의 인지능력 향상을 위해 덧셈뺄셈 수학 활동을 진행했습니다. 어르신들은 한자리, 두자리 숫자까지 완벽하게 해내었지만, 세자리 수 부터 헷갈려하며 어렵다고 호소하였습니다. 그러나 본 직원의 도움으로 끝까지 활동을 마무리할 수 있었습니다.', 'img_20240329091124a5iyz3XWAf.JPEG', 'N', 'N', 1, 'admin', '2024-03-29 00:12:18', '0000-00-00 00:00:00'),
	(963, '', '3월 인지치료 - 속담 연결하기', '옛날부터 전해져 내려오고 학습화된 속담을 활용하여 어르신들의 잔존 능력 및 인지 능력을 향상 시키는 활동을 진행했습니다. 어르신들은 익숙한 속담에 재밌어하며 활동을 마무리하였습니다. ', 'img_20240329091223e6ZodQAXVw.JPEG', 'N', 'N', 1, 'admin', '2024-03-29 00:13:23', '0000-00-00 00:00:00'),
	(964, '', '3월 생신잔치', '3월 생신을 맞이한 어르신들에게 생신선물(양말)을 전달 해드리고 개별적으로 음식도 나눠 드리며 축하 해드렸습니다. 같은방 어르신들도 함께 축하를 해주시며 대화도 많이 나누고 즐거운 시간이 되었습니다.', 'img_20240329091420wDURevI4z2.JPEG', 'N', 'N', 1, 'admin', '2024-03-29 00:14:22', '0000-00-00 00:00:00'),
	(965, '', '4월 인지치료 - 4월 달력만들기', '4월을 맞이하여 어르신들이4월달력을 꾸미는시간을 가져봤습니다. 어르신들은 빈칸에 알맞은 날짜를 적으며 수를 인지하였고 그려진도안을 예쁘게 꾸몄습니다. 어르신들이 각자 본인이 꾸민달력을 수시로 볼 수 있게 상두대에 붙여두었습니다.', 'img_20240405114035n5VfdQlvHo.JPEG', 'N', 'N', 1, 'admin', '2024-04-05 02:40:59', '0000-00-00 00:00:00'),
	(966, '', '4월 낙상예방교육', '어르신들께서 쉽게 인지할 수 있는 낙상예방교육 자료를 보여 드리며 상황별 낙상 종류 및 낙상을 예방할 수 있는 방법을 설명드림으로써 낙상으로 발생되는 입원환자 상해의 발생을 줄이고 낙상으로 인한 잠재적 위험을 예방하기 위해 낙상예방교육을 실시했습니다.', 'img_20240405114103D5d7CVa4NW.JPEG', 'N', 'N', 0, 'admin', '2024-04-05 02:41:13', '0000-00-00 00:00:00'),
	(967, '', '4월 여가활동 - 네일아트', '여가활동으로 어르신들에게 네일을 해드렸습니다. 어르신들은 오랜만에 꾸미는 손톱을 보고 기뻐하고 즐거워하였습니다.  어르신들을 직접 색깔도 선택하며 재밌는 시간을 보냈습니다. ', 'img_20240405114158PtzbOReT8U.JPEG', 'N', 'N', 0, 'admin', '2024-04-05 02:43:47', '0000-00-00 00:00:00'),
	(968, '', '4월 인지치료 - 속담연결하기', '옛날부터 전해져 내려오고 학습화된 속담을 활용하여 어르신들의 잔존 능력 및 인지 능력을 향상 시키는 활동을 진행했습니다. 어르신들은 익숙한 속담에 재밌어하며 활동을 마무리하였습니다. ', 'img_20240412094748mBkrEDN1YO.JPEG', 'N', 'N', 1, 'admin', '2024-04-12 00:48:15', '0000-00-00 00:00:00'),
	(969, '', '4월 미술치료 - 사물 색칠하기', '봄을 맞이하여 어르신들에게 봄과 관련된 도안을 나눠드렸습니다. 어르신들은 형형색깔로 봄꽃을 색칠하였으며, 칙칙한 병원생활에 활기를 불어올 수 있는 봄에 대해 많은 이야기를 나눴습니다. ', 'img_20240412094821kuwqrLnDGW.JPEG', 'N', 'N', 2, 'admin', '2024-04-12 00:49:09', '0000-00-00 00:00:00'),
	(970, '', '4월 놀이활동 - 퍼즐맞추기', '어르신들에게 퍼즐 도안을 보여드리며 퍼즐을 완성시키는 시간을 가져보았습니다. 어르신들은 처음에 어려워하다 1-2개 도움을 받고 난  뒤로는 어르신들 혼자 퍼즐을 모두 완성하셨습니다. 퍼즐놀이를 통해 공간지각능력, 상상력 등을 키울 수 있었습니다.', 'img_20240412094934ZYzDMAPo9k.JPEG', 'N', 'N', 0, 'admin', '2024-04-12 00:49:50', '0000-00-00 00:00:00'),
	(971, '', '4월 인지치료 - 한글쓰기', '어르신들의 인지능력 향상을 위해 기초 한글쓰기부터 어려운 낱말 쓰기 등 한글 쓰기 활동을 진행했습니다. 한글을 알지 못하는 어르신들에게 도움을 드릴 수 있었던 활동이었습니다. ', 'img_20240419135140Dox2AYbX8z.JPEG', 'N', 'N', 1, 'admin', '2024-04-19 04:51:44', '2024-04-26 11:52:16'),
	(972, '', '4월 놀이치료 - 낱말 맞추기', '어르신들에게 동물모양 카드를 보여드리며 어떤 동물인지 알아맞추는 게임을 진행했습니다. 어르신들은 동물모양이 어둡게 그려진 모습을 보고 생소하다고 말하며 어려워하였으나, 곧잘 이해하고 게임을 진행하였습니다.', 'img_202404191351466ho5suMiR0.JPEG', 'N', 'N', 1, 'admin', '2024-04-19 04:54:54', '2024-04-26 11:52:26'),
	(973, '', '4월 인지치료 - 도형맞추기', '어르신들의 인지능력 향상을 위해 여러도형이 섞여있는 도안을 드린 후, 지정된 도형만 찾을 수 있도록 도움을 주었습니다. 어르신들은 침착하게 모든 활동을 성공적으로 마무리하였습니다. ', 'img_20240426114600X5mtylTLfK.JPEG', 'N', 'N', 2, 'admin', '2024-04-26 02:47:21', '2024-04-26 11:52:33'),
	(974, '', '4월 놀이치료 - 끝말잇기', '어르신들과 함께 끝말잇기 활동을 진행했습니다. 어르신들은 처음에 활동의 규칙을 몰라 어리둥절 하며 어려워하였으나, 본 직원의 도움으로 규칙성을 인지하고 끝말잇기를 성공적으로 마무리하였습니다. ', 'img_20240426114725RUJPxgsibr.JPEG', 'N', 'N', 2, 'admin', '2024-04-26 02:48:14', '2024-04-26 11:52:40'),
	(975, '', '4월 놀이치료 - 나비 종이접기', '어르신들에게 봄이 왔다는 것을 안내하고자 꽃 화분과 나비모양 종이접기 활동을 실시했습니다. 어르신들은 떨리는 손으로 본 직원과 함께 나비를 잘 접었고 더불어 색칠 활동도 성공적으로 마무리하였습니다. ', 'img_20240426114818fx4o9RK7yv.JPEG', 'N', 'N', 0, 'admin', '2024-04-26 02:49:40', '2024-04-26 11:52:46'),
	(976, '', '4월 놀이치료 - 튤립 종이 접기', '어르신들에게 봄이 왔다는 것을 안내하고자 튤립모양의 꽃 화분 접기 활동을 실시하였습니다. 처음부터 끝까지 어르신들의 힘으로 화분 색칠과 튤립을 접었으며, 어르신들은 너무 예쁘다며 상두대에 붙여 전시하였습니다. ', 'img_20240426114947Quxc8iAoXU.JPEG', 'N', 'N', 2, 'admin', '2024-04-26 02:50:44', '2024-04-26 11:53:03'),
	(977, '', '4월 놀이치료 - 퍼즐 맞추기', '어르신들의 요청으로 퍼즐 맞추기 도안을 드렸습니다. 어르신은 퍼즐조각의 모양을 인지하여 알맞는 공간에 넣기 위해 노력했습니다 . 어르신은 쉽지 않은 조각은 본 직원의 도움을 받으며 퍼즐을 완성했습니다. 퍼즐 맞추기 활동을 통해 어르신들의 인지능력을 향상시키고 퍼즐조각을 잡는 소근육을 발달시킬 수 있었습니다. ', 'img_20240426115048fulw7thURY.JPEG', 'N', 'N', 1, 'admin', '2024-04-26 02:52:01', '2024-04-26 11:53:11'),
	(978, '', '4월 놀이치료 - 화투놀이', '어르신들이 쉽게 즐길 수 있는 화투를 가지고 어르신들과 즐겁게 화투를 쳤습니다. 어렸을 때부터 즐겨 활동했던터라 다들 재밌게 즐겨주셨습니다.', 'img_20240426143647A1LciSvs6T.JPEG', 'N', 'N', 1, 'admin', '2024-04-26 05:37:27', '0000-00-00 00:00:00'),
	(979, '', '4월 생신잔치', '4월 생신을 맞이한 어르신들에게 생신선물(양말)을 전달 해드리고 개별적으로 음식도 나눠 드리며 축하 해드렸습니다. 같은방 어르신들도 함께 축하를 해주시며 대화도 많이 나누고 즐거운 시간이 되었습니다.', 'img_202405030913374OyCubnDB0.JPEG', 'N', 'N', 0, 'admin', '2024-05-03 00:13:56', '0000-00-00 00:00:00'),
	(980, '', '5월 미술치료 - 달력만들기', '5월을 맞이하여 어르신들이5월달력을 꾸미는시간을 가져봤습니다. 어르신들은 빈칸에 알맞은 날짜를 적으며 수를 인지하였고 그려진도안을 예쁘게 꾸몄습니다. 어르신들이 각자 본인이 꾸민달력을 수시로 볼 수 있게 상두대에 붙여두었습니다.', 'img_20240503091403742soZKRuD.JPEG', 'N', 'N', 2, 'admin', '2024-05-03 00:14:24', '0000-00-00 00:00:00'),
	(981, '', '5월 인지치료 - 틀린그림 찾기', '두개의 그림이 그려져있는 도안을 드린 후 양 쪽 그림에서 서로 다른 부분을 찾아 동그라미를 그려보는 시간을 가졌습니다. ', 'img_20240510105509JG18MaDIAu.JPEG', 'N', 'N', 1, 'admin', '2024-05-10 01:56:05', '0000-00-00 00:00:00'),
	(982, '', '5월 어버이날', '어버이날을 맞이하여 어르신들에게 과자가 들어진 선물꾸러미와 카네이션을 달아드렸습니다. 어르신들은 이 날만을 기다렸다며 즐거워하는 모습을 보였습니다. ', 'img_2024051010561079gsv1QobX.JPEG', 'N', 'N', 1, 'admin', '2024-05-10 01:57:00', '0000-00-00 00:00:00'),
	(983, '', '5월 놀이치료 - 그림맞추기', '어르신들에게 그림을 보여드리며 어르신들이 직접 공간지각능력을 활용하여 그림을 맞추는 놀이활동을 진행했습니다. 어르신들은 복잡한 그림을 보고 초반에 어려워하였으나 본 직원의 도움을 통해 그림을 완성시켰습니다. ', 'img_20240510105703FXru4syJwc.JPEG', 'N', 'N', 2, 'admin', '2024-05-10 01:58:10', '0000-00-00 00:00:00'),
	(984, '', '5월 미술치료 - 협동화', '어르신들의 소근육 발달과 협동심을 높이기 위해 협동화를 실시하였습니다. 어르신들은 그림을 색칠하며 처음에는 어떤그림인지 모르겠다며 의아해하였으나 색칠을 모두 완성한 후, 한 곳으로 모으자 예쁜 그림이 완성되었다며 호실에 있는 어르신들이 모두 좋아하셨습니다. 어르신들의 협동심을 엿볼 수 있는 시간이 되었습니다.', 'img_20240517092005fLASdoVEcb.JPEG', 'N', 'N', 2, 'admin', '2024-05-17 00:21:55', '0000-00-00 00:00:00'),
	(985, '', '5월 미술치료 - 점선 따라 그리기', '어르신들에게 점선이 그려진 그림 도안을 나눠드리고 점선에 따라 선을 그을 수 있게끔 도와드렸습니다.어르신들은 숫자 순서대로 선을 그어가며 도안을 완성하였습니다. 활동을 통해 어르신들의 소근육 발달 및 집중력 향상에도 도움이 되었습니다.', 'img_20240517092200ME6ZTpNroh.JPEG', 'N', 'N', 2, 'admin', '2024-05-17 00:22:26', '0000-00-00 00:00:00'),
	(986, '', '5월 미술치료 - 과일가방만들기', '여름을 맞이하여 어르신들에게 과일이 그려진 가방을 만드는 시간을 가졌습니다. 어르신들은 시원한 여름이 왔다며 수박과 오렌지 중에 오렌지를  선택하여 가방을 만들었습니다. 어르신 한 분은 만든 가방안에 소량의 간식꾸러미를 담아 보관하였습니다. ', 'img_202405170922297oH5tlQBgD.JPEG', 'N', 'N', 3, 'admin', '2024-05-17 00:24:26', '2024-05-24 08:55:45'),
	(987, '', '5월 인지치료 - 단어 맞추기', '한글자씩 쓰여진 낱말을 보고 어르신들이 2음절의 단어를 자율적으로 찾는 활동을 진행했습니다. 어르신들은 처음에 어려워했으나 본직원이 쉽게 예를 들어주자 이해했다는 듯이 끄덕이며 2음절의 단어를 여러개 쓰기 시작했습니다. 이 활동을 통해 어르신들의 인지능력 및 한글쓰기 능력에 도움을 주었습니다. ', 'img_20240524085747ZTSH68Qsyn.JPEG', 'N', 'N', 2, 'admin', '2024-05-23 23:57:50', '0000-00-00 00:00:00'),
	(988, '', '5월 미술치료 - 삐에로 풍선 만들기', '어른신들에게 삐에로가 그려진 색칠도안을 칠할 수 있게끔 도모하고 색칠이 완성된 삐에로 종이에 풍선을 불어 붙여보는 시간을 가졌습니다. 어르신들은 제각각 다른 색으로 삐에로 도안을 완성했고, 직접 풍선을 불며 삐에로 코를 완성했습니다. 병동은 풍선이 둥실둥실 떠다니는 것이 재밌다며 웃음바다가 되었습니다.  위 활동을 통해 어르신들의 소근육을 발달시킬 수 있었습니다.', 'img_20240524085753js3JrSFo17.JPEG', 'N', 'N', 1, 'admin', '2024-05-24 00:00:17', '0000-00-00 00:00:00'),
	(989, '', '5월 미술치료 - 색칠하기 및 종이접기', '어르신들이 쉽게 따라할 수 있는 종이 접기 방법을 알려주는 시간을 가졌습니다. 어르신들이 각자 색칠도안을 정한 뒤,  도안을 색칠하고 그 위에 어울리는 모양의 종이를 접어 붙이는 시간을 가졌습니다.  ', 'img_20240524090024QZi1amGE4B.JPEG', 'N', 'N', 2, 'admin', '2024-05-24 00:17:25', '0000-00-00 00:00:00'),
	(990, '', '5월 놀이치료 - 화투놀이', '친숙한 화투놀이를 통해 어르신들과 무료한 시간을 달래보았습니다. 어르신들은 정확히 화투놀이의 방법을 인지하고 있었으며, 어르신들은 재밌게 화투놀이를 즐겼습니다. ', 'img_202405240917308wyZQbaGzP.JPEG', 'N', 'N', 2, 'admin', '2024-05-24 00:18:47', '0000-00-00 00:00:00'),
	(991, '', '5월 놀이치료 - 도형쌓기', '크기가 다른 도형을 작은 크기부터 큰 크기 순서대로 쌓으므로 써 어르신들의 인지 능력 발달 및 소근육 발달을 향상시켜주었습니다. ', 'img_202405311436448j2TlIoPrN.JPEG', 'N', 'N', 1, 'admin', '2024-05-31 05:37:35', '0000-00-00 00:00:00'),
	(992, '', '5월 인지치료 - 한글쓰기', '어르신들의 인지능력 향상을 위해 기초 한글쓰기부터 어려운 낱말 쓰기 등 한글 쓰기 활동을 진행했습니다. 한글을 알지 못하는 어르신들에게 도움을 드릴 수 있었던 활동이었습니다. ', 'img_202405311437482qaGM0himO.JPEG', 'N', 'N', 0, 'admin', '2024-05-31 05:38:01', '0000-00-00 00:00:00'),
	(993, '', '5월 여가활동 - 영화감상', '어르신들의 무료한 시간을 달래기 위해 영화감상 시간을 준비하였습니다. 다과와 음료를 먹으며 오랜만에 보는영화에 어르신들은 즐거워하였습니다. ', 'img_202405311438056exJPLps8i.JPEG', 'N', 'N', 2, 'admin', '2024-05-31 05:38:38', '0000-00-00 00:00:00'),
	(994, '', '6월 미술치료 - 6월 달력만들기', '6월을 맞이하여 어르신들이6월달력을 꾸미는시간을 가져봤습니다. 어르신들은 빈칸에 알맞은 날짜를 적으며 수를 인지하였고 그려진도안을 예쁘게 꾸몄습니다. 어르신들이 각자 본인이 꾸민달력을 수시로 볼 수 있게 상두대에 붙여두었습니다.', 'img_20240605144733NPh2Yt5qJm.JPEG', 'N', 'N', 0, 'admin', '2024-06-05 05:47:57', '0000-00-00 00:00:00'),
	(995, '', '6월 미술치료 - 색칠하기', '어르신들이 좋아하는 그림을 선택하게끔 하여 색칠할 수 있는 시간을 가졌습니다. 어르신들은 직접 도안을 선택하여 예쁜 색으로 색칠하기 시작하였고, 완성된 그림을 보고 함박웃음을 지으며 행복해하는 모습을 보였습니다. 완성된 그림은 상두대에 비치하여 어르신들이 지속적으로 그림을 바라보며 무료한 시간을 달래보는 활동을 진행했습니다. ', 'img_20240614092947SzpL8bfYdm.JPEG', 'N', 'N', 1, 'admin', '2024-06-14 00:31:09', '0000-00-00 00:00:00'),
	(996, '', '6월 여가활동 - 네일아트', '어르신들에게 네일아트를 제공하는 시간을 가졌습니다. 어르신들은 예쁘게 가꾸어지는 손을 보며 즐거워하였고, 직접 색을 고르며 다음에는 어떤 색을 할지 행복한 고민을 하는 시간이 되었습니다. ', 'img_20240614093113wetBqCAknL.JPEG', 'N', 'N', 1, 'admin', '2024-06-14 00:31:33', '0000-00-00 00:00:00'),
	(997, '', '6월 놀이활동 - 풍선배구', '어르신들에게 픙선을 직접 불어보는 시간과 어르신들끼리 풍선을 활용하여 배구를 하는 시간을 가졌습니다. 어르신들은 서로 풍선 배구를 하며 즐겁게 웃으며 놀았습니다. ', 'img_202406201658269kPK3BYouN.JPEG', 'N', 'N', 0, 'admin', '2024-06-20 08:00:22', '0000-00-00 00:00:00'),
	(998, '', '6월 인지치료 - 뉴스읽기', '어르신들에게 현대사회에서 이슈화된 뉴스를 알려주기 위해 뉴스읽기 활동을 진행했습니다. 뉴스를 읽으며 어르신들은 요즘 어떤 일이 일어나고 있는지 확인하는 시간을 갖게되었고 뉴스를 보고 직접 쓰는 활동을 진행했습니다. ', 'img_20240620170028N4Lh7rd3VW.JPEG', 'N', 'N', 0, 'admin', '2024-06-20 08:01:30', '0000-00-00 00:00:00'),
	(999, '', '6월 인지치료 - 학습지활동', '어르신들에게 학습지 활동을 진행했습니다. 어르신들에게 아픈곳이 있는 부위를 설명하고 병원의 종류에 따라 구분되는 부위를 설명하였습니다. ', 'img_20240620170133QzeBl6t8pD.JPEG', 'N', 'N', 0, 'admin', '2024-06-20 08:02:28', '0000-00-00 00:00:00'),
	(1000, '', '6월 미술치료 - 색칠하기', '어르신들에게 여러 도안을 보여드린 후 마음에 드는 도안을 선택할 수 있는 시간을 가졌습니다. 어르신들은 예쁜 도안을 고르며 본인이 원하는 색으로 예쁘게 칠했습니다. 색칠하기 활동을 통해 어르신들의 소근육을 발달시킬 수 있는 시간이 되었습니다. ', 'img_20240620170234BbefduAxWs.JPEG', 'N', 'N', 0, 'admin', '2024-06-20 08:03:46', '0000-00-00 00:00:00'),
	(1001, '', '6월 놀이치료 - 화투놀이', '어르신들에게 익숙한 화투놀이를 진행했습니다. 어르신들은 오랜만에 하는 화투라며 즐거워하는 모습을 보였습니다. ', 'img_20240628100743cowEBYASv4.JPEG', 'N', 'N', 1, 'admin', '2024-06-28 01:09:24', '0000-00-00 00:00:00'),
	(1002, '', '6월 놀이치료 - 윷놀이', '병동 어르신들과 함께 윷놀이를 진행했습니다. 어르신들은 다같이 모여 팀대결로 윷놀이를 즐겁게 즐겼습니다. ', 'img_202406281009284ePVAZoctN.JPEG', 'N', 'N', 1, 'admin', '2024-06-28 01:10:27', '0000-00-00 00:00:00'),
	(1003, '', '6월 생신잔치', '6월 생신을 맞이한 어르신들에게 맛있는 음식과 생신 선물(양말)을 전달 해드렸습니다. 코로나로 인해 어르신들 개별적으로 침상에 찾아가 양말을 전달하고 음식을 전달 해드리니 너무 고맙다며 언어적으로 표현해 주시는 어르신도 계셨고, 언어적 의사소통이 불가능한 어르신들은 고개를 끄덕이는 등 비언어적으로 표현해 주시는 모습을 볼 수 있었고, 어르신들과 대화도 많이 나누며 즐거운 시간을 보내었습니다.', 'img_20240628144925aSvZfhIzsg.JPEG', 'N', 'N', 1, 'admin', '2024-06-28 05:49:55', '0000-00-00 00:00:00'),
	(1004, '', '7월 미술치료 - 7월 달력만들기', '7월을 맞이하여 어르신들이7월달력을 꾸미는시간을 가져봤습니다. 어르신들은 빈칸에 알맞은 날짜를 적으며 수를 인지하였고 그려진도안을 예쁘게 꾸몄습니다. 어르신들이 각자 본인이 꾸민달력을 수시로 볼 수 있게 상두대에 붙여두었습니다.', 'img_20240708092151Clmg5ApTGe.JPEG', 'N', 'N', 0, 'admin', '2024-07-08 00:22:20', '0000-00-00 00:00:00'),
	(1005, '', '7월 미술치료 - 여름부채 만들기', '여름을 맞이하여 어르신들에게 여러 도안이 담겨져 있는 부채와 물감세트를 드렸습니다. 어르신들은 본 직원의 설명에 맞춰 도안에 물감을 칠하며 예쁜 부채를 만들었습니다. 침상에서 보내는 무료한 시간을 달래보는 활동과 손근육 발달을 높일 수 있는 시간이 되었습니다. ', 'img_20240708092227dXpnIuPNGH.JPEG', 'N', 'N', 2, 'admin', '2024-07-08 00:24:24', '0000-00-00 00:00:00'),
	(1006, '', '7월 인지치료 - 학습지 활동', '어르신들에게 학습지 활동을 진행했습니다. 단어의 범주안에 드는 단어를 고민해보고 찾는 시간을 가졌습니다. 또한 초성퀴즈를 맞추어 어르신들의 인지능력을 높일 수 있는 활동을 진행했습니다. ', 'img_202407080924310Jl4boL2tr.JPEG', 'N', 'N', 1, 'admin', '2024-07-08 00:25:49', '0000-00-00 00:00:00'),
	(1007, '', '7월 인지치료 - 그림 찾기', '어르신들에게 네잎클로버와 세잎클로버가 여러개 있는 도안을 드린 후, 네잎클로버 그림만 찾을 수 있도록 활동을 도모하였습니다. 위와 같은 활동을 통해 어르신들의 인지 능력 발달 및 손근육 발달에 도움을 줄 수 있었습니다.  ', 'img_20240712155118stayOfPNZ8.JPEG', 'N', 'N', 0, 'admin', '2024-07-12 06:54:05', '2024-07-12 15:56:47'),
	(1008, '', '7월 미술활동 - 종이접기', '장마시즌을 겪으며 어르신들의 어릴 적 여름철 놀이 등을 들어보는 시간을 가졌습니다. 또한 연못 위에 있는 개구리를 만들기 위해 개구리모양 종이접기를 진행했습니다. 어르신들은 어려워 하였으나 이내 예쁘게 완성된 개구리를 보고 즐거워하였습니다. 위와같은 활동을 통해 손근육 발달을 높일 수 있는 시간을 가졌습니다. ', 'img_20240712155412NdkucSyWGY.JPEG', 'N', 'N', 0, 'admin', '2024-07-12 06:55:29', '2024-07-12 15:56:55'),
	(1009, '', '7월 여가활동 - 네일아트', '여가활동으로 어르신들에게 네일을 해드렸습니다. 어르신들은 오랜만에 꾸미는 손톱을 보고 기뻐하고 즐거워하였습니다.  어르신들을 직접 색깔도 선택하며 재밌는 시간을 보냈습니다. ', 'img_20240712155603fD478jNhGd.JPEG', 'N', 'N', 0, 'admin', '2024-07-12 06:56:16', '2024-07-12 15:57:02'),
	(1010, '', '7월 미술치료 - 삼계탕만들기', '복날을 맞이하여 어르신들과 함께 삼계탕 만드는 시간을 가졌습니다. 삼계탕 재료들을 색칠하고 그릇위에 재료들을 붙여넣었습니다. 위와같은 활동을 통해 어르신들에게 복날이란 기념일을 안내해주고 손근육을 발달 시킬 수 있는 시간이 되었습니다. ', 'img_20240719162107cGmODojefC.JPEG', 'N', 'N', 1, 'admin', '2024-07-19 07:22:36', '2024-07-19 16:25:19'),
	(1011, '', '7월 놀이치료 - 퍼즐 맞추기', '퍼즐 조각을 맞추며 어르신들 인지의 잔존 기능을 유지시켜 드릴 수 있었고, 조각이 많은 퍼즐은 부분 보조하여 같이 맞추기를 마무리 하였습니다.', 'img_20240719162241yG8TW3i6hA.JPEG', 'N', 'N', 0, 'admin', '2024-07-19 07:22:53', '2024-07-19 16:25:27'),
	(1012, '', '7월 인지치료 - 덧셈,뺄셈하기', '어르신들에게 덧셈뺄셈 교안을 보여주고 활동함으로써 어르신들의 숫자 및 기호인식에 도움을 드렸습니다. 어르신들은 교안을 보고 스스로 막힘없이 숫자를 계산하였습니다. 어려운 부분은 옆에서 보조하며 어르신들의 자존감을 높여주는 활동이 되었습니다.', 'img_20240719162256dzDRpxCyJ9.JPEG', 'N', 'N', 1, 'admin', '2024-07-19 07:23:08', '2024-07-19 16:25:38'),
	(1013, '', '7월 미술치료 - 색칠하기', '어르신들에게 여러 도안을 보여드린 후 마음에 드는 도안을 선택할 수 있는 시간을 가졌습니다. 어르신들은 예쁜 도안을 고르며 본인이 원하는 색으로 예쁘게 칠했습니다. 색칠하기 활동을 통해 어르신들의 소근육을 발달시킬 수 있는 시간이 되었습니다. ', 'img_2024071916231519cCGU7S8E.JPEG', 'N', 'N', 0, 'admin', '2024-07-19 07:23:34', '2024-07-19 16:25:44'),
	(1014, '', '7월 인지치료 - 수 세어보기', '어르신들에게 숫자가 쓰여진  가격표를 보여드린 후, 알맞는 돈을 내는 활동을 진행했습니다. 어르신들은 어려워하며 곧잘 해내는 모습을 보고 칭찬해주었습니다. 위와같은 활동을 통해 어르신들의 인지능력 향상 및 사회생활 능력을 길러줄 수 있는 시간이 되었습니다  ', 'img_20240719162338aAvi5N4Lf8.JPEG', 'N', 'N', 0, 'admin', '2024-07-19 07:25:03', '2024-07-19 16:25:51'),
	(1015, '', '7월 미술치료 - 점선따라 그리기', '어르신들에게 점선이 그려진 그림 도안을 나눠드리고 점선에 따라 선을 그을 수 있게끔 도와드렸습니다.어르신들은 숫자 순서대로 선을 그어가며 도안을 완성하였습니다. 활동을 통해 어르신들의 소근육 발달 및 집중력 향상에도 도움이 되었습니다.', 'img_20240726084456p2soQnhd0q.JPEG', 'N', 'N', 1, 'admin', '2024-07-25 23:45:15', '0000-00-00 00:00:00'),
	(1016, '', '7월 놀이치료 - 도형쌓기', '어르신과 나무블록을 가지고 젠가놀이를 진행했습니다. 처음에는 어려운 듯이 머뭇거렸으나 점차 활동에 재미를 붙여 즐겁게 치료를 완료했습니다. 어르신은 떨리는 손을 붙잡고 나무블록을 쓰러뜨리지 않기 위해 집중하였고 성공할때마다 박수를 치며 크게 웃었습니다. 활동을 통해 어르신들의 집중력을 높일 수 있는 시간이 되었습니다.', 'img_20240726084619xLoqEnki7w.JPEG', 'N', 'N', 2, 'admin', '2024-07-25 23:46:54', '0000-00-00 00:00:00'),
	(1017, '', '7월 인지치료 - 그림 카드 맞추기', '어르신들에게 반으로 갈라진 그림을 보여드린 후 나머지 반을 생각하여 맞추게끔 유도하였습니다. 어르신들은 쉬운 동물그림은 빠르게 맞췄지만 어려운문제는 잘못된 동물 이름을 말하거나 모르겠다며 어려워 하는모습을 보였습니다. 어르신들은 모든 문제를 맞추어 인지능력에 발달을 높여주는 시간이되었습니다. ', 'img_20240726084659Aky2Dga15w.JPEG', 'N', 'N', 0, 'admin', '2024-07-25 23:48:49', '0000-00-00 00:00:00'),
	(1018, '', '7월 미술치료 - 옥수수그림색칠하기', '어르신들에게 여름철 곡물 음식인 옥수수 그림을 그리는 활동을 진행했습니다. 위와 같은 활동을 통해 어르신들의 손근육 발달을 높일 수 있는 시간이 되었습니다. ', 'img_20240730102807H9B1JZrf0s.JPEG', 'N', 'N', 4, 'admin', '2024-07-30 01:29:03', '0000-00-00 00:00:00'),
	(1019, '', '7월 미술치료 - 옥수수그림색칠하기', '어르신들에게 여름철 곡물 음식인 옥수수 그림을 그리는 활동을 진행했습니다. 위와 같은 활동을 통해 어르신들의 손근육 발달을 높일 수 있는 시간이 되었습니다. ', 'img_20240805092718IcaECBDGZJ.JPEG', 'N', 'N', 0, 'admin', '2024-08-05 00:27:28', '0000-00-00 00:00:00'),
	(1020, '', '7월 생신잔치', '7월의생신이신 어르신들께 생신잔치를했습니다.', 'img_20240805092942rAVEcgsoaQ.JPEG', 'N', 'N', 0, 'admin', '2024-08-05 00:30:07', '0000-00-00 00:00:00'),
	(1021, '', '8월 미술치료-8월 달력 만들기', ' 어르신들께서 8월 달력 만들기 프로그램에 적극적인 참여 모습을 보이셨고 달력 만들기를 통해 어르신들에게 숫자와 날짜, 요일을 지속적으로 인지시켜 드리고 색칠함으로써 소근육 발달에도 도움을 드릴 수 있는 시간이 되었음.', 'img_202408050934120iKWvyEcBH.JPEG', 'N', 'N', 1, 'admin', '2024-08-05 00:34:16', '0000-00-00 00:00:00'),
