	(1024, '', '8월 인지치료-퍼즐 맞추기', '어르신들께서 퍼즐 맞추기 프로그램에 모두 적극적인 참여 모습을 보이셨고 퍼즐 맞추기를 통해 집중력을 향상시키고 소근육 발달에도 도움을 드릴 수 있는 시간이 되었습니다.', 'img_2024080910225575IOdc8iM2.JPEG', 'N', 'N', 0, 'admin', '2024-08-09 01:24:38', '0000-00-00 00:00:00'),
	(1025, '', '8월 여가활동(네일아트)', '어르신들께서 네일아트 프로그램에 모두 만족하셨습니다.', 'img_20240809102536dYTy1sIX06.JPEG', 'N', 'N', 1, 'admin', '2024-08-09 01:27:37', '0000-00-00 00:00:00'),
	(1026, '', '8월 인지치료-같은 모양 찾기', '어르신들께서 같은 모양 찾기 프로그램에 처음에는 참여 어렵다며 거부하거나 소극적인 참여 모습을 보이셨으나 참여하실수 있도록 자존감을 세워드려 어르신들께서 집중하며 같은모양을 찾아내어 어르신들의 관찰력 및 인지능력을 향상시킬 수 있는 시간이 되었습니다.', 'img_202408091027523ajQyCicU4.JPEG', 'N', 'N', 0, 'admin', '2024-08-09 01:31:27', '0000-00-00 00:00:00'),
	(1027, '', '8월 놀이치료- 풍선배구', '침상에서 지내는 시간이 많고 신체활동이 부족한 어르신들에게  풍선배구를  통해  조금이나마 신체 활동을 유도하고 활력을 들릴 수 있는 시간이 되었습니다.', 'img_20240809143026Nlnp2OHB1s.JPEG', 'N', 'N', 1, 'admin', '2024-08-09 05:30:30', '0000-00-00 00:00:00'),
	(1028, '', '8월 미술치료-태극기 색칠하기', '어르신들께서 색칠하기 프로그램에 모두 관심을 보이며 적극적인 참여 모습을 보이셨고,  위와 같은 활동을 통해 어르신들의 집중력 향상 및 어르신들의 손 근육을 발달시킬 수 있는 시간이 되었습니다.', 'img_20240816144354F82mshNcvJ.JPEG', 'N', 'N', 0, 'admin', '2024-08-16 05:45:23', '0000-00-00 00:00:00'),
	(1029, '', '8월 인지치료- 과거회상(광복절)', '어르신께서 적극적인 참여 모습을 보이셨고 그림을 보며 옛 추억을 떠올리고 대화를  나누며 과거에  회상하는 모습과 광복절을 맞이해서 맞는 인물을 찾아 선긋기를 하며 정서적 교감을 나눌 수 있는 시간이 되었습니다. ', 'img_20240816144641iKbHJcgV9N.JPEG', 'N', 'N', 1, 'admin', '2024-08-16 05:54:58', '0000-00-00 00:00:00'),
	(1030, '', '8월 낙상예방교육', '침상에서 생활하는 시간이 많은 와상 어르신들, 보행은 가능하나 불안정한 보행 및 워커 보조로 낙상의 위험이 큰 어르신들에게 지속적으로 낙상의 위험을 알려 드리고 예방법을 설명 드리며 보다 안전한 병동생활이 될 수 있도록 도움을 드렸습니다.', 'img_20240816145619CcSWedjfmG.JPEG', 'N', 'N', 2, 'admin', '2024-08-16 05:56:31', '0000-00-00 00:00:00'),
	(1031, '', '8월 놀이치료- 컵쌓기', '어르신들에게 다양한 컵들을 이용한 컵쌓기에 집중하시며 컵쌓기 프로그램을 통해 어르신들 신체의 잔존 기능을 유지시켜 드리고 집중력을 향상시킬 수 있는 시간이 되었습니다.', 'img_2024081614570468b3yuO2fQ.JPEG', 'N', 'N', 1, 'admin', '2024-08-16 06:00:32', '0000-00-00 00:00:00'),
	(1032, '', '8월 인지치료-덧셈,뺄셈하기', '덧셈,뺄셈을 통해 어르신들 인지의 잔존 기능을 유지시켜 드리고 기억력도 유지시킬 수 있는 시간이 되었습니다.', 'img_20240823151411l4AQ2xkhpg.JPEG', 'N', 'N', 3, 'admin', '2024-08-23 06:18:28', '0000-00-00 00:00:00'),
	(1033, '', '8월 미술치료-종이접기', '활동을 통해 어르신들 소근육 발달 및 감각 발달에도 도움을 드릴 수 있는 시간이 되었습니다.', 'img_2024082315200757XDNE3JiB.JPEG', 'N', 'N', 2, 'admin', '2024-08-23 06:21:20', '0000-00-00 00:00:00'),
	(1034, '', '8월 인지치료-학습지활동', '어르신께서 다양한 학습지 활동 프로그램에 적극적인 참여 모습을 보이셨고 다양한 학습지를 적어보면서 두뇌발달 및 집중력을 향상시키는 시간이 되었습니다.', 'img_20240823152135sOrGEnHAQt.JPEG', 'N', 'N', 2, 'admin', '2024-08-23 06:22:45', '0000-00-00 00:00:00'),
