	(1036, '', '놀이치료-스틱게임', '스틱게임 활동을 함으로써 좌우, 전후의 공간관계를 감각을 통해 파악하는 공간지각 능력을 발달 시킬 수 있는 시간이 되었습니다.', 'img_20240823152543qN01DHk9vd.JPEG', 'N', 'N', 4, 'admin', '2024-08-23 07:34:51', '0000-00-00 00:00:00'),
