-- 테이블 dbgeumsa.geumsa_board 구조 내보내기
CREATE TABLE IF NOT EXISTS `geumsa_board` (
  `bbs_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '글 고유키',
  `bbs_type` varchar(30) NOT NULL DEFAULT 'notice' COMMENT '게시판 타입',
  `bbs_category` varchar(20) NOT NULL DEFAULT '' COMMENT '글 구분',
  `bbs_title` varchar(200) DEFAULT '' COMMENT '글 제목',
  `bbs_contents` text COMMENT '글 내용',
  `usr_id` char(20) NOT NULL DEFAULT '' COMMENT '작성자 ID',
  `bbs_notice_flag` char(1) DEFAULT 'N',
  `bbs_att` int(11) unsigned DEFAULT '0' COMMENT '첨부파일 고유키',
  `is_delete` char(1) DEFAULT 'N' COMMENT '글 삭제 구분',
  `is_view` varchar(1) DEFAULT 'N' COMMENT '홈페이지에 보여주기 구분',
  `bbs_views` int(11) unsigned DEFAULT '0' COMMENT '조회수',
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '생성일자',
  `updated` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '수정일자',
  PRIMARY KEY (`bbs_id`),
  KEY `IDX_BBS_TITLE` (`bbs_title`),
  KEY `IDX_BBS_TYPE` (`bbs_type`),
  KEY `IDX_BBS_USR_ID` (`usr_id`),
  KEY `IDX_BBS_CREATED` (`created`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COMMENT='게시판';

